(function(){

    /* *** amazon video bidding alongside jwplayer prebid.js bidding *** */

    var debug = window.location.search.match(/(amzn_video_test_ad|amzn_video_debug)/);

    // only set up once
    if (window.__jwpb_listeners_created) return;
    window.__jwpb_listeners_created = true;

    polyfill(); // func defined near bottom

    // jwplayer instance of prebid
    jwpb = window.jwpb || {};
    jwpb.cmd = jwpb.cmd || [];

    jwpb.cmd.push(function(){

        var amazonAuctions = {};
        var amazonAllBids = [];
        jwpb.onEvent('auctionInit', function(data){

            log('jw prebid auctionInit - pre', data);

            var amazonAuction = { auctionId: data.auctionId, jw: {} };
            amazonAuctions[data.auctionId] = amazonAuction;

            var jw_bidrequest, tag, og_tag;
            var codes = (data.adUnits || []).map(function(adUnit){
                return adUnit.code
            });
            if (!codes.length) {
                log('jw prebid auctionInit - punting(no ad codes)', data);
                return;
            }

            var player = getJwPlayers().find(function(p){
                return codes.find(function(code){
                    return jw_bidrequest = p.getPlugin('bidding').getBid(code);
                })
            });
            if (!player || !player.id) {
                log('jw prebid auctionInit - punting(no jw player object)', data);
                return;
            }

            var bidding = player.getPlugin('bidding');
            if (!bidding) {
                log('jw prebid auctionInit - punting(no jw player bidding plugin)', data);
                return;
            }

            // if jw ever starts requesting more than one ad per auction, this will need to change
            var ad_schedule = player.getConfig().advertising.schedule.find(function(schedule){
                var tags_match, units_match, positions_match;
                try {
                    var tag1 = schedule.tag || '';
                    var tag2 = jw_bidrequest.params.tag || '';
                    tags_match = tag1 === tag2 || tag1.replace(/cust_params=.*?(&$#)/, '') == tag2.replace(/cust_params=.*?(&$#)/, '');

                    var unit1 = getAdUnitFromVastTag(tag1);
                    var unit2 = getAdUnitFromVastTag(tag2);
                    units_match = (unit1 && unit2) && unit1 == unit2;

                    var offset1 = schedule.offset;
                    var offset2 = jw_bidrequest.params.offset;
                    positions_match = ((offset1 && offset2) && offset1 == offset2) || offset2 === undefined;
                    /* note: ( || offset2 === undefined ) -> jwplayer bidding plugin changed and no longer has this value defined, so making match optional */
                }catch(e){
                    logError('while finding jw ad_schedule (auctionEnd)', e);
                }
                return tags_match && units_match && positions_match;
            });

            amazonAuction.jw.player = player;
            amazonAuction.jw.bid_request = jw_bidrequest;
            amazonAuction.jw.bidding_plugin = bidding;
            amazonAuction.jw.ad_schedule = ad_schedule;
            try{
                amazonAuction.jw.bid_request.params.tag = resetAmazonVastCustParams(amazonAuction.jw.bid_request.params.tag);
                amazonAuction.jw.ad_schedule.tag = resetAmazonVastCustParams(amazonAuction.jw.ad_schedule.tag);
            }catch(e){
                logError('resetting vast tags', e);
            }


            var amazonSlots = codes.map(function(code){
                return {
                    slotID: 'videoSlot',
                    mediaType: 'video'
                }
            });

            try{
                if (amazonSlots.length && window.apstag) {

                    var apstag_fetchBids_config = { slots:amazonSlots, timeout: data.timeout ? parseInt(data.timeout / 2) : 1000 };

                    log('amazon.fetchBids', {
                        apstag: window.apstag,
                        apstag_fetchBids_config: apstag_fetchBids_config
                    });

                    apstag.fetchBids(apstag_fetchBids_config, function(bids){
                        amazonAuction.bids = bids;
                        amazonAllBids = amazonAllBids.concat(bids);
                        log('amazonResponse', {
                            lateResponse: amazonAuction.ended ? "true, prebid auction ended first - won't use amazon bids" : false,
                            amazonAuction: amazonAuction,
                            bids: bids,
                            allBids: amazonAllBids,
                            usedBids: amazonAllBids.filter(function(b) { return b.__used; })
                        });
                        addAmazonCustParamsToVast(amazonAuction, amazonAllBids);

                    });
                } else {
                    log('amazonLoaded?', {
                        amazonSlots: amazonSlots,
                        apstag: window.apstag,
                        amazonAuction: amazonAuction
                    });
                }
            }catch(e){
                logError('fetching bids', e);
            }
            log('jw prebid auctionInit - post', {
                data: data,
                amazonAuction: amazonAuction,
                amazonAllBids: amazonAllBids
            });
        });

        jwpb.onEvent('auctionEnd', function(data){
            try{
                var amazonAuction = amazonAuctions[data.auctionId] = amazonAuctions[data.auctionId] || { auctionId: data.auctionId };
                amazonAuction.ended = true;
                var codes = (data.adUnits || []).map(function(adUnit){
                    return adUnit.code
                });
                var prebidBids = jwpb.getHighestCpmBids(codes);
                log('jw prebid auctionEnd', {
                    amazonAuction: amazonAuction,
                    prebidBids: prebidBids,
                    data: data,
                    amazonAuctions: amazonAuctions,
                    amazonAllBids: amazonAllBids
                });
            }catch(e){
                logError('prebid auctionEnd', e);
            }
        });

    });

    function resetAmazonVastCustParams(tag) {
        try{
            var matches = tag.match(/(?:&|\?)cust_params=(.*?)(?:&|$|#)/);
            if (matches && matches.length > 1 && matches[1].length) {
                var qs = decodeURIComponent(matches[1]);
                qs = qs.split('&')
                    .filter(function(kv){
                        return !kv.match(/^amzn(bid|iid|p)=/);
                    })
                .join('&');
                if (matches[1] !== encodeURIComponent(qs)) {
                    log('resetAmazonVastCustParams', {
                        old: matches[1],
                        new: encodeURIComponent(qs),
                        tag: tag
                    });
                    return tag
                        .replace(matches[1], encodeURIComponent(qs))
                        .replace(/cust_params=(%26)+/,'cust_params=')
                        .replace(/(%26){2,}/, '%26');
                }
                return tag;
            }
        }catch(e){
            logError('resetAmazonVastCustParams', e);
        }
        return tag;
    }

    function addAmazonCustParamsToVast(auction, allBids){
        try{
            log("addAmazonCustParamsToVast", {auction:auction});
            var bid;
            var unusedBids = allBids.filter(function(b){ return !b.__used && b.encodedQsParams; });
            if (auction.bids && auction.bids.length) {
                bid = auction.bids[0];
            } else if (unusedBids.length) {
                bid = unusedBids[0];
            }
            if (!bid || !bid.encodedQsParams) {
                log("addAmazonCustParamsToVast no bid", bid);
                return;
            }
            // mark bid as used
            bid.__used = true;

            if (!auction.jw.bid_request.params.tag.match(/cust_params=/)) { auction.jw.bid_request.params.tag += '&cust_params='; }
            if (!auction.jw.ad_schedule.tag.match(/cust_params=/)) {auction.jw.ad_schedule.tag += '&cust_params=';}
            // remove any previous amazon key/vals
            auction.jw.bid_request.params.tag = resetAmazonVastCustParams(auction.jw.bid_request.params.tag);
            auction.jw.ad_schedule.tag = resetAmazonVastCustParams(auction.jw.ad_schedule.tag);
            // add amazon bid key/vals
            // have to alter both, if there are prebid bids jw uses the bid request tag, otherwise fallsback on the ad schedule tag
            auction.jw.bid_request.params.tag = auction.jw.bid_request.params.tag
                .replace(/cust_params=/, 'cust_params=' + bid.encodedQsParams + '%26')
                .replace(/cust_params=(%26)+/,'cust_params=')
                .replace(/(%26){2,}/, '%26');
            auction.jw.ad_schedule.tag = auction.jw.ad_schedule.tag
                .replace(/cust_params=/, 'cust_params=' + bid.encodedQsParams + '%26')
                .replace(/cust_params=(%26)+/,'cust_params=')
                .replace(/(%26){2,}/, '%26');
        }catch(e){
            logError("addAmazonCustParamsToVast", e);
        }
    }

    function getAdUnitFromVastTag(tag) {
        var matches = tag.match(/[&?]iu=(\/.*?)($|&|#)/);
        if (matches && matches.length > 1) {
            return matches[1];
        }
        return '';
    }
    function getJwPlayers(){
        var i=0, players=[], player;
        try{
            while ((player = jwplayer(i++)) && player.id) {
                players.push(player);
            }
        }catch(e){
            logError("getJwPlayers", e);
        }
        return players;
    }

    var logStyle = 'display: inline-block; color: #FF9900; background: #131A22; padding: 1px 4px 0; border-radius: 3px;';

    function log(){
        if (!debug) return;
        var args = Array.prototype.slice.call(arguments);
        args.unshift(logStyle);
        args.unshift('%cAmazonVideoBidding');
        console.log.apply(console, args);
    }

    function logError(){
        if (!debug) return;
        var args = Array.prototype.slice.call(arguments);
        args.unshift(logStyle);
        args.unshift('%cAmazonVideoBidding Error');
        console.error.apply(console, args);
    }

