    .concat('/choice/', 'A9b8GRq-NyEYK', '/', host, '/choice.js')
  var uspTries = 0;
  var uspTriesLimit = 3;
  element.async = true;
  element.type = 'text/javascript';
  element.onerror = function(e){
    window.__consentwrapper.push(function(){
      __consentwrapper.log('quantcast cmp failed to load', url);
      __consentwrapper.errorLoading();
    });
  };
