{"@context": "https://schema.org", "@type": "NewsArticle", "url": "https://www.cinemablend.com/news/2546992/why-christopher-nolan-actually-blew-up-a-real-plane-for-tenet", "name": "Why Christopher Nolan Actually Blew Up A Real Plane For Tenet", "description": "There's more to it than just being \"dramatic.\"", "image": {"@type": "ImageObject", "url": "https://img.cinemablend.com/filter:scale/quill/1/1/1/c/1/3/111c13cfebe0d42a8a82db7d91826b9231f542ae.jpg?fw=1200", "width": 1200, "height": 600.0}, "accessModeSufficient": ["textual", "visual"], "copyrightHolder": {"@type": "Organization", "name": "CINEMABLEND", "sameAs": "https://www.cinemablend.com/", "logo": {"@type": "ImageObject", "url": "https://www.cinemablend.com/static/images/logos/cb-logo-blender-google.png"}}, "copyrightYear": 2020, "dateCreated": "2020-05-27T16:02:36+00:00", "dateModified": "2020-05-27T17:04:13+00:00", "datePublished": "2020-05-27T17:04:12+00:00", "publisher": {"@type": "Organization", "name": "CINEMABLEND", "sameAs": "https://www.cinemablend.com/", "logo": {"@type": "ImageObject", "url": "https://www.cinemablend.com/static/images/logos/cb-logo-blender-google.png"}}, "abstract": "There's more to it than just being \"dramatic.\"", "author": {"@type": "Person", "name": "Jason Ingolfsland", "sameAs": "https://www.cinemablend.com/author/jason-ingolfsland/"}, "headline": "Why Christopher Nolan Actually Blew Up A Real Plane For Tenet", "articleBody": "While many directors will heavily use CGI to pull off difficult movie scenes, Christopher Nolan has historically shied away from CGI whenever possible. He famously ditched the approach in The Dark Knight when it come to flipping that truck over in the street and decided to limit green screen in Interstellar. All in all, if he can figure out a practicial way to pull it off, he\u2019ll at the very least consider it.Now, his latest movie, Tenet, is on the way, and the newest trailer that landed gave audiences a taste of his next big cinematic special effects feat in the form of a real 747 plane crashing and blowing up. Christopher Nolan recently opened up about the stunt and why he did. Here\u2019s what he said: I planned to do it using miniatures and set-piece builds and a combination of visual effects and all the rest. We started to run the numbers... It became apparent that it would actually be more efficient to buy a real plane of the real size, and perform this sequence for real in camera, rather than build miniatures or go the CG route. Christopher Nolan's comments to Total Film aren't completely shocking, but it is surprising that it was more efficient to blow up a real plane instead of using miniatures. Still, we\u2019ll have to take his word for it. It\u2019s also the type of spectacle that works well with audiences, such as how many moviegoers love when Tom Cruise does his own stunts. In some cases, people want the real thing, something Nolan seems to understand.Though buying a 747 plane and blowing it up may have been more efficient, Christopher Nolan later seems to insinuate that it may not have been the cheaper option: It\u2019s a strange thing to talk about \u2013 a kind of impulse buying, I suppose,\u201d laughs Nolan. \u201cBut we kind of did, and it worked very well, with Scott Fisher, our special-effects supervisor, and Nathan Crowley, the production designer, figuring out how to pull off this big sequence in camera. It was a very exciting thing to be a part of. While efficiency was the name of the game for this particular stunt, Christopher Nolan has been notorious for creating incredibly confusing and complicated movies for the cast and crew and audiences alike. Nevertheless, he finds a way to make his heady and mind-bending films palatable for large audiences.For his next trick, Christopher Nolan would like Tenet to be the movie to bring audiences back to theaters. He\u2019s been heavily pushing for theaters to reopen by the for Tenet to hit its July 17 release date. Of course, the final decision isn\u2019t up to Christopher Nolan, and the prospect of theaters opening by that time could be overly optimistic.While it's not confirmed, there's a firm chance Tenet will could delayed by WB so that it can get the proper theatrical run it deserves. And one way or another, Warner Bros. will see to it that it gets a theatrical run, as Christopher Nolan wouldn\u2019t have it any other way.", "articleSection": "news", "mainEntityOfPage": "https://www.cinemablend.com/news/2546992/why-christopher-nolan-actually-blew-up-a-real-plane-for-tenet"}

