{"@context":"https:\/\/schema.org","@type":"NewsArticle","@id":"https:\/\/www.cnx-software.com\/2020\/09\/15\/sifive-to-debut-risc-v-pc-for-developers-based-on-freedom-u740-next-gen-soc\/#newsarticle","url":"https:\/\/www.cnx-software.com\/2020\/09\/15\/sifive-to-debut-risc-v-pc-for-developers-based-on-freedom-u740-next-gen-soc\/","headline":"SiFive to Debut RISC-V PC for Developers based on Freedom U740 next-gen SoC","mainEntityOfPage":"https:\/\/www.cnx-software.com\/2020\/09\/15\/sifive-to-debut-risc-v-pc-for-developers-based-on-freedom-u740-next-gen-soc\/","datePublished":"2020-09-15T10:44:53+07:00","dateModified":"2020-09-15T10:45:48+07:00","description":"SiFive will debut the world's first RISC-V PC in October 2020. The Linux PC will feature a new Freedom U740 RISC-V SoC with modern I\/Os.","articleSection":"SiFive","articleBody":"In recent years, people have discussed the need to have Arm-based PCs or workstations for developers to work directly on the target hardware, and there are now several options including SynQuacer E-Series 24-Core Arm PC, Ampere eMAG 64bit Arm Workstation, and HoneyComb LX2K 16-core Arm Workstation.    Now it appears we'll soon get something similar for RISC-V architecture with SiFive to debut the first RISC-V PC for developers at the Linley Fall Processor Conference 2020 taking place on October 20-22 and October 27-29. The PC will be powered by Freedom U740 next-generation RISC-V processor that will also be introduced at the event.        We have very few details about this point in time, but the company points the SiFive Freedom U740 (FU740) SoC will enable professional developers to create RISC-V applications from bare-metal to Linux-based. The processor is said to combines a heterogeneous mix+match core complex with modern PC expansion capabilities, which probably means PCIe, SATA etc.., and the company will provide tools to ease professional software development.    We'll find out more next month, as Dr. Yunsup Lee, CTO of SiFiv, will showcase the \"world\u2019s first RISC-V PC\" at the Linley Conference. That does not necessarily mean it will be launched at that time, but at least there will be a working demo. Technically, it's not the first RISC-V PC, as some people previously made a PC with HiFive Unleashed RISC-V Linux board, but SiFive PC should be the first one that's usable and commercially available.    You may find a few more details on the press release, but the best way to find more details is to register for free to the Linley Group Fall Virtual Processor Conference 2020 that is intended for chip designers, system designers, equipment vendors, OEM\/ODMs, service providers, press, and the financial community.","keywords":"Linux, risc-v, sifive, ","name":"SiFive to Debut RISC-V PC for Developers based on Freedom U740 next-gen SoC","thumbnailUrl":"https:\/\/www.cnx-software.com\/wp-content\/uploads\/2020\/09\/RISC-V-PC-300x258.jpg","wordCount":"307","timeRequired":"PT1M21S","mainEntity":{"@type":"WebPage","@id":"https:\/\/www.cnx-software.com\/2020\/09\/15\/sifive-to-debut-risc-v-pc-for-developers-based-on-freedom-u740-next-gen-soc\/"},"author":{"@type":"Person","name":"Jean-Luc Aufranc (CNXSoft)","description":"Jean-Luc started CNX Software in 2010 as a part-time endeavor, before quitting his job as a software engineering manager, and starting to write daily news, and reviews full time later in 2011.","url":"https:\/\/www.cnx-software.com\/author\/cnxsoft\/","sameAs":["http:\/\/www.cnx-software.com","cnxsoft","https:\/\/www.linkedin.com\/in\/cnxsoft\/"],"image":{"@type":"ImageObject","url":"https:\/\/www.cnx-software.com\/wp-content\/uploads\/2019\/06\/jean-luc-profile.jpg","height":539,"width":720}},"publisher":{"@type":"Organization","name":"CNX Software Limited","url":"https:\/\/www.cnx-software.com","logo":{"@type":"ImageObject","url":"https:\/\/www.cnx-software.com\/wp-content\/uploads\/2018\/03\/cropped-cnxsoft-logo-square-1.jpg","width":"250","height":"250"}},"image":[{"@ty