inux-based. The processor is said to combines a heterogeneous mix+match core complex with modern PC expansion capabilities, which probably means PCIe, SATA etc.., and the company will provide tools to ease professional software development.We’ll find out more next month, as Dr. Yunsup Lee, CTO of SiFiv, will showcase the “world’s first RISC-V PC” at the Linley Conference. That does not necessarily mean it will be launched at that time, but at least there will be a working demo. Technically, it’s not the first RISC-V PC, as some people previously made a PC with HiFive Unleashed RISC-V Linux board, but SiFive PC should be the first one that’s usable and commercially available.You may find a few more details on the press release, but the best way to find more details is to register for free to the Linley Group Fall Virtual Processor Conference 2020 that is intended for chip designers, system designers, equipment vendors, OEM/ODMs, service providers, press, and the financial community.Jean-Luc Aufranc (CNXSoft)Jean-Luc started CNX Software in 2010 as a part-time endeavor, before quitting his job as a software engineering manager, and starting to write daily news, and reviews full time later in 2011.Support CNX Software - Donate via PayPal, become a Patron on Patreon, or buy review samplesAdvertisements  Your browser does not support the video tag.Related posts:SiFive Introduces HiFive Unleashed RISC-V Linux Development Board (Crowdfunding) RISC-V Keynote at Embedded Linux Conference 2018 (Video) HiFive Unleashed RISC-V Linux Development Board Gets a $2000 FPGA Expansion Board SiFive Introduces 7 Series RISC-V Cores with E7, S7 and U7 series Linux 5.8 Release – Main Changes, Arm, MIPS, and RISC-V Architectures  googletag.cmd.push(function() { googletag.display('div-gpt-ad-1597905513858-0'); });CategoriesHardware, Linux, SiFiveTagsLinux, risc-v, sifiveConnect with:      Subscribe   LoginNotify of new follow-up commentsnew replies to my comments              {} [+]  Name* 