        var thingId = getThingId(getDestination());
        if (thingId) {
            document.getElementById('textLink').href = "https://text.npr.org/r.php?id=" + thingId;
        }

        if (hasOrigin() && hasPreviouslyAcceptedChoiceOptions()) {
