ed a direct feed of the Facebook Connect presentation offered by John Carmack at 5:30PM PT on Sept. 16, 2020.\\n\\nJohn Carmack, the Consulting CTO for Facebook Reality Labs, gives his yearly technical breakdown on new Oculus news - including Oculus Quest 2 and future VR headset requirements- in this unscripted live keynote.\\n\\nDon't forget to read our full review of the Oculus Quest 2 right here: https:\/\/uploadvr.com\/oculus-quest-2-review\/\\n\\n00:00:00 John Carmack starts talking\\n00:03:03 “Global lockdown and pandemic...\\\"\\n00:04:35 “Frankly I’m kind of embarrassed by our social story here…”\\n00:05:12 “Location-based VR has probably taken a terminal hit…”\\n00:06:00  \\\"People are ok with making a sweaty mess in their own personal  headset..”\\n00:12:07 “Reality...just seamlessly flows into the simulation...”\\n00:14:06 “Quest 2 is better, faster, cheaper, and we’re making a ton more of them...\\\"\\n00:14:54 “\\\"Resolution is 3664x1920...”\\n00:16:33 “You could start doing some real work with it...\\\"\\n00:18:34 “Best display that we’ve ever had...\\\"\\n00:31:29 “Still haven’t announced a full wireless connection system for Link...we should have some kind of an Air Link”\\n00:32:47 Qualcomm XR2\\n00:59:12 “Whatever the next headset is we’ve got to get higher resolution on the tracking cameras.”\\n01:00:45 “We did look at this for the latter days of Gear VR, doing this kind of two part plug-in instead of drop-in, and there may still be some useful things to go there.”\\n01:00:59 “There are still some things for which Go is the best headset”\\n01:02:04 “Putting on the headset should be as seamless as answering a phone call…”\\n1:02:31 “Having things converged now on our VR platforms is an enormous relief...\\\"\\n1:03:12 “This low-powered gaming focused device which wasn’t really what anybody was aiming for at the beginning…”\\n1:05:17 “Getting the more inexpensive systems out on VR is critical...\\\"\\n1:08:47 “Maybe you have a controller-free SKU where the controllers are more expensive but they never lose tracking…”\\n1:12:06 “It is all about the headset learning to understand the world around it…”\\n1:18:41 “Our push to be a general purpose computing system…”\\n1:19:40 “We need more Android applications…”\\n1:21:40 “I think I’m about done here…\\\"\\n\\nFor VR news \\u0026 reviews: http:\/\/www.uploadvr.com\\n\\nFollow us!\\n📘  Facebook: https:\/\/www.facebook.com\/uploadvr\/\\n🐦 Twitter: https:\/\/twitter.com\/UploadVR\\n⌨️ Discord: https:\/\/discord.gg\/VNA7fWd\\n\\n#FacebookConnect #OculusConnect #JohnCarmack\"},\"lengthSeconds\":\"4915\",\"ownerProfileUrl\":\"http:\/\/www.youtube.com\/channel\/UCqDMvCa1tGak6AmijajiKOw\",\"externalChannelId\":\"UCqDMvCa1tGak6AmijajiKOw\",\"isFamilySafe\":true,\"availableCountries\":[\"AD\",\"AE\",\"AF\",\"AG\",\"AI\",\"AL\",\"AM\",\"AO\",\"AQ\",\"AR\",\"AS\",\"AT\",\"AU\",\"AW\",\"AX\",\"AZ\",\"BA\",\"BB\",\"BD\",\"BE\",\"BF\",\"BG\",\"BH\",\"BI\",\"BJ\",\"BL\",\"BM\",\"BN\",\"BO\",\"BQ\",\"BR\",\"BS\",\"BT\",\"BV\",\"BW\",\"BY\",\"BZ\",\"CA\",\"CC\",\"CD\",\"CF\",\"CG\",\"CH\",\"CI\",\"CK\",\"CL\",\"CM\",\"CN\",\"CO\",\"CR\",\"CU\",\"CV\",\"CW\",\"CX\",\"CY\",\"CZ\",\"DE\",\"DJ\",\"DK\",\"DM\",\"DO\",\"DZ\",\"EC\",\"EE\",\"EG\",\"EH\",\"ER\",\"ES\",\"ET\",\"FI\",\"FJ\",\"FK\",\"FM\",\"FO\",\"FR\",\"GA\",\"GB\",\"GD\",\"GE\",\"GF\",\"GG\",\"GH\",\"GI\",\"GL\",\"GM\",\"GN\",\"GP\",\"GQ\",\"GR\",\"GS\",\"GT\",\"GU\",\"GW\",\"GY\",\"HK\",\"HM\",\"HN\",\"HR\",\"HT\",\"HU\",\"ID\",\"IE\",\"IL\",\"IM\",\"IN\",\"IO\",\"IQ\",\"IR\",\"IS\",\"IT\",\"JE\",\"JM\",\"JO\",\"JP\",\"KE\",\"KG\",\"KH\",\"KI\",\"KM\",\"KN\",\"KP\",\"KR\",\"KW\",\"KY\",\"KZ\",\"LA\",\"LB\",\"LC\",\"LI\",\"LK\",\"LR\",\"LS\",\"LT\",\"LU\",\"LV\",\"LY\",\"MA\",\"MC\",\"MD\",\"ME\",\"MF\",\"MG\",\"MH\",\"MK\",\"ML\",\"MM\",\"MN\",\"MO\",\"MP\",\"MQ\",\"MR\",\"MS\",\"MT\",\"MU\",\"MV\",\"MW\",\"MX\",\"MY\",\"MZ\",\"NA\",\"NC\",\"NE\",\"NF\",\"NG\",\"NI\",\"NL\",\"NO\",\"NP\",\"NR\",\"NU\",\"NZ\",\"OM\",\"PA\"