h0mRA9z","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=sXmY26pOE-Y\u0026t=1889s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"sXmY26pOE-Y","continuePlayback":true,"startTimeSeconds":1889}}},{"text":" “Still haven’t announced a full wireless connection system for Link...we should have some kind of an Air Link”\n"},{"text":"00:32:47","navigationEndpoint":{"clickTrackingParams":"CM0BEM2rARgBIhMI_vHoi9GA7AIVzyOyCh0mRA9z","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=sXmY26pOE-Y\u0026t=1967s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"sXmY26pOE-Y","continuePlayback":true,"startTimeSeconds":1967}}},{"text":" Qualcomm XR2\n"},{"text":"00:59:12","navigationEndpoint":{"clickTrackingParams":"CM0BEM2rARgBIhMI_vHoi9GA7AIVzyOyCh0mRA9z","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=sXmY26pOE-Y\u0026t=3552s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"sXmY26pOE-Y","continuePlayback":true,"startTimeSeconds":3552}}},{"text":" “Whatever the next headset is we’ve got to get higher resolution on the tracking cameras.”\n"},{"text":"01:00:45","navigationEndpoint":{"clickTrackingParams":"CM0BEM2rARgBIhMI_vHoi9GA7AIVzyOyCh0mRA9z","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=sXmY26pOE-Y\u0026t=3645s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"sXmY26pOE-Y","continuePlayback":true,"startTimeSeconds":3645}}},{"text":" “We did look at this for the latter days of Gear VR, doing this kind of two part plug-in instead of drop-in, and there may still be some useful things to go there.”\n"},{"text":"01:00:59","navigationEndpoint":{"clickTrackingParams":"CM0BEM2rARgBIhMI_vHoi9GA7AIVzyOyCh0mRA9z","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=sXmY26pOE-Y\u0026t=3659s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"sXmY26pOE-Y","continuePlayback":true,"startTimeSeconds":3659}}},{"text":" “There are still some things for which Go is the best headset”\n"},{"text":"01:02:04","navigationEndpoint":{"clickTrackingParams":"CM0BEM2rARgBIhMI_vHoi9GA7AIVzyOyCh0mRA9z","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=sXmY26pOE-Y\u0026t=3724s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"sXmY26pOE-Y","continuePlayback":true,"startTimeSeconds":3724}}},{"text":" “Putting on the headset should be as seamless as answering a phone call…”\n"},{"text":"1:02:31","navigationEndpoint":{"clickTrackingParams":"CM0BEM2rARgBIhMI_vHoi9GA7AIVzyOyCh0mRA9z","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=sXmY26pOE-Y\u0026t=3751s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"sXmY26pOE-Y","continuePlayback":true,"startTimeSeconds":3751}}},{"text":" “Having things converged now on our VR platforms is an enormous relief...\"\n"},{"text":"1:03:12","navigationEndpoint":{"clickTrackingParams":"CM0BEM2rARgBIhMI_vHoi9GA7AIVzyOyCh0mRA9z","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=sXmY26pOE-Y\u0026t=3792s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"sXmY26pOE-Y","continuePlayback":true,"startTimeSeconds":3792}}},{"text":" “This low-powered gaming focused device which wasn’t really what anybody was aiming for at the beginning…”\n"},{"text":"1:05:17","navigationEndpoint":{"clickTrackingParams":"CM0BEM2rARgBIhMI_vHoi9GA7AIVzyOyCh0mRA9z","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=sXmY26pOE-Y\u0026t=3917s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"sXmY26pOE-Y","continuePlayback":true,"startTimeSeconds":3917}}},{"text":" “Getting the more inexpensive systems out on VR is critical...\"\n"},{"text":"1:08:47","navigationEndpoint":{"clickTrackingParams":"CM0BEM2rARgBIhMI_vHoi9GA7AIVzyOyCh0mRA9z","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=sXmY26pOE-Y\u0026t=4127s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"sXmY26pOE-Y","continuePlayback":true,"startTimeSeconds":4127}}},{"text":" “Maybe you have a controller-free SKU where the controllers are more expensive but they never lose tracking…”\n"},{"text":"1:12:06","navigationEndpoint":{"clickTrackingParams":"CM0BEM2rARgBIhMI_vHoi9GA7AIVzyOyCh0mRA9z","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=sXmY26pOE-Y\u0026t=4326s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"sXmY26pOE-Y","continuePlayback":true,"startTimeSeconds":4326}}},{"text":" “It is all about the headset learning to understand the world around it…”\n"},{"text":"1:18:41","navigationEndpoint":{"clickTrackingParams":"CM0BEM2rARgBIhMI_vHoi9GA7AIVzyOyCh0mRA9z","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=sXmY26pOE-Y\u0026t=4721s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"sXmY26pOE-Y","continuePlayback":true,"startTimeSeconds":4721}}},{"text":" “Our push to be a general purpose computing system…”\n"},{"text":"1:19:40","navigationEndpoint":{"clickTrackingParams":"CM0BEM2rARgBIhMI_vHoi9GA7AIVzyOyCh0mRA9z","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=sXmY26pOE-Y\u0026t=4780s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"sXmY26pOE-Y","continuePlayback":true,"startTimeSeconds":4780}}},{"text":" “We need more Android applications…”\n"},{"text":"1:21:40","navigationEndpoint":{"clickTrackingParams":"CM0BEM2rARgBIhMI_vHoi9GA7AIVzyOyCh0mRA9z","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=sXmY26pOE-Y\u0026t=4900s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"sXmY26pOE-Y","continuePlayback":true,"startTimeSeconds":4900}}},{"text":" “I think I’m about done here…\"\n\nFor VR news \u0026 reviews: "},{"text":"http://www.uploadvr.com","navigationEndpoint":{"clickTrackingParams":"CM0BEM2rARgBIhMI_vHoi9GA7AIVzyOyCh0mRA9zSOanuNK6m-a8sQE=","commandM