                Facebook Accused of Watching Instagram Users Through Cameras

                By 
        Robert Burnson
    , 

            September 17, 2020, 9:16 PM EDT







                User of photo-sharing app files privacy suit in San Francisco




                Company blamed bug, which it fixed, for false notifications







