        {"contentId":"QGTWSYT0AFBF01","position":"brokerboxarticle","dimensions":{"large_desktop":[[120,60]],"small_desktop":[[120,60]],"tablet":[[120,60]]},"strategy":"viewable","positionIncrement":1,"targeting":{"position":"brokerboxarticle1","url":"/news/articles/2020-09-18/facebook-accused-of-watching-instagram-users-through-cameras"},"containerId":"brokerboxarticle-SEnSalC"}

            Photographer: Gabby Jones/Bloomberg




        Photographer: Gabby Jones/Bloomberg


    Facebook Inc. is again being sued for allegedly spying on Instagram users, this time through the unauthorized use of their mobile phone cameras.The lawsuit springs from media reports in July that the photo-sharing app appeared to be accessing iPhone cameras even when they weren’t actively being used.Facebook denied the reports and blamed a bug, which it said it was correcting, for triggering what it described as false notifications that Instagram was accessing iPhone cameras.In the complaint filed Thursday in federal court in San Francisco, New Jersey Instagram user Brittany Conditi contends the app’s use of the camera is intentional and done for the purpose of collecting “lucrative and valuable data on its users that it would not otherwise have access to.”

            {"contentId":"QGTWSYT0AFBF01","position":"outstream","dimensions":{"large_desktop":[[1,8]],"small_desktop":[[1,8]],"tablet":[[1,8]]},"strategy":"always","type":"Outstream Video Native Ad","targeting":{"position":"outstream","url":"/news/articles/2020-09-18/facebook-accused-of-watching-instagram-users-through-cameras"},"containerId":"outstream-video-1-QGTWSYT0AFBF01"}



            {"contentId":"QGTWSYT0AFBF01","position":"outstream","dimensions":{"mobile":[[1,8]]},"strategy":"always","type":"Outstream Video Native Ad","targeting":{"position":"outstream","url":"/news/articles/2020-09-18/facebook-accused-of-watching-instagram-users-through-cameras"},"containerId":"outstream-video-2-QGTWSYT0AFBF01"}

        By “obtaining extremely private and intimate personal data on their users, including in the privacy of their own homes,” Instagram and Facebook are able to collect “valuable insights and market research,” according to the complaint.

            {"contentId":"QGTWSYT0AFBF01","position":"box","dimensions":{"mobile":[[300,250],[3,3],[1,1],"fluid"]},"type":"Mobile Body Box Ad","positionIncrement":1,"targeting":{"position":"box1","positionIncrement":1,"url":"/news/articles/2020-09-18/facebook-accused-of-watching-instagram-users-through-cameras"},"containerId":"box-zbgQ6K4"}

        Facebook declined to comment.In a suit filed last month, Facebook was accused of using facial-recognition technology to illegally harvest the biometric data of its more than 100 million Instagram users. Facebook denied the claim and said that Instagram doesn’t use face recognition technology.The case is Conditi v. Instagram, LLC, 20-cv-06534, U.S. District Court, Northern District of California (San Francisco).(Updates with Facebook declining to comment.)

