            brainworkSubscribeAboutArchiveHelpSign in{"@context":"http://schema.org","@type":"NewsArticle","url":"https://abuqader.substack.com/p/on-browser-tabs","mainEntityOfPage":"https://abuqader.substack.com/p/on-browser-tabs","headline":"On Browser Tabs","description":"It's always surprised me how little I hear about browsers. Browsers are portals. They allow us to to tend to our internet acreage. A lot happens around new sites and apps on the internet but not much has happened to the browser itself. A common problem I have is how browser tabs work. I have a lot of tabs open all the time and I\u2019m not the only one.","image":[{"@type":"ImageObject","url":"https://cdn.substack.com/image/fetch/h_600,c_limit,f_auto,q_auto:good,fl_progressive:steep/https%3A%2F%2Fbucketeer-e05bbc84-baa3-437e-9518-adb32be77984.s3.amazonaws.com%2Fpublic%2Fimages%2Ffb1a2149-5354-425c-844b-25cb6d577d2c_2033x1324.png"}],"datePublished":"2020-09-17T12:50:41+00:00","dateModified":"2020-09-17T12:50:41+00:00","isAccessibleForFree":true,"author":{"@type":"Person","name":"abu","url":"https://abuqader.substack.com/people/6884459-abu"},"publisher":{"@type":"Organization","name":"brainwork","logo":{"@type":"ImageObject","url":"https://bucketeer-e05bbc84-baa3-437e-9518-adb32be77984.s3.amazonaws.com/public/images/a0a68ee2-e083-4e0d-a1d6-3f728daf6122_800x800.png"}}}On Browser TabsabuSep 17 5Sign up to like postSubscribeLoginPrivacyTermsInformation collection notice 5ShareIt's always surprised me how little I hear about browsers. Browsers are portals. They allow us to to tend to our internet acreage. A lot happens around new sites and apps on the internet but not much has happened to the browser itself. A common problem I have is how browser tabs work. I have a lot of tabs open all the time and I’m not the only one. bitchy moods @girlmoodsssmy brain is like my internet browser. i got like 30 tabs open, 12 of them are glitching.......... and where tf is that music coming fromSeptember 8th 202070 Retweets293 LikesAndrew Lovett-Barron @ReadywaterI just closed a 144 tab browser window that was 100% localhost, github issues, and stack overflow posts.September 11th 20206 Likessexy roy @cup_of_chinogetting mad scrolling through upwards of 80 tabs open on my phone browser but refusing to close any of themSeptember 11th 202010 LikesRaksha Kumar @Raksha_Kumar#Journalists, on an average, how many tabs do you have open?September 11th 20209 Retweets276 LikesWhat do tabs represent? Is this a design problem? Is there a neurological basis? These are questions I’ve been thinking about for a while. Some thoughts below.Browser TabsThe relationship between windows and tabs is important to highlight. When I use a browser window, it's often to organize a mental space. It houses relevant tabs towards a goal. There are edge cases but when I find myself with dozens of tabs, they usually have some common thread. Tabs and windows are functions of our internal cognition. As I find new information, I ask more questions creating more tabs. These tabs represents my train of thought as I discover more information. 
          a.image2.image-link.image2-948-1456 {
            padding-bottom: 65.10989010989012%;
            padding-bottom: min(65.10989010989012%, 948px);
            width: 100%;
            height: 0;
          }
          a.image2.image-link.image2-948-1456 img {
            max-width: 1456px;
            max-height: 948px;
          }
        Many people I know have dozens of windows like this. Tabs so small they can't even see the full title. Keeping these tabs open is a form of externalized working memory. Jumping back in should feel akin to the last time a user was immersed in that window. At some point though, the number of tabs begins to toe the line between externalized memory and information hoarding. The desire to keep tabs open for too long with no end-state is similar to physical hoarding.  I know there are some solutions that "save" tabs. These extensions are designed to snapshot a window and store it. I’ve used these before and find them useful although they still feel very unorganized and stiff. There’s also a significant amount of cognitive load to readjust to all of the information. These solutions address the problem directly but the tab issue is a manifestation of a more “core” issue around organizing goal-driven information consumption. Unpacking the relationship between tabs and cognition may be a step in the right direction. The tab is also just a wrapper around what’s really important: the content inside it. Maybe it’s a paragraph, a piece of code, or a video vs. everything else that comes with the site. Part of the solution here is rethinking the way we organize the information that we think is relevant on a given site. The Seeking CircuitAt the cellular level, this type of behavior is heavily influenced by the seeking circuit in the brain. In some sense, the brain is a collection of different neural circuits executing some desired function. Two of the most prominent circuits are the seeking circuit and the reward circuit [1].  The seeking circuit is on the constant look out for any type of reward. It’s what makes us curious about a new idea and drives us to search for it. Once a the seeking circuit finds something that’s rewarding, the reward circuit is activated. Interestingly enough, the seeking and reward circuits also act on information. The acquisition of information generates reward [2].  Looking for information on the internet activates this circuitry and may be part of the reason why we accumulate so many tabs. As the seeking circuitry seeks, tabs accumulate. An even more important note is the dominance of the seeking circuitry over the reward circuitry [3]. Just because I received a reward doesn’t blunt the desire to continue seeking. The desire to seek for goal-oriented information is also linked to these circuits. Goal-oriented behavior is mediated by dopamine, a critical neurotransmitter in these circuits [3]. It’s incredibly easy to find some information on the internet (regardless of quality). Because of this fast feedback loop, looking for information is a quick and easy way to hijack the reward pathway.Sources[1]: https://www.jimhopper.com/topics/brain-healing-and-happiness/key-brain-circuitries/#seeking-circuitry[2]: https://www.semanticscholar.org/paper/Valuation-of-knowledge-and-ignorance-in-mesolimbic-Charpentier-Bromberg-Martin/130eeb14b2dc857a0aec8beafb05f6b8a6ebe079[3]: http://thebrain.mcgill.ca/flash/capsules/pdf_articles/dopamine.pdfThis was a quick one but something I’ve been noodling on for a couple weeks. I’d love your thoughts or feedback below or on Twitter. Thank you for giving me your time!Subscribe 5Sign up to like postSubscribeLoginPrivacyTermsInformation collection notice 5Share← PreviousCreate your profileSet photo Sign up for the newsletterSave & Post CommentOnly paying subscribers can comment on this postAlready a paying subscriber? Sign inCheck your emailWe sent an email to  with a link to finish logging in.John EddySep 18Vivaldi has tab stacking/tiling and a sidebar tab management pane: https://vivaldi.com/features/tab-management/Sign up to like commentSubscribeLoginPrivacyTermsInformation collection noticeReplyJanSep 18Maybe give my Browser Extension »Tab Ahead« a try. https://github.com/janraasch/tab-aheadSign up to like commentSubscribeLoginPrivacyTermsInformation collection noticeReply3 more