-adb32be77984.s3.amazonaws.com%2Fpublic%2Fimages%2Ffb1a2149-5354-425c-844b-25cb6d577d2c_2033x1324.png\"><img src=\"https://cdn.substack.com/image/fetch/w_1456,c_limit,f_auto,q_auto:good,fl_progressive:steep/https%3A%2F%2Fbucketeer-e05bbc84-baa3-437e-9518-adb32be77984.s3.amazonaws.com%2Fpublic%2Fimages%2Ffb1a2149-5354-425c-844b-25cb6d577d2c_2033x1324.png\" data-attrs=\"{&quot;src&quot;:&quot;https://bucketeer-e05bbc84-baa3-437e-9518-adb32be77984.s3.amazonaws.com/public/images/fb1a2149-5354-425c-844b-25cb6d577d2c_2033x1324.png&quot;,&quot;height&quot;:948,&quot;width&quot;:1456,&quot;resizeWidth&quot;:null,&quot;bytes&quot;:null,&quot;alt&quot;:null,&quot;title&quot;:null,&quot;type&quot;:null,&quot;href&quot;:null}\" alt=\"\"><style>\n          a.image2.image-link.image2-948-1456 {\n            padding-bottom: 65.10989010989012%;\n            padding-bottom: min(65.10989010989012%, 948px);\n            width: 100%;\n            height: 0;\n          }\n          a.image2.image-link.image2-948-1456 img {\n            max-width: 1456px;\n            max-height: 948px;\n          }\n        <\/style></a><p>Many people I know have dozens of windows like this. Tabs so small they can't even see the full title. Keeping these tabs open is a form of externalized working memory. Jumping back in <em>should</em> feel akin to the last time a user was immersed in that window. At some point though, the number of tabs begins to toe the line between externalized memory and information hoarding. The desire to keep tabs open for too long with no end-state is similar to physical hoarding.  </p><p>I know there are some solutions that \"save\" tabs. These extensions are designed to snapshot a window and store it. I\u2019ve used these before and find them useful although they still feel very unorganized and stiff. There\u2019s also a significant amount of cognitive load to readjust to all of the information. These solutions address the problem directly but the tab issue is a manifestation of a more \u201Ccore\u201D issue around organizing goal-driven information consumption. Unpacking the relationship between tabs and cognition may be a step in the right direction. </p><p>The tab is also just a wrapper around what\u2019s really important: the content inside it. Maybe it\u2019s a paragraph, a piece of code, or a video vs. everything else that comes with the site. Part of the solution here is rethinking the way we organize the information that we think is relevant on a given site. </p><h3>The Seeking Circuit</h3><p>At the cellular level, this type of behavior is heavily influenced by the seeking circuit in the brain. In some sense, the brain is a collection of different neural circuits executing some desired function. Two of the most prominent circuits are the <strong>seeking circuit </strong>and the <strong>reward circuit </strong>[1].  The seeking circuit is on the constant look out for any type of reward. It\u2019s what makes us curious about a new idea and drives us to search for it. Once a the seeking circuit finds something that\u2019s rewarding, the reward circuit is activated. </p><p>Interestingly enough, the seeking and reward circuits also act on information. The acquisition of information generates reward [2].  Looking for information on the internet activates this circuitry and may be part of the reason why we accumulate so many tabs. As the seeking circuitry seeks, tabs accumulate. An even more important note is the dominance of the seeking circuitry over the reward circuitry [3]. Just because I received a reward doesn\u2019t blunt the desire to continue seeking. </p><p>The desire to seek for <em>goal-oriented </em>information is also linked to these circuits. Goal-oriented behavior is mediated by dopamine, a critical neurotransmitter in these circuits [3]. It\u2019s incredibly easy to find <em>some</em> information on the internet (regardless of quality). Because of this fast feedback loop, looking for information is a quick and easy way to hijack the reward pathway.</p><h6><strong>Sources</strong></h6><h6><strong>[1]: https://www.jimhopper.com/topics/brain-healing-and-happiness/key-brain-circuitries/#seeking-circuitry</strong></h6><h6><strong>[2]: https://www.semanticscholar.org/paper/Valuation-of-knowledge-and-ignorance-in-mesolimbic-Charpentier-Bromberg-Martin/130eeb14b2dc857a0aec8beafb05f6b8a6ebe079</strong></h6><h6><strong>[3]: http://thebrain.mcgill.ca/flash/capsules/pdf_articles/dopamine.pdf</strong></h6><div><hr></div><p>This was a quick one but something I\u2019ve been noodling on for a couple weeks. I\u2019d love your thoughts or feedback below or on <a href=\"https://twitter.com/aqaderb\">Twitter</a>. Thank you for giving me your time!</p><p class=\"button-wrapper\" data-attrs=\"{&quot;url&quot;:&quot;https://abuqader.substack.com/subscribe?&quot;,&quot;text&quot;:&quot;Subscribe now&quot;,&quot;class&quot;:null}\"><a class=\"button primary\" href=\"https://abuqader.substack.com/subscribe?\"><span>Subscribe now</span></a></p>","publishedBylines":[{"id":6884459,"name":"abu","photo_url":"https://bucketeer-e05bbc84-baa3-437e-9518-adb32be77984.s3.amazonaws.com/public/images/13af2604-2dcc-408d-b785-5c86115c80d7_409x409.png","bio":"I am on the strategy team at Cameo. I spend a lot of time thinking about neuroscience, computer vision, collective intelligence, and access to opportunity."}],"reaction":null,"canonical_url":"https://abuqader.substack.com/p/on-browser-tabs","truncated_description":null,"truncated_body_html":null},"comments":[{"id":521717,"user_id":1136068,"publication_id":33252,"post_id":1555235,"ancestor_path":"","body":"Vivaldi has tab stacking/tiling and a sidebar tab management pane: https://vivaldi.com/features/tab-management/","date":"2020-09-18T19:40:39.369Z","deleted":false,"name":"John Eddy","photo_url":null,"reactions":{"\u2764":0},"is_author":false,"reactor_names":[],"reaction":null,"children":[],"bans":[],"user_banned":false,"user_banned_for_comment":false,"score":0.00795