Zuthal15 September 2020 at 15:12One small error: Where you meant to put the table of tether tip velocities for Hohmann transfers, you put the graph of tether mass ratio vs tether tip velocity again.And you are definitely right about short tethers not being good for manned spacecraft, due to the large acceleration - and multi-stage tethers probably aren't either unless they are *very* large, due to the quickly changing centrifugal acceleration.I've done some math on it, and for a single stage tether in Earth Orbit with the tip dipping to 50 km altitude at 1.5 km/s earth-relative velocity (to allow easy access by scramjet vehicles), if it is to be limited to 3 g acceleration, you'd need a tether length of ~1180 km, a tip velocity of ~5800 m/s, and the thing rotating about three times per hour. But of course the benefit is that that would give you 13 km/s tip velocity relative to earth at the top of the swing.If you want to limit acceleration to 1 g, the tether length grows to a bit over 2700 km, but tip velocity decreases slightly to 5120 m/s.Of course, neither is that feasible without nanomaterials - with T1100G, you have, with no margins, a mass ratio of 250 for the first, and of 90 for the second.Though this shows off very neatly the high dependence of mass ratio on velocity ratio - an almost threefold increase in mass ratio for less than a 15% increase in tip velocity.ReplyDeleteRepliesZuthal15 September 2020 at 15:25And of course, with nanomaterials it becomes more than feasible. Graphene's characteristic velocity allows for a mass ratio of 10, at a factor of safety of over 6 - something more characteristic of structural civil engineering rather than aerospace engineering.DeleteRepliesReplyMatter Beam15 September 2020 at 15:50Thanks for pointing out that mistake! It's been fixed now. The strange thing about their tethers is that their mass does not depend on their length. A shorter tether that has to handle the same loads as a longer tether will mass the same. However, shorter tethers are easier to control and they are less vulnerable to being hit by debris and micrometeorites.I would always recommend splitting a boost between multiple tethers to reduce g-loads and get an overall lower mass ratio (6 km/s from two tethers instead of one tether, for example), but lifting off Earth is a special case.DeleteRepliesReplyReplySpencer17 September 2020 at 18:59I know that you discussed the use of atmospheric scoops in combination with mid-high isp rockets on tethers designed to drop down into the atmosphere, but how feasible would that be for a low mass ratio tether? I guess the question I'm really trying to ask if how heavy a given tether would have to be, not to be strong enough to lift cargo, but in order to retain enough velocity to regenerate it's momentum. If a given tether only has a mass ratio of 10, would lifting a piece of cargo not significantly effect its orbital trajectory?ReplyDeleteRepliesMatter Beam18 September 2020 at 00:45Hi Spencer.You don't need to collect a large amount of propellant all at once to feed a high Isp engine. You can choose to carry only, let's say, 1 kg every cycle. A 50km long tether with a tip velocity of 3km/s would perform about one rotation every 105 seconds, giving you an average mass flow of 9.5 g/s. This is enough for a 4.1 MW, 3000s Isp engine to overcome the drag of a massive 100,000m^2 installation in Low Earth Orbit (200km altitude).This tether would need a relatively high mass ratio, but it is multiplying a very small mass to begin with, so the tether become manageable.DeleteRepliesReplyReplyMr. Tucker17 September 2020 at 20:30Do you intend to cover the tether catapult systems?ReplyDeleteRepliesMatter Beam18 September 2020 at 00:57I'm not sure what you mean by 'tether catapult' systems, but I will be expanding on this topic.DeleteRepliesReplyMr. Tucker19 September 2020 at 13:21Apologies! Should have been more precise...https://en.wikipedia.org/wiki/Momentum_exchange_tether#Tether_cable_catapult_systemIn summary: "A tether cable catapult system is a system where two or more long conducting tethers are held rigidly in a straight line, attached to a heavy mass. Power is applied to the tethers and is picked up by a vehicle that has linear magnet motors on it, which it uses to push itself along the length of the cable. Near the end of the cable the vehicle releases a payload and slows and stops itself and the payload carries on at very high velocity."Basically a combination of tether and mass driver. DeleteRepliesReplyMatter Beam20 September 2020 at 04:06I'll look into it.DeleteRepliesReplyReplykeira18 September 2020 at 03:46I am not sure of the math involved, but, I wonder whether you could take advantage of either the earth's magnetic field or atmospheric differences in charge at different heights to help power such devices.. just thinking of how spiders use static electricity to hurl themselves even across oceans... https://www.pbs.org/newshour/science/spiders-fly-on-the-currents-of-earths-electric-fieldReplyDeleteRepliesMatter Beam18 September 2020 at 15:01Yes, you can!Electrodynamic tethers can push against the Earth's magnetic field to either accelerate (while consuming electricity) or slow down (while generating electricity). Using atmospheric drag is less interesting as it can only slow you down. DeleteRepliesReplyReply123Nick18 September 2020 at 13:49Is it possible too weaponize tethers? maybe as a way too sustain slinging projectiles at enemies? ReplyDeleteRepliesMatter Beam18 September 2020 at 14:51Tethers do not make for good weapons. They are too slow, cannot really be aimed, are very predictable and very are vulnerable to damage.However, they can help with getting missiles and spacecraft into fighting positions more easily. DeleteRepliesReplyReplyAdd commentLoad more...










