tps://mobile.reuters.com/article/amp/idUSKBN2691VW"}},{"tag":"ld_json","props":{"canonical":"https://www.reuters.com/article/us-britain-assange-idUSKBN2691VW","headline":"Assange lawyer says she saw Trump ally offer to arrange pardon","description":"A lawyer for Julian Assange told a London court on Friday that she was present when an ally of U.S. President Donald Trump offered to arrange a pardon for the WikiLeaks founder in return for information that would \"benefit President Trump politically\".","image":"https://static.reuters.com/resources/r/?m=02\u0026d=20200919\u0026t=2\u0026i=1534070294\u0026r=LYNXMPEG8H10C\u0026w=800","published":"2020-09-18T12:12:42Z","updated":"2020-09-19T00:51:21Z","author":"Andrew MacAskill","channel":"U.S. Legal News","keywords":["US","BRITAIN","ASSANGE","Afghanistan","Americas","Asia / Pacific","Australia","Crime","Diplomacy / Foreign Policy","Ecuador","East European Countries","Europe","United Kingdom","Computer Crime / Hacking / Cybercrime","Human Rights / Civil Rights","Iraq","Judicial Process / Court Cases / Court Decisions","South America / Central America","Media \u0026 Publishing (TRBC level 3)","Middle East","Pictures","Major News","Government / Politics","US President","Media / Publishing (Legacy)","Consumer Publishing (TRBC level 4)","Sweden","International / National Security","Reuters Top News","United States","Elections / Voting","Presidential Elections","US Government News","Internet / World Wide Web"]}}],"recirc":{},"article":{"shell":{},"article":{"stream":[]},"recirc":{},"edition":"us","stream":[{"id":"USKBN2691VW","path":"/article/us-britain-assange/assange-lawyer-says-she-saw-trump-ally-offer-to-arrange-pardon-idUSKBN2691VW","url":"https://www.reuters.com/article/us-britain-assange/assange-lawyer-says-she-saw-trump-ally-offer-to-arrange-pardon-idUSKBN2691VW","canonical":"https://www.reuters.com/article/us-britain-assange-idUSKBN2691VW","headline":"Assange lawyer says she saw Trump ally offer to arrange pardon","description":"A lawyer for Julian Assange told a London court on Friday that she was present when an ally of U.S. President Donald Trump offered to arrange a pardon for the WikiLeaks founder in return for information that would \"benefit President Trump politically\".","channel":{"name":"U.S. Legal News","url":"https://www.reuters.com/news/archive/USLegal"},"date":{"published":"2020-09-18T12:12:42Z","updated":"2020-09-19T00:51:21Z"},"authors":[{"name":"Andrew MacAskill","bio":"","url":"https://www.reuters.com/journalists/andrew-macaskill"}],"source":"Reuters","sponsored":false,"slug":"US-BRITAIN-ASSANGE","minutes_to_read":4,"hero_article":false,"all_inline_images":[],"has_dianomi_unit":true,"has_logly_unit":false,"layout":{"type":"default","body":"default"},"primary_asset_type":"video","body_items":[{"type":"paragraph","content":"LONDON (Reuters) - A lawyer for Julian Assange told a London court on Friday that she was present when an ally of U.S. President Donald Trump offered to arrange a pardon for the WikiLeaks founder in return for information that would “benefit President Trump politically”."},{"type":"paragraph","content":"Australian-born Assange, 49, is fighting to avoid being sent to the United States, where he is charged with conspiring to hack government computers and violating an espionage law over the release of confidential cables by WikiLeaks in 2010-2011."},{"type":"paragraph","content":"His lawyer, Jennifer Robinson, said in a witness statement to the court that she observed a meeting at the Ecuadorian embassy in London in 2017 between Assange and Republican then-U.S. Representative Dana Rohrabacher."},{"type":"paragraph","content":"She said Rohrabacher and an assistant offered to arrange a pardon for Assange in return for information about the hacking of Democratic emails before the 2016 U.S. presidential election."},{"type":"paragraph","content":"“They stated that President Trump was aware of and had approved of them coming to meet with Mr Assange to discuss a proposal – and that they would have an audience with the President to discuss the matter on their return to Washington DC,” she said."},{"type":"paragraph","content":"“The proposal put forward by Congressman Rohrabacher was that Mr. Assange identify the source for the 2016 election publications in return for some form of pardon, assurance or agreement, which would both benefit President Trump politically and prevent U.S. indictment and extradition,” Robinson said."},{"type":"paragraph","content":"Assange’s legal team first said at hearings in February that Rohrabacher had conveyed a pardon offer to Assange. At the time, the White House called the assertion that Trump had tried to reach a deal with Assange “a complete fabrication and a total lie”."},{"type":"paragraph","content":"Rohrabacher said he had never spoken with the president about Assange, denied being sent on Trump’s behalf and said he was acting on his own when he offered to ask Trump for a pardon for Assange."},{"type":"paragraph","content":"Robinson said Rohrabacher’s offer was presented to Assange as a “win-win” solution that would allow Assange “to get on with his life” and in return would also politically benefit Trump."},{"type":"paragraph","content":"During the 2016 U.S. presidential campaign, WikiLeaks published a series of Democratic National Committee emails damaging to candidate Hillary Clinton. U.S. investigators have concluded that the emails were hacked by Russia as part of an effort to influence the election."},{"type":"paragraph","content":"The 2016 election leaks are not directly a part of the U.S. criminal case against Assange, which covers secret military and diplomatic documents published by WikiLeaks several years earlier."},{"type":"paragraph","content":"Russia has denied meddling in the 2016 election and Trump has denied that his campaign colluded with Moscow."},{"type":"paragraph","content":"Assange is fighting the U.S. extradition request, arguing that the Trump administration has brought charges against him for political reasons."},{"type":"paragraph","content":"In 2012, Assange took refuge in Ecuador’s London embassy to avoid extradition to Sweden where he was accused of sex crimes, which he denied and which were later dropped. After seven years, he was dragged from the embassy by British police in 2019."}],"body_items_shaped":[{"type":"paragraph","content":"LONDON (Reuters) - A lawyer for Julian Assange told a London court on Friday that she was present when an ally of U.S. President Donald Trump offered to arrange a pardon for the WikiLeaks founder in return for information that would “benefit President Trump politically”."},{"type":"primary_video","asset":{"hed":"Trump ally offered to arrange Assange pardon -lawyer","description":"[NFA] A lawyer for Julian Assange told a London court on Friday that she was present when an ally of U.S. President Donald Trump offered to arrange a pardon for the WikiLeaks founder in return for information that would \"benefit President Trump politically.\"  Conway G. Gittens has more.","duration":136,"usn":"OVCW818F3","advert_info":{"advert_zone":"/4735792/video.us.reuters/world/topnews","advert_params":[{"key":"vimondId","value":"408215"},{"key":"videoId","value":"719348887"},{"key":"videoChannel","value":"1"},{"key":"adfriendly","value":"true"}]},"thumbnail":{"caption":"[NFA] A lawyer for Julian Assange told a London court on Friday that she was present when an ally of U.S. President Donald Trump offered to arrange a pardon for the WikiLeaks founder in return for information that would \"benefit President Trump politically.\"  Conway G. Gittens has more.","content_type":"image/jpeg","source_api":"reutersmedia","url":"https://static.reuters.com/resources/r/?d=20200918\u0026i=OVCW818F3\u0026r=OVCW818F3\u0026t=2"},"video_sources":[{"url":"https://vm.reuters.tv/5aa45/o2gkeuwxplb-1404k.mp4","content_type":"video/mp4"},{"url":"https://ajo.prod.reuters.tv/rest/v2/playlist/assets/408215/web.m3u8","cont