"https://www.reuters.com/article/us-britain-assange-idUSKBN2691VW"},{"rel":"amphtml","href":"https://mobile.reuters.com/article/amp/idUSKBN2691VW"}],"keywords":["US","BRITAIN","ASSANGE","Afghanistan","Americas","Asia / Pacific","Australia","Crime","Diplomacy / Foreign Policy","Ecuador","East European Countries","Europe","United Kingdom","Computer Crime / Hacking / Cybercrime","Human Rights / Civil Rights","Iraq","Judicial Process / Court Cases / Court Decisions","South America / Central America","Media \u0026 Publishing (TRBC level 3)","Middle East","Pictures","Major News","Government / Politics","US President","Media / Publishing (Legacy)","Consumer Publishing (TRBC level 4)","Sweden","International / National Security","Reuters Top News","United States","Elections / Voting","Presidential Elections","US Government News","Internet / World Wide Web"],"n2_codes":["AF","AMERS","ASIA","AU","CRIM","DIP","EC","EEU","EUROP","GB","HACK","HRGT","IQ","JUDIC","LATAM","MDIA","MEAST","MTPIX","NEWS1","POL","POTUS","PUB","READ","SE","SECUR","TOPNWS","US","VOTE","VOTP","WASH","WWW"],"n2_names":["Afghanistan","Americas","Asia / Pacific","Australia","Crime","Diplomacy / Foreign Policy","Ecuador","East European Countries","Europe","United Kingdom","Computer Crime / Hacking / Cybercrime","Human Rights / Civil Rights","Iraq","Judicial Process / Court Cases / Court Decisions","South America / Central America","Media \u0026 Publishing (TRBC level 3)","Middle East","Pictures","Major News","Government / Politics","US President","Media / Publishing (Legacy)","Consumer Publishing (TRBC level 4)","Sweden","International / National Security","Reuters Top News","United States","Elections / Voting","Presidential Elections","US Government News","Internet / World Wide Web"],"ad_topics":["cysc","crime","media","pol","elc"],"slug":"US-BRITAIN-ASSANGE","body_items":[{"type":"paragraph","content":"LONDON (Reuters) - A lawyer for Julian Assange told a London court on Friday that she was present when an ally of U.S. President Donald Trump offered to arrange a pardon for the WikiLeaks founder in return for information that would “benefit President Trump politically”."},{"type":"paragraph","content":"Australian-born Assange, 49, is fighting to avoid being sent to the United States, where he is charged with conspiring to hack government computers and violating an espionage law over the release of confidential cables by WikiLeaks in 2010-2011."},{"type":"paragraph","content":"His lawyer, Jennifer Robinson, said in a witness statement to the court that she observed a meeting at the Ecuadorian embassy in London in 2017 between Assange and Republican then-U.S. Representative Dana Rohrabacher."},{"type":"paragraph","content":"She said Rohrabacher and an assistant offered to arrange a pardon for Assange in return for information about the hacking of Democratic emails before the 2016 U.S. presidential election."},{"type":"paragraph","content":"“They stated that President Trump was aware of and had approved of them coming to meet with Mr Assange to discuss a proposal – and that they would have an audience with the President to discuss the matter on their return to Washington DC,” she said."},{"type":"paragraph","content":"“The proposal put forward by Congressman Rohrabacher was that Mr. Assange identify the source for the 2016 election publications in return for some form of pardon, assurance or agreement, which would both benefit President Trump politically and prevent U.S. indictment and extradition,” Robinson said."},{"type":"paragraph","content":"Assange’s legal team first said at hearings in February that Rohrabacher had conveyed a pardon offer to Assange. At the time, the White House called the assertion that Trump had tried to reach a deal with Assange “a complete fabrication and a total lie”."},{"type":"paragraph","content":"Rohrabacher said he had never spoken with the president about Assange, denied being sent on Trump’s behalf and said he was acting on his own when he offered to ask Trump for a pardon for Assange."},{"type":"paragraph","content":"Robinson said Rohrabacher’s offer was presented to Assange as a “win-win” solution that would allow Assange “to get on with his life” and in return would also politically benefit Trump."},{"type":"paragraph","content":"During the 2016 U.S. presidential campaign, WikiLeaks published a series of Democratic National Committee emails damaging to candidate Hillary Clinton. U.S. investigators have concluded that the emails were hacked by Russia as part of an effort to influence the election."},{"type":"paragraph","content":"The 2016 election leaks are not directly a part of the U.S. criminal case against Assange, which covers secret military and diplomatic documents published by WikiLeaks several years earlier."},{"type":"paragraph","content":"Russia has denied meddling in the 2016 election and Trump has denied that his campaign colluded with Moscow."},{"type":"paragraph","content":"Assange is fighting the U.S. extradition request, arguing that the Trump administration has brought charges against him for political reasons."},{"type":"paragraph","content":"In 2012, Assange took refuge in Ecuador’s London embassy to avoid extradition to Sweden where he was accused of sex crimes, which he denied and which were later dropped. After seven years, he was dragged from the embassy by British police in 2019."}],"ric_list":[],"images":[{"caption":"FILE PHOTO: A supporter of WikiLeaks founder Julian Assange protests outside the Old Bailey, the Central Criminal Court ahead of a hearing to decide whether Assange should be extradited to the United States, in London, Britain September 9, 2020. REUTERS/Henry Nicholls","content_type":"image/jpeg","source_api":"reutersmedia","url":"https://static.reuters.com/resources/r/?m=02\u0026d=20200919\u0026t=2\u0026i=1534070294\u0026r=LYNXMPEG8H10C"},{"caption":"FILE PHOTO: Julian Assange's partner Stella Moris and Assange's lawyer Jennifer Robinson arrive at the Old 