ople familiar with the matter said on Thursday.","image":"https://static.reuters.com/resources/r/?m=02\u0026d=20200918\u0026t=2\u0026i=1533948954\u0026r=LYNXMPEG8H0BW\u0026w=800","published":"2020-09-17T16:06:50Z","updated":"2020-09-18T19:42:00Z","author":"David Shepardson, Stephen Nellis, Echo Wang","channel":"Technology, Media \u0026 Telecom - Innovation","keywords":["US","USA","TIKTOK","CHINA","Asia / Pacific","Content produced in Bangalore","Company News","China (PRC)","Deals","Diplomacy / Foreign Policy","Divestitures / Spin-Offs","Investment Holding Companies (NEC) (TRBC level 5)","Initial Public Offerings","Multiline Insurance \u0026 Brokers (NEC) (TRBC level 5)","Mergers / Acquisitions / Takeovers","Pictures","Major News","Government / Politics","US President","International / National Security","Social Media","Enterprise Software (TRBC level 5)","Software (TRBC level 4)","Software (NEC) (TRBC level 5)","Search Engines (TRBC level 5)","Equity Stakes","Supermarkets \u0026 Convenience Stores (TRBC level 5)","Software \u0026 IT Services (TRBC level 3)","Technology (TRBC level 1)","Technology / Media / Telecoms","Reuters Top News","United States","US Government News"]}}],"recirc":{},"article":{"shell":{},"article":{"stream":[]},"recirc":{},"edition":"us","stream":[{"id":"USKBN2682NL","path":"/article/us-usa-tiktok-china/bytedance-plans-tiktok-ipo-to-win-u-s-deal-as-deadline-looms-sources-idUSKBN2682NL","url":"https://www.reuters.com/article/us-usa-tiktok-china/bytedance-plans-tiktok-ipo-to-win-u-s-deal-as-deadline-looms-sources-idUSKBN2682NL","canonical":"https://www.reuters.com/article/us-usa-tiktok-china-idUSKBN2682NL","headline":"ByteDance plans TikTok IPO to win U.S. deal as deadline looms: sources","description":"China's ByteDance is planning a U.S. initial public offering of TikTok Global, the new company that will operate the popular short video app, should its proposed deal be cleared by the U.S. government, people familiar with the matter said on Thursday.","channel":{"name":"Technology, Media \u0026 Telecom - Innovation","url":"https://www.reuters.com/news/archive/innovationNewsTechMediaTelco"},"date":{"published":"2020-09-17T16:06:50Z","updated":"2020-09-18T19:42:00Z"},"authors":[{"name":"David Shepardson","bio":"","url":"https://www.reuters.com/journalists/david-shepardson"},{"name":"Stephen Nellis","bio":"","url":"https://www.reuters.com/journalists/stephen-nellis"},{"name":"Echo Wang","bio":"","url":"https://www.reuters.com/journalists/echo-wang"}],"source":"Reuters","sponsored":false,"slug":"US-USA-TIKTOK-CHINA","minutes_to_read":6,"hero_article":false,"all_inline_images":[{"index":17,"url":"https://static.reuters.com/resources/r/?m=02\u0026d=20200918\u0026t=2\u0026i=1533948954\u0026r=LYNXMPEG8H0BW","caption":"Flags of China and U.S. are seen near a Bytedance logo in this illustration picture taken September 18, 2020. REUTERS/Florence Lo/Illustration"},{"index":21,"url":"https://static.reuters.com/resources/r/?m=02\u0026d=20200917\u0026t=2\u0026i=1533883108\u0026r=LYNXMPEG8G1S7","caption":"FILE PHOTO: A man holding a phone walks past a sign of Chinese company ByteDance's app TikTok, known locally as Douyin, at the International Artificial Products Expo in Hangzhou, Zhejiang province, China October 18, 2019. REUTERS/Stringer "}],"has_dianomi_unit":true,"has_logly_unit":false,"layout":{"type":"default","body":"default"},"primary_asset_type":"video","body_items":[{"type":"paragraph","content":"(Reuters) - China’s ByteDance is planning a U.S. initial public offering of TikTok Global, the new company that will operate the popular short video app, should its proposed deal be cleared by the U.S. government, people familiar with the matter said on Thursday."},{"type":"paragraph","content":"ByteDance is racing to clinch an agreement with the White House that will stave off a U.S. ban on TikTok that President Donald Trump has threatened could happen as early as next week."},{"type":"paragraph","content":"Trump ordered ByteDance last month to divest TikTok amid U.S. concerns that the personal data of as many as 100 million Americans who use the app could be passed on to China’s Communist Party government."},{"type":"paragraph","content":"On Wednesday, he reiterated he was opposed to ByteDance retaining majority ownership of TikTok."},{"type":"paragraph","content":"The White House and ByteDance have agreed to a term sheet on some aspects of a deal, although Trump has not yet approved it, one of the sources said. Top ByteDance U.S. investors, Oracle Corp and potentially Walmart Inc would hold at least a 60% stake in TikTok’s U.S. operations, the source said."},{"type":"paragraph","content":"White House Chief of Staff Mark Meadows said the situation was still fluid."},{"type":"paragraph","content":"“There’s no definite proposal that the president’s being asked to consider or reject at this point,” Meadows told reporters."},{"type":"paragraph","content":"The new company, dubbed TikTok Global, will have a majority of American directors, a U.S. chief executive and a security expert on the board, the source added. Oracle has agreed to eventually own a 20% stake in the company, according to the source. If Walmart also successfully negotiates acquiring a stake, its CEO, Doug McMillon, would get a seat on TikTok Global’s board, the source said."},{"type":"paragraph","content":"Trump said that his administration talked with Walmart and Oracle on Thursday but “nothing much has changed” regarding a deal."},{"type":"paragraph","content":"He added, without giving details, “I guess Microsoft is still involved.” Microsoft said on Sunday its offer for TikTok was rejected. Microsoft did not immediately respond to a request for comment on Thursday."},{"type":"paragraph","content":"“We’ll make a decision soon,” Trump said."},{"type":"paragraph","content":"An IPO of TikTok would be one of the technology sector’s biggest-ever stock market debuts, given that the app was recently valued by ByteDance investors at more than $50 billion. It would further reduce ByteDance’s stake in the company to appease U.S. officials who want to see the Chinese firm loosen its grip on the video app."},{"type":"paragraph","content":"The filing of the IPO would be on a U.S. stock exchange and could come in about a year, the sources said."},{"type":"paragraph","content":"There is no certainty over whether Trump will sign off on the agreement. It was also not immediately clear what assets TikTok Global would own beyond the app’s assets in the United States. ByteDance has offered to create 25,000 new U.S. jobs with TikTok headquartered in the United States as it seeks to win Trump’s blessing for a deal, Reuters has reported."},{"type":"paragraph","content":"It was also not clear whether ByteDance could present the deal to China as keeping majority ownership of TikTok. Chinese officials have said they do not want ByteDance to agree to a forced sale, and the company’s proposal to the White House this week called for it to retain majority ownership of TikTok."},{"type":"paragraph","content":"The board of TikTok Global would include a national security director, who will be approved by the U.S. and chair a security committee overseeing the protection of user data, according to a person familiar with the matter."},{"type":"paragraph","content":"The term sheet will grant Oracle the right to inspect TikTok’s source code and includes numerous provisions to ensure data security and requirement that all U.S. users data remains in the United States housed by Oracle, the source said."},{"type":"paragraph","content":"It is not clear what Oracle or Walmart will pay for a stake. Oracle, Walmart and Treasury did not immediately comment."},{"type":"paragraph","content":"Meadows said on Thursday that the administration is still looking at details of the deal and whether it meets national security thresholds. Meadows said if TikTok remains predominantly Chinese-run under the Oracle deal, that would not meet Trump’s objectives."},{"type":"heading","content":"CHINA APPROVAL"},{"type":"paragraph","content":"ByteDance said on Thursday it would need China to approve the proposed deal with the White House, indicating how its bid to stave off a ban in the United States could be further complicated."},{"type":"paragraph","content":"As many as 40% of Americans back Trump’s threat to ban TikTok if it is not sold to a U.S. buyer, a Reuters/Ipsos national poll found last month. Among Republicans - Trump’s party - 69% said they supported the order, though only 32% expressed familiarity with the app."},{"type":"paragraph","content":"The White House has stepped up efforts to purge what it deems “untrusted” Chinese apps from U.S. digital networks. Beyond TikTok, Trump has also issued an order prohibiting transactions with Tencent Holding Ltd’s messenger app WeChat."},{"type":"paragraph","content":"Earlier this year, Chinese gaming company Beijing Kunlun Tech Co Ltd sold gay dating app Grindr, bought in 2016, for $620 million after CFIUS ordered its divestment."},{"type":"paragraph","content":"ByteDance acquired Shanghai-based video app Musical.ly - whose user base was largely American - for $1 billion in 2017 without seeking CFIUS approval, relaunching it as TikTok the following year. Reuters reported last year that CFIUS was investigating TikTok."}],"body_items_shaped":[{"type":"paragraph","content":"(Reuters) - China’s ByteDance is planning a U.S. initial public offering of TikTok Global, the new company that will operate the popular short video app, should its proposed deal be cleared by the U.S. government, people familiar with the matter said on Thursday."},{"type":"primary_video","asset":{"hed":"ByteDance plans TikTok IPO to win deal - sources","description":"China's ByteDance is reportedly planning a U.S. initial public offering of TikTok Global, the new company that will operate the popular short video app, should its proposed deal be cleared by the U.S. government. Ciara Le