h Item","channel":"youtube","link":"https://www.youtube.com/channel/UClG8odDC8TS6Zpqk9CGVQiQ"},{"_type":"Fortnite - Event Watch Item","channel":"twitch","link":"https://www.twitch.tv/fortnite"},{"_type":"Fortnite - Event Watch Item","channel":"mixer","link":"https://mixer.com/Fortnite"}],"_type":"Fortnite - Event Watch","title":"Watch"},"faqs":{"faq":[{"question":"Where can I get tickets to Summer Block Party?","answer":"<span>You can get your tickets </span><a href=\"https://www1.ticketmaster.com/fortnite-summer-block-party/event/090056A705E95EAC\"><u><span>here</span></u></a><span>. Tickets to attend Summer Block Party start at $35 USD and will get you access to both days.</span>","_type":"Fortnite - Party Faq"},{"question":"What time does Summer Block Party start?","answer":"Doors open at 2pm, show starts at 4pm. The fan festival, featuring your favorite Fortnite characters, ziplines, the Pirate Ship, and Fortnite Mini Golf, will be open from 2pm.","_type":"Fortnite - Party Faq"},{"question":"I can’t make it in person. Where can I watch Summer Block Party?","answer":"<span>You can watch both days on our official </span><a href=\"https://www.youtube.com/channel/UClG8odDC8TS6Zpqk9CGVQiQ\"><u><span>YouTube</span></u></a><span>, </span><a href=\"https://www.twitch.tv/fortnite\"><u><span>Twitch</span></u></a><span>, and </span><a href=\"https://mixer.com/Fortnite?vod=104968923\"><u><span>Mixer</span></u></a><span> channels. </span>","_type":"Fortnite - Party Faq"},{"question":"I bought my ticket but don't have it yet. When will I get my ticket?","answer":"<span>Tickets will be delivered digitally at a date closer to the event. Be sure to check our official Fortnite social channels as we’ll post once they’re available. </span>","_type":"Fortnite - Party Faq"},{"question":"I have tickets to the Fortnite Summer Block Party and want to bring my family. Are there any age restrictions?","answer":"Yes, anyone under the age of 18 must be accompanied by an adult who is also in possession of his/her own ticket. Children aged 12 years or younger are not allowed to enter the venue.","_type":"Fortnite - Party Faq"},{"question":"I bought my ticket from a site other than Ticketmaster. Is it a real ticket?","answer":"Ticketmaster is the only authorized vendor for tickets to the Fortnite Summer Block Party. Tickets are only delivered to the original Ticketmaster purchaser. In the event of any issues, Epic Games will work with Ticketmaster to try to resolve such issues directly with the original purchaser.","_type":"Fortnite - Party Faq"},{"question":"My ticket includes V-Bucks. How do I receive those?","answer":"Everyone who attends Summer Block Party will receive a code that can be applied to his/her Epic account to redeem the V-Bucks. The codes will be physically distributed at the event and will be limited to one code per attendee.","_type":"Fortnite - Party Faq"},{"question":"If I have sensitivities to light and sound, will this event have uncomfortable light sequences or audio levels?","answer":"Summer Block Party will feature a stage with coordinated lighting which may affect attendees who are susceptible to photosensitive epilepsy or other photo sensitivities. Additionally, the sound design for the event will reach limits which may affect attendees who have a sensitivity to sound. Given these conditions, it is strongly advised that each attendee take all necessary precautions and measures prior to and during the event.","_type":"Fortnite - Party Faq"},{"question":"What is the RFID band?","answer":"The \"RFID band\" is a wearable bracelet embedded with a \"radio-frequency identification\" chip - the exact same technology used for hotel room key cards. Wear your RFID band to gain entrance into Summer Block Party and to track your progress at many of the activities throughout the venue.","_type":"Fortnite - Party Faq"},{"question":"How do I register my RFID band?","answer":"Two weeks prior to the event, an email will be sent to the email address that you entered when you purchased the ticket from Ticketmaster.com (the official ticket seller of the Fortnite Summer Block Party). In this email you will be prompted to register your ticket/tickets to yourself and the people who are attending the event with you. You will need to input the name and email for each of the individuals attending. This will allow you to get content from the festival, receive Fan Festival Battle Pass updates, and redeem exclusive content that is unique to the event and cannot be received anywhere else. PLEASE NOTE: You will need to show your mobile ticket AND your purchase confirmation email to begin the registration process OR the confirmation page stating that you already registered your wristband.","_type":"Fortnite - Party Faq"},{"question":"Where is my RFID band? Do I need to pick it up in person? ","answer":"Yes, you will be required to pick up your RFID band in person. This can be done the day before the event on Friday, June 14th from 11:00 am - 6:00 pm or on event days from 12:00 pm-close on Saturday, June 15th or Sunday, June 16th. When you arrive at the venue, you will be directed to the RFID Redemption and Registration Tents. These will be outside of the venue and are mandatory in order to access the stadium. The purchaser of the ticket must be present when you pick up the RFID band/bands. It is strongly encouraged that you pick up your RFID band as early as possible so that you do not miss the opportunity to skip the line and be among the first to see the festival and pre-show events!","_type":"Fortnite - Party Faq"},{"question":"On the day of the event, if I have already registered my RFID band and picked it up, where do I go?","answer":"When you arrive at the venue, you will be asked to present your mobile ticket and your RFID band at the entry gate. You will have both scanned and then you can enjoy all the festivities!","_type":"Fortnite - Party Faq"}],"_type":"Fortnite - Party Faqs"},"meta":{"image":"https://cdn2.unrealengine.com/Fortnite%2Fsummer-block-party%2F08BR_BlockParty_Social-1920x1080-989de6b6849530e0ff277c70d56261d46c4528f6.jpg","_type":"Epic Common Share Meta Data","description":"Summer Block Party is the two day celebratory Fortnite festival featuring your favorite characters, creators and celebrities!","title":"Summer Block Party"},"_title":"Summer Block Party","header":{"btnConfig":{"isCtaLinkExternal":true,"ctaString":"Get Tickets","_type":"Fortnite - eSports Common CTA","disabled":false,"ctaLink":"https://www1.ticketmaster.com/fortnite-summer-block-party/event/090056A705E95EAC"},"timeText":"SHOW STARTS AT 4:30 PM PT ON JUNE 15TH - 16TH","_type":"Fortnite - Party Header","textImg":"https://cdn2.unrealengine.com/Fortnite%2Fsummer-block-party%2FSUMMER-text-931x452-7a77384cd96db130334ec9ab81335392795c3abe.png","smallText":"Featuring your favorite Fortnite characters, creators and celebrities.   ","bgImage":"https://cdn2.unrealengine.com/Fortnite%2Fsummer-block-party%2Fbg_1903x897_1558583206530-1902x896-bb69046b4a70c506ad98b65c2742c08c6e546538.png","bigText":"A two day live-festival"},"items":{"item":[{"image":"https://cdn2.unrealengine.com/Fortnite%2Fsummer-block-party%2Fbig-creative-572x322-bd72c0daa9e1c48e1ea53f3621b154fd092c33a4.png","btnConfig":{"isCtaLinkExternal":false,"ctaString":"Learn More","_type":"Fortnite - eSports Common CTA","disabled":false,"ctaLink":"/block-party/creative-showdown"},"circleText":"Day 1","_type":"Fortnite - Party Item","description":"On Saturday, June 15, celebrities, gaming personalities and a few lucky players fight for fame on a new community-made game built especially for the event by <a href=\"https://twitter.com/teamevolvefn\" target=\"_blank\">Team Evolve</a>.","title":"Introducing creative showdown!"},{"image":"https://cdn2.unrealengine.com/Fortnite+Esports%2Fsummer-block-party%2Fbig-proam-652x361-fa87004c67455ff7be07f408036680d63d406764.png","btnConfig":{"isCtaLinkExternal":false,"ctaString":"Learn More","_type":"Fortnite - eSports Common CTA","disabled":false,"ctaLink":"/block-party/pro-am-2019"},"circleText":"Day 2","_type":"Fortnite - Party Item","description":"On Sunday, June 16, a new roster of 50 celebrities and 50 pro gamers pair-up to battle for a $3,000,000 charity prize pool. Who will take home the ultimate Victory Royale?","title":"The Celebrity Pro-Am Returns"}],"_type":"Fortnite - Party Items"},"_images_":["https://cdn2.unrealengine.com/Fortnite%2Fsummer-block-party%2FWave2_JayMewes_600x800-600x800-f80df27c48282269651dfcf1def6e52dc29d440d.jpg","https://cdn2.unrealengine.com/Fortnite%2Fsummer-block-party%2FWave6_JordynJones_600x800-600x800-49ba39914161d487f5c31e39c51fcf5e1edb4d7f.jpg","https://cdn2.unrealengine.com/Fortnite%2Fsummer-block-party%2FWave7_Muself_600x800-600x800-b06410fdb2e0b508e9722b75a8f913b7f9e36f58.jpg","https://cdn2.unrealengine.com/Fortnite%2Fsummer-block-party%2FWave6_Gotaga_600x800-600x800-57fe5f87f76f012e07dbf58fce5eda1d4956ed86.jpg","https://cdn2.unrealengine.com/Fortnite%2Fsummer-block-party%2FWave12_MattJudan_600x800-600x800-dbec2afcdf16ce172719e1ddd21c0ce5d63defd9.jpg","https://cdn2.unrealengine.com/Fortnite%2Fsummer-block-party%2FWave12_DamariousRandall_600x800-600x800-da4c0d7402439abdf13bfe527831845c8118641f.jpg","https://cdn2.unrealengine.com/Fortnite%2Fsummer-block-party%2FWave9_RobertAbisi-_600x800-600x800-51e2f3871dbe240e06fe64ff5f897d317fa3457b.jpg","https://cdn2.unrealengine.com/Fortnite%2Fsummer-block-party%2FCreativeShowdown%2FCreativeShowdown_Social_PlayerPairings_5_CuddleCrew_CuddleCrew_Aydan_600x800-600x800-b1844b5fe0d48e35b33c048bd25715f6a5b5554c.jpg","https://cdn2.unrealengine.com/Fortnite%2Fsummer-block-party%2FWave2_JoelMcHale_600x800-600x800-847200dd999b7af056a861800ac26000d8c018e7.jpg","https://cdn2.unrealengine.com/Fortnite%2Fsummer-block-party%2FWave6_CodyWalker_600x800-600x800-89c605f0fe55eb2f5ae03a1c760ff3a55c50f57e.jpg","https://cdn2.unrealengine.com/Fortnite%2Fsummer-block-party%2FWave1_VALKYRAE_600x800-600x800-d0a4e064a75