:"@elly24soul","avatar":"https://cdn2.unrealengine.com/Fortnite%2Fsummer-block-party%2FWave7_Elly_600x800-600x800-5e75c4a94dfd7bd926f757188860aa80c35e5295.jpg"}]},{"_type":"Fortnite - Party Detail Duos Team","duos":[{"link":"https://twitter.com/preston","_type":"Fortnite - Party Detail Player Profile","name":"TBNRfrags","linkText":"@Preston","avatar":"https://cdn2.unrealengine.com/Fortnite%2Fsummer-block-party%2FWave7_TBNRfrags_600x800-600x800-99ba73f7b4e083641919f2b2aa360afe4cbe61f7.jpg"},{"link":"https://twitter.com/JTBrown23","_type":"Fortnite - Party Detail Player Profile","name":"JT Brown","linkText":"@JTBrown23","avatar":"https://cdn2.unrealengine.com/Fortnite%2Fsummer-block-party%2FWave7_JTBrown_600x800-600x800-e541fe8455b3d3f9edf215ef5efb8299167d86c8.jpg"}]},{"_type":"Fortnite - Party Detail Duos Team","duos":[{"link":"https://twitter.com/BuckeFPS","_type":"Fortnite - Party Detail Player Profile","name":"BuckeFPS","linkText":"@buckefps","avatar":"https://cdn2.unrealengine.com/Fortnite%2Fsummer-block-party%2FWave8_BuckeFPS_600x800-600x800-455a4851e9a49bd80db98e36ffb7f2027bfd7bfb.jpg"},{"link":"https://twitter.com/KennethFaried35","_type":"Fortnite - Party Detail Player Profile","name":"Kenneth Faried","linkText":"@KennethFaried35","avatar":"https://cdn2.unrealengine.com/Fortnite%2Fsummer-block-party%2FWave8_KennethFaried_600x800-600x800-55878123f5a2b389d1e09d0fa3c1345689b7f88c.jpg"}]},{"_type":"Fortnite - Party Detail Duos Team","duos":[{"link":"https://twitter.com/heystani","_type":"Fortnite - Party Detail Player Profile","name":"Hey Stan","linkText":"@HeyStani","avatar":"https://cdn2.unrealengine.com/Fortnite%2Fsummer-block-party%2FWave8_HeyStan_600x800-600x800-6b124d098bfd40d8daa00e4ae2ade1c8b3ab8bf9.jpg"},{"link":"https://twitter.com/Liam_J_McIntyre","_type":"Fortnite - Party Detail Player Profile","name":"Liam McIntyre","linkText":"@Liam_J_McIntyre","avatar":"https://cdn2.unrealengine.com/Fortnite%2Fsummer-block-party%2FWave8_LiamMcIntyre_600x800-600x800-1da16cbf4b8036e9811d370e8b1c3137a12528ef.jpg"}]},{"_type":"Fortnite - Party Detail Duos Team","duos":[{"link":"https://twitter.com/TrueTriz","_type":"Fortnite - Party Detail Player Profile","name":"TrueTriz","linkText":"@TrueTriz","avatar":"https://cdn2.unrealengine.com/Fortnite%2Fsummer-block-party%2FWave8_TrueTriz_600x800-600x800-955e473329cd4bde8ea75666b661ea6ecdb112f1.jpg"},{"link":"https://twitter.com/murdabeatz_","_type":"Fortnite - Party Detail Player Profile","name":"Murda Beatz","linkText":"@murdabeatz_","avatar":"https://cdn2.unrealengine.com/Fortnite%2Fsummer-block-party%2FWave8_MurdaBeatz_600x800-600x800-4d86be73016023580213dbb7e4a24e94cf4c9fce.jpg"}]}],"title":"The celebrity Pro-Am returns! "}}]},"_urlPattern":"/summer-block-party","_slug":"summer-block-party","_activeDate":"2019-05-20T21:52:51.223Z","lastModified":"2019-06-16T17:58:39.455Z","_locale":"en-US","_id":"a910ebaf-4ddf-4e1b-a700-318a8f27323d","_templateName":"partyView"}},"SafetySecurityStore":{"data":{"image":"https://cdn2.unrealengine.com/Fortnite%2FSafetySecurity%2FFN_privacyHeader-1920x1080-6b5acbb6b4da6e3b360983d060c15aebe8607312.jpg","_metaTags":"","_title":"Safety and Security","Title":"Epic Games - Safety and Security","_noIndex":false,"_images_":["https://cdn2.unrealengine.com/Fortnite%2FSafetySecurity%2FFN_privacyHeader-1920x1080-6b5acbb6b4da6e3b360983d060c15aebe8607312.jpg"],"content":"<h1>Fortnite - Safety and Security</h1>\n\n<p>When you’re playing Epic Games titles or using our services, we want you to have fun. Part of that is staying safe and ensuring you have a secure account. Below, you’ll find a few ways you can increase security for your Fortnite account as well as a few tools you can use to help you stay safe when gaming.&nbsp;</p>\n\n<h2><br />\nProtect Your Account: Two-Factor Authentication</h2>\n\n<p>Keep your password safe and prevent your account from being compromised. We’ve implemented Two-Factor Authentication (also known as 2FA or 2-step verification) to help you prevent unauthorized account access. As a reward for protecting your account by enabling 2FA, you’ll unlock the Boogiedown Emote in Fortnite Battle Royale as well as 50 Armory Slots, 10 Backpack Slots, and 1 Legendary Troll Stash Llama in Save the World.<br />\n<br />\nFor help with turning on 2FA, check out our how-to video or read our support article on <a href=\"https://www.epicgames.com/help/epic-accounts-c74/account-security-c112/twofactor-authentication-and-how-to-enable-it-a3218\">how to enable 2FA</a>.</p>\n&nbsp;\n\n<div class=\"embed-responsive embed-responsive-16by9\"><iframe allowfullscreen=\"true\" class=\"embed-responsive-item\" frameborder=\"0\" src=\"https://www.youtube.com/embed/_ZpW3Nq43S0\" width=\"100%\"></iframe></div>\n\n<h2><br />\nProtect Your Account: Never Share Your Account Details</h2>\n\n<p>We’ve seen several instances of account theft and fraud related to websites that claim to provide you free V-Bucks, cosmetics, or the ability to share or buy accounts. Please never share your Epic account details with anyone. Groups claiming to provide special Fortnite deals when you enter your login credentials are fraudulent — and may steal your account. Also, please note that <strong>Epic will never ask you for your password</strong>.&nbsp;</p>\n\n<h2><br />\nParental Controls</h2>\n\n<p>Read all the details about setting up parental controls in Fortnite in our <a href=\"https://www.epicgames.com/fortnite/parental-controls\">Fortnite parental controls guide</a>. Fortnite offers a range of parental controls to help you manage what a player can see and do within Fortnite. In addition to the parental controls within Fortnite, you can set rules for what features a player can access on consoles, handhelds, phones, and computers. <a href=\"https://www.nintendo.com/switch/parental-controls/\">Nintendo Switch™</a>, <a href=\"https://www.playstation.com/en-gb/get-help/help-library/my-account/parental-controls/ps4-parental-controls/\">PlayStationⓇ 4</a>, <a href=\"https://support.xbox.com/en-US/xbox-360/security/xbox-live-parental-control\">Xbox OneⓇ</a>, <a href=\"https://support.microsoft.com/en-us/help/12439/microsoft-account-set-content-restrictions-on-windows-10-and-xbox-one\">WindowsⓇ 10</a>, and <a href=\"https://support.apple.com/en-us/HT201304\">iOS</a> all have guides for activating parental controls.</p>\n\n<h2><br />\nReporting Bad Behavior</h2>\n\n<p>It’s important that Fortnite players have a fun and friendly community to participate with, so we take bad behavior seriously. All our community policies can be found in our <a href=\"https://www.epicgames.com/fortnite/news/fortnite-code-of-conduct\">Code of Conduct</a>. If you see someone breaking our Code of Conduct or behaving badly, you can report the player’s behavior using the Report Player option in Fortnite. For assistance with this, follow the steps in our guide on <a href=\"https://www.epicgames.com/help/fortnite-c75/battle-royale-c93/how-do-i-report-bad-player-behavior-in-fortnite-a3276\">reporting bad player behavior</a>.<br />\n<br />\nWe’d love to hear from you if you feel there’s something we can do to help make the Fortnite community more friendly and fun! You can send in suggestions to us on our official social channels, which you can find in the Community section of our <a href=\"https://www.epicgames.com/fortnite/faq\">Fortnite FAQ</a>.</p>\n\n<h2><br />\nDon’t Buy, Sell, or Trade Fortnite Accounts</h2>\n\n<p>Fortnite accounts must be set up by yourself or a parent/guardian through the game or <a href=\"https://www.epicgames.com/fortnite/home\">signing up through Epic</a>. As tempting as it might be to purchase an account with highly-coveted items, buying, selling, or trading accounts violates our <a href=\"https://www.epicgames.com/site/tos\">Terms of Service</a> and presents a security risk for your personal information and accounts.</p>\n\n<h2><br />\nAvoid Scams for Free V-Bucks and Outfits</h2>\n\n<p>Across the internet, there are third parties trying to get your private information by tricking you into believing they will provide you with free items or V-Bucks. Use caution when participating in competitions and giveaways from third parties. Also, please note that Epic will never ask you to provide private information to compete in competitions. Epic only asks you to provide private information to claim prizes after you have won (via our secure partner).</p>\n\n<h3><br />\nSocial Media Scams</h3>\n\n<p>We are aware of a number of Creators in the Support-A-Creator program making content designed to scam and defraud players, and we’re taking actions to both remove these Creators from the ecosystem and prevent similar scams in the future.&nbsp;<br />\n<br />\nTypically, these individuals create social media material that promises false special benefits to players in return for using a specific Support-A-Creator code. Another common scam involves Creative islands that promise rewards to players like free V-Bucks gift cards. The players that use these codes never receive the special benefits they were promised by the Creator.<br />\n<br />\nCreators cannot provide Outfit or free V-Bucks rewards for using a Creator code. Making content aimed to scam and defraud players is a violation of Creators’ agreement with Epic Games. Penalties for these violations include removal from the Support-A-Creator program and cancellation of any pending or potential payments.&nbsp;<br />\n<br />\nWe take violations of the Terms of Service and Code of Conduct seriously — and are looking at additional measures to prevent bad actors from abusing the program. To report scam content, please <a href=\"https://www.epicgames.com/help/contact-us?metadata=eyJoaXN0b3J5TGlua3MiOlt7InVybCI6Ii9mb3J0bml0ZS1jNzUiLCJ0aXRsZSI6IkZvcnRuaXRlIn1dLCJjYXRlZ29yeUlkIjo3NX0%3D\">submit a Player Support ticket</a> and add the hashtag <strong>#reportacreator</strong>. A screenshot of the Creator code and link to the content is required for us to investigate. A video is even better.</p>\n\n<h2><br />\nVoice Chat Controls</h2>\n\n<p>Voice chat allows you to speak to and hear from other players in Fortnite. Voice chat is enabled by default. If you don’t want other players to be able to chat with you, you can <a href=\"https://epicgames.helpshift.com/a/fortnite/?s=battle-royale&amp;f=how-do-i-change-the-settings-for-voice-chat-in-fortnite\">learn how to disable voice chat or temporarily mute yourself</a>.</p>\n\n<h2><br />\nLobby Controls</h2>\n\n<p>You can control your party and voice chat settings right from the Fortnite Lobby. If you need help, you can follow the steps in our guide about&nbsp;<a href=\"https://www.epicgames.com/help/fortnite-c75/battle-royale-c93/how-do-i-manage-my-party-and-voice-chat-options-from-the-fortnite-lobby-a3477\">managing party and voice chat options in the Lobby</a>.&nbsp;</p>\n\n<h2><br />\nParty Hub Privacy Controls</h2>\n\n<p>Party Hub is a feature on the Fortnite mobile app that lets you see which friends are online, start a party, and voice chat with that party before jumping in the game on any platform. In Party Hub, you can decide if your party is open for your friends and their friends to join or you can lock your party so that no one can join without being invited. Learn more about Party Hub privacy controls in our support article on <a href=\"https://www.epicgames.com/help/fortnite-c75/battle-royale-c93/how-can-i-control-my-party-s-privacy-using-the-fortnite-mobile-app-a3272\">managing your party’s privacy using the Fortnite mobile app</a>.</p>\n","_urlPattern":"/safety-and-security","_slug":"safety-and-security","_activeDate":"2019-08-01T15:37:55.768Z","lastModified":"2020-07-28T15:08:52.630Z","_locale":"en-US","_id":"e70bd94f-6c4f-4896-87ad-aa91f2d3064f","_templateName":"blankPageHeaderImage"}},"SecureAccountStore":{"data":{"image":"https://cdn2.unrealengine.com/Fortnite%2Fsecure-your-fortnite-account%2F09BR_Evergreens_Yellow_NewsHeader-1920x1080-9fe09d7770e5b4521e4c46f490366a98b3bc28d4.jpg","_metaTags":"","metaTitle":"How to Secure Your Fortnite Account | Epic Games Account Help","_title":"secure-your-fortnite-account","Title":"How to Secure Your Fortnite Account | Epic Games Account Help","metaImage":"https://cdn2.unrealengine.com/Fortnite%2Fsecure-your-fortnite-account%2F09BR_Evergreens_Yellow_NewsHeader-1920x1080-9fe09d7770e5b4521e4c46f490366a98b3bc28d4.jpg","metaDescription":"With a secure account, you minimize risk of others using your payment methods, behaving badly in your games, and/or doing more damaging actions. Learn more.","_images_":["https://cdn2.unrealengine.com/Fortnite%2Fsecure-your-fortnite-account%2F09BR_Evergreens_Yellow_NewsHeader-1920x1080-9fe09d7770e5b4521e4c46f490366a98b3bc28d4.jpg"],"content":"<h1>Epic Games Account Help: How to Secure Your Fortnite Account</h1>\n\n<p>As a Fortnite player and Epic Games account owner, it is in your best interest to prevent others from logging into your account. By keeping your account secure, you minimize the risk of others using your payment methods to make purchases, behaving in your games in a manner that results in a ban, and/or doing more damaging actions.<br />\n </p>\n\n<h2>How can I have the best Fortnite Account Security?</h2>\nEnabling Multi-Factor Authentication (MFA) is one of the best ways to keep your account secure. With MFA, access to your Fortnite account requires the entry of not only your username and password but also a security code that expires after a short time and can only be used once. Because this extra information is required, it becomes more difficult for others to access your account.<br />\n<br />\nBelow are the situations in which logging into your account requires a security code when you have MFA enabled:\n<ul>\n\t<li>When logging into your account for the first time after MFA is enabled on the account.</li>\n\t<li>When logging into your account on a new device.</li>\n\t<li>After 30 days of no sign-ins on your account.</li>\n\t<li>After clearing cookies on the browser on which your account was being used.</li>\n</ul>\n \n\n<h2>How do I enable MFA on my Fortnite Account?</h2>\nTo enable MFA, take the following steps:\n\n<ul>\n\t<li>Be sure the email address associated with your Epic Games account is verified.</li>\n\t<li>Go to your “Account” page.</li>\n\t<li>Select “Password & Security.”</li>\n\t<li>Scroll down to the “Two-Factor Authentication” section.</li>\n\t<li>Choose your preferred method for receiving your security codes.</li>\n</ul>\nIf you choose to use the Authenticator App method, please note some of the common authenticator apps that Epic Games supports:\n\n<ul>\n\t<li>Google Authenticator</li>\n\t<li>LastPass Authenticator</li>\n\t<li>Microsoft Authenticator</li>\n\t<li>Authy</li>\n</ul>\nFor those who choose to use an authenticator app, it is a good idea to click the “Get Backup Codes” button in the “Authenticator App” subsection. Pressing this button will generate codes you can use as security codes in the event you lose access to your authenticator app. Make sure to take note of these.<br />\n<br />\nIf you choose to use the Email Authentication method, each attempt to log into your account that requires a security code will prompt the correct code to be sent to you via email.<br />\n \n<h2>What else can I do to keep my account secure?</h2>\nTo further keep your Epic account secure, you should use a password unique from those of your other online accounts and make sure to keep it a secret, even from somebody or something claiming to represent Epic Games; Epic Games will never ask you for your password.\n\n<h2> </h2>\n","_urlPattern":"/secure-your-fortnite-account","_slug":"secure-your-fortnite-account","_activeDate":"2019-08-01T15:37:55.768Z","lastModified":"2019-09-04T20:38:34.909Z","_locale":"en-US","_id":"749594f9-09fb-42a4-8786-c6165c7fec07","_templateName":"blankPageHeaderImage"}},"RedeemPageStore":{"enablePosa":true,"description":"Enter Your Code Below To Get Started","_title