er LTM!","content":"<p>Whether for good or for evil, take over the Island as the Nexus War escalates!<br />\n<br />\nv14.20 brings the new Marvel Takeover LTM. As Galactus continues his foreboding descent, use your powers to defeat other players in a team vs. team battle for control of the Island.<br />\n<br />\n<img alt=\"Fortnite Marvel Takeover Ltm\" src=\"https://cdn2.unrealengine.com/fortnite-marvel-takeover-ltm-1920x1080-086301697.jpg\" style=\"height:auto; width:auto\" /><br />\n<br />\nWhile the Nexus War rages on, so does the Island’s Storm. In Marvel Takeover, stay in the moving Storm Shield as you and your team take control of the outposts in its path. The Storm is more dangerous than normal, so stick close to your team and fight together!<br />\n<br />\nEarn points for both capturing outposts and keeping hold of them. During your Island domination, you’ll start with a random primary superpower and see comets in the sky dropping powers of all types.&nbsp;<br />\n<br />\nUnleash your powers to seize the outposts in the Storm Shield’s path!</p>\n","trendingImage":"https://cdn2.unrealengine.com/14br-marveltakeoverltm-newsheader-1920x1080-086301565.jpg","subtitle":"","sticky":true,"short":"<p>Fortnite v14.20 introduces the Marvel Takeover LTM. Use your superpowers to capture outposts with your team while in a moving Storm Shield!</p>\n","featured":false,"date":"2020-09-23T12:00:00.000Z","link":"c5e35751-d28f-461c-8db3-ae1107e658d9","_id":"c5e35751-d28f-461c-8db3-ae1107e658d9","pageMapping":"c5e35751-d28f-461c-8db3-ae1107e658d9","slug":"team-up-to-take-over-the-map-in-the-marvel-takeover-ltm","urlPattern":"/blog/team-up-to-take-over-the-map-in-the-marvel-takeover-ltm","locale":"en-US","noIndex":false,"_script":"undefined","category":[],"tags":[],"_metaTags":"<!-- Basic data for search engine -->\n<meta name=\"description\" content=\"Play the Marvel Takeover LTM in Fortnite! Use your superpowers to capture outposts with your team while in a moving Storm Shield.\">\n<meta name=\"keyword\" content=\"Add keyword here\">\n\n<!-- Open Graph data for Facebook -->\n<meta property=\"og:type\" content=\"article\">\n<meta property=\"og:title\" content=\"Play the Marvel Takeover LTM in Fortnite!\">\n<meta property=\"og:description\" content=\"The Fortnite Marvel Takeover LTM has your team to capture outposts and to keep them under control while in a moving Storm Shield. Start with a random superpower and pick up powers!\">\n<meta property=\"og:image\" content=\"https://www.epicgames.com/fortnite/image.jpg\">\n<meta property=\"og:url\" content=\"https://www.epicgames.com/fortnite/\">\n\n<!-- Twitter Card data -->\n<meta name=\"twitter:card\" content=\"summary\">\n<meta name=\"twitter:title\" content=\"Play the Marvel Takeover LTM in Fortnite!\">\n<meta name=\"twitter:description\" content=\"The Fortnite Marvel Takeover LTM has your team to capture outposts and to keep them under control while in a moving Storm Shield. Start with a random superpower and pick up powers\">\n<meta name=\"twitter:image\" content=\"https://www.epicgames.com/fortnite/image.jpg\">","shareDescription":"Fortnite v14.20 introduces the Marvel Takeover LTM. Use your superpowers to capture outposts with your team while in a moving Storm Shield!","catLocaleMap":{},"prevSlug":"light-it-up-like-dynamite-bts-arrives-in-fortnite-party-royale"},{"trending":false,"noTopImage":false,"gridTitle":"BTS Arrives in Party Royale!","image":"https://cdn2.unrealengine.com/14pr-bts-social-newsthumb-576x576-039000258.jpg","contentTypeSticky":false,"author":"The Fortnite Team","enableLightbox":false,"_type":"Common Post","shareImage":"https://cdn2.unrealengine.com/en-14pr-bts-social-1920x1080-1920x1080-039001449.jpg","title":"Light It Up Like Dynamite: BTS Arrives in Fortnite Party Royale!","content":"<p>BTS is ready to light up Party Royale’s Main Stage for all partygoers. On Friday, September 25 at 8 PM EDT (Saturday, September 26 at 9 AM KST), jump into Party Royale for the world premiere of BTS’ explosive single “Dynamite” Music Video Choreography Version!&nbsp; &nbsp;&nbsp;</p>\n\n<div class=\"embed-responsive embed-responsive-16by9\"><iframe allowfullscreen=\"true\" class=\"embed-responsive-item\" frameborder=\"0\" src=\"https://www.youtube.com/embed/51VQn0zVu-c?rel=0\" width=\"100%\"></iframe></div>\n\n<h2><br />\nGroove in BTS Style</h2>\n\n<p>Dance along to the music with two new Emotes choreographed by BTS. And use these Emotes beyond the show to bring some BTS style anywhere. These new moves will be available in the Item Shop starting September 23 at 8 PM EDT (September 24 at 9 AM KST).</p>\n\n<div class=\"embed-responsive embed-responsive-16by9 html5-video\">\n<video controls=\"controls\" height=\"auto\" loop=\"loop\" preload=\"metadata\" width=\"100%\"><source src=\"https://cdn2.unrealengine.com/keeperdreamchorus-088464530.mp4\" /><source src=\"https://cdn2.unrealengine.com/keeperdreamchorus-088464530.mp4\" /></video>\n</div>\n\n<div class=\"embed-responsive embed-responsive-16by9 html5-video\">\n<video controls=\"controls\" height=\"auto\" loop=\"loop\" preload=\"metadata\" width=\"100%\"><source src=\"https://cdn2.unrealengine.com/btshook-1080-088464525.mp4\" /><source src=\"https://cdn2.unrealengine.com/btshook-1080-088464525.mp4\" /></video>\n</div>\n\n<p>Breaking out your BTS moves is easy. If you own these Fortnite Emotes, just head to the Locker tab in-game to make sure they’re equipped. Once they’re equipped, use them in Party Royale or elsewhere!</p>\n\n<h2><br />\nBTS on Repeat</h2>\n\n<p>Whether you can’t make it to the premiere or just want more BTS, join us for the rebroadcast on Saturday, September 26 at 8 AM EDT (9 PM KST) — happening again at the Main Stage!</p>\n\n<h2><br />\nHow to Join the Party</h2>\n\n<p>Is this your first Party Royale event? If you need help joining the party, check out our <a href=\"https://www.epicgames.com/fortnite/news/your-first-drop-into-party-royale-getting-to-the-main-stage\" target=\"_blank\">guide for getting to the Main Stage in Party Royale</a>. We recommend arriving early to the event.<br />\n<br />\nAnd don’t let the mic drop just yet: after the premiere or rebroadcast, stick around at the Main Stage to listen to a run of BTS’ Dynamite Tropical Remix!</p>\n\n<h2><br />\nRecreate the Dynamite</h2>\n\n<p>You don’t have to wait until this weekend to partake in the festivities. Starting Tuesday, September 22 at 10 AM EDT (11 PM KST), jump into Fortnite Creative for a re-creation of the world of the original “Dynamite” music video — created by community members YU7A, TreyJTH, and SundayCW! Run around as if you were in the music video and complete challenges and minigames. Get the details on how to jump in at the re-creation’s <a href=\"https://www.epicgames.com/fn/0272-4337-3889\">Fortnite Creative webpage</a>.<br />\n<br />\n<img alt=\"14PR BTS CreativeIsland 1920x1080\" src=\"https://cdn2.unrealengine.com/14pr-bts-creativeisland-1920x1080-1920x1080-060553359.jpg\" style=\"height:auto; width:auto\" /><br />\n<style type=\"text/css\"><!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}-->\n</style>\n<br />\nContent Creators, get fired up!<br />\n<br />\nIf you’re streaming the event live, be sure to check your channel’s platform policies for tips on how to avoid copyright strikes.<br />\n<br />\nAttention YouTube Creators: All YouTube videos of the #DynaNite event in Fortnite will NOT receive VOD copyright claims for seven days following the show. After that, videos are subject to copyright claims.<br />\n<br />\nNOTE: There will be about an hour where the Dynamite video premiered in Party Royale is exclusive to Fortnite prior to the official BTS upload of the video to their YouTube channel. Happy creating!</p>\n","trendingImage":"https://cdn2.unrealengine.com/14pr-bts-social-newsheader-1900x600-1900x600-045796569.jpg","subtitle":"","sticky":true,"short":"<p>On September 25 @ 8 PM EDT (Saturday, September 26 @ 9 AM KST), jump into Party Royale for the world premiere of BTS’ explosive single “Dynamite” Music Video Choreography Version!</p>\n\n<p>&nbsp;</p>\n","featured":false,"date":"2020-09-21T06:00:00.000Z","link":"c2181fa1-6d65-4e8c-8e90-1f4b2a08fc73","_id":"c2181fa1-6d65-4e8c-8e90-1f4b2a08fc73","pageMapping":"c2181fa1-6d65-4e8c-8e90-1f4b2a08fc73","slug":"light-it-up-like-dynamite-bts-arrives-in-fortnite-party-royale","urlPattern":"/blog/light-it-up-like-dynamite-bts-arrives-in-fortnite-party-royale","locale":"en-US","noIndex":false,"_script":"undefined","category":[],"tags":[],"_metaTags":"<!-- Basic data for search engine -->\n<meta name=\"description\" content=\"BTS in Fortnite! Watch the new live-action music video of Dynamite by the legendary BTS in Fortnite Party Royale on September 25, 2020. \">\n<meta name=\"keyword\" content=\"Add keyword here\">\n\n<!-- Open Graph data for Facebook -->\n<meta property=\"og:type\" content=\"article\">\n<meta property=\"og:title\" content=\"Watch the BTS Live-Action Dynamite Music Video in Fortnite Party Royale on Sept 25.\">\n<meta property=\"og:description\" content=\"Watch the new live-action music video of Dynamite by the legendary BTS in Fortnite Party Royale on September 25, 2020. Join the show early!\">\n<meta property=\"og:image\" content=\"https://www.epicgames.com/fortnite/image.jpg\">\n<meta property=\"og:url\" content=\"https://www.epicgames.com/fortnite/\">\n\n\n<!-- Twitter Card data -->\n<meta name=\"twitter:card\" content=\"summary\">\n<meta name=\"twitter:title\" content=\"Watch the BTS Live-Action Dynamite Music Video in Fortnite Party Royale on Sept 25.\">\n<meta name=\"twitter:description\" content=\"Watch the new live-action music video of Dynamite by the legendary BTS in Fortnite Party Royale on September 25, 2020. Join the show early!\">\n<meta name=\"twitter:image\" content=\"https://www.epicgames.com/fortnite/image.jpg\">","shareDescription":"On September 25 @ 8 PM EDT (Saturday, September 26 @ 9 AM KST), jump into Party Royale for the world premiere of BTS’ explosive single “Dynamite” Music Video Choreography Version!","catLocaleMap":{},"nextSlug":"team-up-to-take-over-the-map-in-the-marvel-takeover-ltm","prevSlug":"save-the-worlds-newest-update-9-22-2020"},{"trending":false,"noTopImage":false,"image":"https://cdn2.unrealengine.com/10stw-evergreens-yellow-newsthumbnail-576x576-069816179.jpg","contentTypeSticky":false,"author":"The Fortnite Team","enableLightbox":false,"_type":"Common Post","shareImage":"https://cdn2.unrealengine.com/10stw-evergreens-yellow-newsheader-1920x1080-069816604.jpg","title":"SAVE THE WORLD | HOMEBASE STATUS REPORT 9.23.2020","content":"<p>Hello Commanders,&nbsp;<br />\n<br />\nHomebase continues with the spooks and haunts of Fortnitemares. Here’s a look at what’s coming over the next three weeks for Fortnite Save the World! As a reminder, the Fortnitemares content returns to its slumber on <strong>November 20.</strong>&nbsp;<br />\n<br />\nHomebase Status Report… Initiate!<br />\n&nbsp;</p>\n\n<h2>This Week - The Door to Darkness Returns!<br />\n<br />\n<img alt=\"Fortnite Save The World Door To Darkness Questline\" src=\"https://cdn2.unrealengine.com/fortnite-save-the-world-door-to-darkness-questline-1920x1080-027709328.jpg\" style=\"height:auto; width:auto\" /><br />\n&nbsp;</h2>\n\n<p>Starting<strong> Friday, September 25 at 8PM</strong>, make a reservation for terror! Join the Homebase crew for a nightmarish stay at legendary Oakdirge Lodge, Stoneplankentwine’s third most haunted hotel to unlock Willow, the ghoulish Outlander!&nbsp;<br />\n<br />\n<img alt=\"Fortnite Save The World Willow\" src=\"https://cdn2.unrealengine.com/fortnite-save-the-world-willow-1920x1080-027728419.jpg\" style=\"height:auto; width:auto\" /><br />\n&nbsp;</p>\n\n<h2>Willow&nbsp;</h2>\n<em>\"I want your soul... and your candy!\" - Willow</em><br />\n&nbsp;\n<ul>\n\t<li>Standard Perk: <strong>Ghoulish Cackle</strong>&nbsp;\n\n\t<ul>\n\t\t<li>Increase Ability damage up to <strong>37.5%</strong> based on the percentage of your missing health.&nbsp;</li>\n\t</ul>\n\t</li>\n\t<li>Commander Perk: <strong>Ghoulish Cackle +</strong>\n\t<ul>\n\t\t<li>Increase Ability damage up to <strong>37.5%</strong> based on the percentage of your missing health. In addition, ability eliminations have a <strong>70%</strong> chance to conjure a Phantasm which seeks out nearby foes and explodes, dealing <strong>62</strong> base energy damage in a small radius.</li>\n\t</ul>\n\t</li>\n</ul>\n\n<p><em>Available from the Door to Darkness questline!</em><br />\n<br />\n<img alt=\"Fortnite Save The World Husk Grinder\" src=\"https://cdn2.unrealengine.com/fortnite-save-the-world-husk-grinder-1920x1080-027740155.jpg\" style=\"height:auto; width:auto\" /><br />\n&nbsp;</p>\n\n<h2>Husk Grinder</h2>\nSharpen up your Black Metal weapon set with the darkest metal axe around, the Husk Grinder.<br />\n<br />\n<em>Available on <strong>September 25 at 8PM ET</strong> in the Event Store!</em><br />\n<br />\n<img alt=\"Fortnite Save The World Dirge Song\" src=\"https://cdn2.unrealengine.com/fortnite-save-the-world-dirge-song-1920x1080-027756742.jpg\" style=\"height:auto; width:auto\" /><br />\n&nbsp;\n<h2>Dirge Song</h2>\nSing the Husks a song! Firing in a 9-round burst, this Black Metal SMG packs a powerful punch.<br />\n<br />\n<em>Available on <strong>September 25 at 8PM ET</strong> in the Event Store!</em><br />\n&nbsp;\n<h2>Week 2 - JONESEE-BOT Returns!</h2>\n<br />\n<img alt=\"Fortnite Save The World Jonesee Bot\" src=\"https://cdn2.unrealengine.com/fortnite-save-the-world-jonesee-bot-1920x1080-027767935.jpg\" style=\"height:auto; width:auto\" /><br />\n&nbsp;\n<h2>JONESEE-BOT is seeing the event store!</h2>\n<em>QUIET PLEASE. I AM FIGHTING.</em><br />\n&nbsp;\n<ul>\n\t<li>Standard Perk: <strong>Ow. My eye!</strong>\n\n\t<ul>\n\t\t<li>Increase Headshot damage up to <strong>50%</strong> based on the percentage of your missing Health.</li>\n\t</ul>\n\t</li>\n\t<li>Commander Perk: <strong>Ow. My eye!+</strong>\n\t<ul>\n\t\t<li>Increase Headshot damage up to <strong>50%</strong> based on the percentage of your missing Health. &nbsp;In addition, Headshot eliminations have a <strong>50%</strong> chance to conjure a Phantasm which seeks out nearby foes and explodes, dealing <strong>62</strong> base energy damage in a small radius.</li>\n\t</ul>\n\t</li>\n</ul>\n<em>Available on <strong>October 2 at 8PM ET</strong> in the Event Store!</em><br />\n&nbsp;\n<h2>Week 3 - The Grave Digger is back!</h2>\n<br />\n<img alt=\"Fortnite Save The World Grave Digger\" src=\"https://cdn2.unrealengine.com/fortnite-save-the-world-grave-digger-1920x1080-027783138.jpg\" style=\"height:auto; width:auto\" /><br />\n<br />\nThis popular assault rifle returns! Gravedigger fires medium ammo, gaining damage and impact at the cost of accuracy and fire rate.<br />\n<br />\n<em>Available on <strong>October 9 at 8PM ET</strong> in the Event Store!</em><br />\n<br />\nKeep it tuned to the Homebase Status report for details on an upcoming new questline where another member of Homebase joins your team. Who will it be? See you in Hexsylvania!<br />\n<br />\n<em>Note: Apple is preventing Epic from signing games for distribution on Mac which ends our ability to develop and offer Fortnite: Save the World for the platform. As a result, beginning September 23, 2020, Fortnite: Save the World will no longer be playable on macOS.</em><br />\n<br />\n<a href=\"https://www.epicgames.com/fortnite/news/apple-ends-epics-ability-to-offer-fortnite-save-the-world-on-mac\" target=\"_blank\"><em>Please read our recent blog post<strong>&nbsp;</strong>for more details.</em></a>","trendingImage":"https://cdn2.unrealengine.com/10stw-evergreens-yellow-newsheader-1920x1080-069816604.jpg","sticky":false,"short":"<p>SAVE THE WORLD | HOMEBASE STATUS REPORT 9.23.2020</p>\n","featured":false,"date":"2020-09-23T04:00:00.000Z","link":"8195c91c-a582-4db1-bee0-48ced75a61cd","_id":"8195c91c-a582-4db1-bee0-48ced75a61cd","pageMapping":"8195c91c-a582-4db1-bee0-48ced75a61cd","slug":"save-the-worlds-newest-update-9-22-2020","urlPattern":"/blog/save-the-worlds-newest-update-9-22-2020","locale":"en-US","noIndex":false,"_script":"undefined","category":[],"tags":[],"_metaTags":"<!-- Basic data for search engine -->\n<meta name=\"description\" content=\"Complete the Door to Darkness questline to unlock WIllow, Don’t forget to grab the Husk Grinder, Dirge Song, and Grave Digger from the Event Store.\">>>","shareDescription":"SAVE THE WORLD | HOMEBASE STATUS REPORT 9.23.2020","catLocaleMap":{},"nextSlug":"light-it-up-like-dynamite-bts-arrives-in-fortnite-party-royale","prevSlug":"bug-fixes-in-fortnite-creative-v14-20"},{"trending":false,"noTopImage":false,"image":"https://cdn2.unrealengine.com/Fortnite%2Fblog%2Fwhat-s-new-in-creative---v11-30%2F11CM_DevUpdate_NewsThumbnail-%281%29-576x576-c7a632434c4f2663e9be7284d0c41848d219e9bd.jpg","contentTypeSticky":false,"author":"","enableLightbox":false,"_type":"Common Post","shareImage":"https://cdn2.unrealengine.com/Fortnite%2Fblog%2Fwhat-s-new-in-creative---v11-30%2F11CM_DevUpdate_NewsHeader-1920x1080-3f04eb2a3aed82b39ad607ab8f382c1f194f311d.jpg","title":"Check Out the Bug Fixes Update for Fortnite Creative v14.20","content":"&nbsp;\n<h2>Islands Bug Fixes</h2>\n\n<ul>\n\t<li>Fixed an issue where players could take inventory items back to the Hub when starting a game inside a B.R.U.T.E.</li>\n</ul>\n\n<h2>Gameplay Bug Fixes</h2>\n\n<ul>\n\t<li>Fixed an issue where placing floors didn’t remove underlying grass.</li>\n\t<li>Fixed an issue where grass was flickering.</li>\n\t<li>Fiends will now correctly pursue players in most situations.</li>\n</ul>\n\n<h2>Weapons and Items Bug Fixes</h2>\n\n<ul>\n\t<li>Fixed an issue where players didn’t carry Snowballs correctly while on a Driftboard.</li>\n\t<li>Fixed an issue where Sentries couldn’t damage Ballers.</li>\n</ul>\n\n<h2>Creative Tools and Phone Bug Fixes</h2>\n\n<ul>\n\t<li>Ball Spawners no longer spawn extra balls when equipped via the Quickbar.</li>\n</ul>\n\n<h2>Prefabs and Galleries Bug Fixes</h2>\n\n<ul>\n\t<li>Fixed an issue on the Dark Tilted Theater Prefab, where a door could be opened through a boarded up prop.</li>\n\t<li>Fixed an issue where the Meteor Particles had a blocking collision.</li>\n\t<li>Fixed a broken shadow on a Fortilla gallery street light.</li>\n</ul>\n\n<h2>Devices Bug Fixes</h2>\n\n<ul>\n\t<li>Fixed an issue where Trick Tiles could destroy staircases beneath the floor they were attached to when triggered in subsequent minigames.</li>\n\t<li>Fixed an issue where players were not granted items from the Team Settings and Inventory device at the beginning of the round.</li>\n\t<li>Fixed an issue where the Team Member Eliminated Transmit On setting was not firing properly.</li>\n</ul>\n","trendingImage":"https://cdn2.unrealengine.com/Fortnite%2Fblog%2Fwhat-s-new-in-creative---v11-30%2F11CM_DevUpdate_NewsHeader-1920x1080-3f04eb2a3aed82b39ad607ab8f382c1f194f311d.jpg","sticky":false,"short":"The Fortnite Creative v14.20 bug fix update is here. We have resolved a series of issues with gameplay, weapons, Creative tools, prefabs, galleries and much more.","featured":false,"date":"2020-09-22T17:18:00.000Z","link":"a2a7a7a5-2e09-4f12-91ab-dc5d72833a78","_id":"a2a7a7a5-2e09-4f12-91ab-dc5d72833a78","pageMapping":"a2a7a7a5-2e09-4f12-91ab-dc5d72833a78","slug":"bug-fixes-in-fortnite-creative-v14-20","urlPattern":"/blog/bug-fixes-in-fortnite-creative-v14-20","locale":"en-US","noIndex":false,"_script":"undefined","category":[],"tags":[],"_metaTags":"<!-- Basic data for search engine -->\n<meta name=\"description\" content=\"The Fortnite Creative v14.20 update is here. Find out which bug fixes for gameplay, weapons, prefabs, and more we are deploying.\">\n<meta name=\"keyword\" content=\"Add keyword here\">\n\n<!-- Twitter Card data -->\n<meta name=\"twitter:card\" content=\"summary\">\n<meta name=\"twitter:title\" content=\"Check Out the Bug Fixes Update for Fortnite Creative v14.20\">\n<meta name=\"twitter:description\" content=\"The Fortnite Creative v14.20 bug fix update is here. We have resolved a series of issues with gameplay, weapons, Creative tools, prefabs, galleries and much more.\">\n<meta name=\"twitter:image\" content=\"https://www.epicgames.com/fortnite/image.jpg\">","shareDescription":"The Fortnite Creative v14.20 bug fix update is here. We have resolved a series of issues with gameplay, weapons, Creative tools, prefabs, galleries and much more.","catLocaleMap":{},"nextSlug":"save-the-worlds-newest-update-9-22-2020","prevSlug":"fortnite-presents-spotlight-featuring-slushii"},{"trending":false,"noTopImage":false,"gridTitle":"Fortnite Presents: Spotlight featuring Slushii","image":"https://cdn2.unrealengine.com/14pr-slushii-announcment-newsthumb-576x576-038502686.jpg","contentTypeSticky":false,"author":"The Fortnite Team","enableLightbox":false,"_type":"Common Post","shareImage":"https://cdn2.unrealengine.com/en-14pr-slushii-announcment-social-1920x1080-038503875.jpg","title":"Watch Slushii Debut His Latest Single in Fortnite Party Royale on September 26","content":"<p>It’s awesome bringing live music to the Fortnite community with the Spotlight concert series. Following Dominic Fike and Anderson .Paak -- Party Royale is ready to roll with the final September show!</p>\n\n<p style=\"text-align:center\"><img alt=\"EN 14PR Slushii Announcment NewsHeader 1900x600\" src=\"https://cdn2.unrealengine.com/en-14pr-slushii-announcment-newsheader-1900x600-1900x600-038503212.jpg\" style=\"height:auto; width:auto\" /></p>\n\n<h2><br />\nAct 3: Slushii</h2>\n<br />\nJust in time for the <a href=\"https://www.epicgames.com/fortnite/news/llama-rama-brings-fortnite-and-rocket-league-together\" target=\"_blank\">Llama-Rama crossover event starting this weekend</a> in Rocket League, acclaimed artist Slushii is ready to rock Party Royale’s Main Stage. Whether you’re tuning into Radio Yonder or already playing Rocket League, you’ll instantly recognize his in-game track, <a href=\"https://open.spotify.com/track/3YVj9LLq5GMvBvoKubnUp0?si=tFprBHQOTa-K8gxUFm6Nbg\">“LUV U NEED U”</a>.<br />\n<br />\nKicking off the Llama-Rama festivities, catch Slushii’s premiere live show -- featuring the debut of a brand-new unreleased single -- on Saturday, September 26 @ 5pm ET. Rebroadcasts are scheduled for September 26 @ 11pm ET and September 27 @ 1pm ET. For the latest updates on scheduling, check <a href=\"https://twitter.com/fortnitegame\">@FortniteGame</a> for the latest.\n\n<h2><br />\nWhat is Llama-Rama?<br />\n&nbsp;</h2>\nIn celebration of Rocket League’s Free-to-Play debut, <a href=\"https://www.epicgames.com/fortnite/news/llama-rama-brings-fortnite-and-rocket-league-together\" target=\"_blank\">Llama-Rama</a> runs September 26 - October 12. Play Rocket League, earn free rewards in Fortnite and Rocket League, and yes, the Battle Bus is dropping into the&nbsp; Rocket League arena!<br />\n&nbsp;\n<div class=\"embed-responsive embed-responsive-16by9\"><iframe allowfullscreen=\"true\" class=\"embed-responsive-item\" frameborder=\"0\" src=\"https://www.youtube.com/embed/GuQQvpJgLvg?rel=0\" width=\"100%\"></iframe></div>\n\n<h2><br />\nPicture In Picture</h2>\n<br />\nCan’t decide between playing Battle Royale or attending the concert? Why not do both! We’ve added picture in picture (PIP) that will allow you to watch Slushii’s show in core modes and Party Royale. To enable PIP, open up your game settings and enable the feature.&nbsp;\n<p style=\"text-align:center\"><img alt=\"Fortnite Picture In Picture\" src=\"https://cdn2.unrealengine.com/fortnite-picture-in-picture-1920x1080-072799756.jpg\" style=\"height:auto; width:auto\" /></p>\n\n<h2><br />\nWhich Spotlight Artist is Next?</h2>\n<br />\nSlushii concludes the trilogy of Spotlight concert acts in September, but the fiesta is just getting started.<br />\n<br />\nDue to current world circumstances, concerts are tricky and all of us have been missing that live show experience, especially the social connection of good music with good friends. We hope the Spotlight concert series and Party Royale are another way to share entertaining experiences with our closest friends. Stop by, check it out and bring someone new next time!<br />\n<br />\nThanks for stepping into the Spotlight with us!!&nbsp;<br />\n&nbsp;\n<h2>Jump into Party Royale and Join the Show</h2>\nFollow the steps below to get into Party Royale and watch the show at the Main Stage (or follow the steps in our <a href=\"https://www.epicgames.com/fortnite/news/your-first-drop-into-party-royale-getting-to-the-main-stage\">beginner’s guide</a>!).\n\n<ul>\n\t<li>From the Lobby screen, press the “Change” box located in the bottom-right corner.</li>\n\t<li>Modes will appear on-screen. Select the “Party Royale” mode tile then press “Accept.\"</li>\n\t<li>After pressing “Accept,\" you’ll return to the Lobby screen. Just press “Play” to start!&nbsp;</li>\n\t<li>Head to the Main Stage and wait for the event to start. Use the map button while in Party Royale to see where you are and the location of the Main Stage.</li>\n</ul>\n\n<h2><img alt=\"Fortnite Party Royale Main Stage Spotlight\" src=\"https://lh6.googleusercontent.com/61_EjSnQM6o3YGziPw6NeECo8udh1Vdol2wvfTgsjgS7Q0dcOiyUqtFWtL66_kWBLHlvrdph1QYkjXNXeAOkpO9wTZKRgHVxhponG2c6PVMLMlDoI_5TlRf6MGFdkU7-ZPcL2pDn\" /></h2>\n\n<h2><br />\nNew to Fortnite?&nbsp;</h2>\n<br />\n<a href=\"https://www.epicgames.com/fortnite/en-US/download\">Download Fortnite for free.</a> Fortnite Party Royale is available on Android, PlayStation 4, Xbox One, Nintendo Switch, and PC.\n\n<p>Note for Content Creators: This Party Royale event features licensed content. Read our&nbsp;<a href=\"https://www.epicgames.com/fortnite/news/slushii-spotlight-series-content-creator-guide\" target=\"_blank\">Content Creator Guide</a>&nbsp;for this event and refer to your channel’s platform policies for tips on how to avoid copyright strikes.</p>\n","trendingImage":"https://cdn2.unrealengine.com/en-14pr-slushii-announcment-newsheader-1900x600-v2-1900x600-072610852.jpg","subtitle":"","sticky":false,"short":"<p>Slushii will premiere his newest single at the Party Royale Main Stage in Fortnite Presents: Spotlight. Catch his performance on September 26. Rebroadcasts are later that day and on September 27.</p>\n","featured":false,"date":"2020-09-22T13:00:00.000Z","link":"5e9a374b-720f-457f-b691-226b818b5d3d","_id":"5e9a374b-720f-457f-b691-226b818b5d3d","pageMapping":"5e9a374b-720f-457f-b691-226b818b5d3d","slug":"fortnite-presents-spotlight-featuring-slushii","urlPattern":"/blog/fortnite-presents-spotlight-featuring-slushii","locale":"en-US","noIndex":false,"_script":"undefined","category":[],"tags":[],"_metaTags":"<!-- Basic data for search engine -->\n<meta name=\"description\" content=\"Slushii will premiere his newest single at the Party Royale Main Stage in Fortnite Presents: Spotlight. Catch his performance on September 26.\">\n<meta name=\"keyword\" content=\"Add keyword here\">\n\n","shareDescription":"Slushii will premiere his newest single at the Party Royale Main Stage in Fortnite Presents: Spotlight. Catch his performance on September 26. Rebroadcasts are later that day and on September 27.","catLocaleMap":{},"nextSlug":"bug-fixes-in-fortnite-creative-v14-20","prevSlug":"llama-rama-brings-fortnite-and-rocket-league-together"},{"trending":false,"noTopImage":false,"image":"https://cdn2.unrealengine.com/14br-rocketleague-llama-rama-announce-newsthumb-576x576-072392463.jpg","contentTypeSticky":false,"author":"The Fortnite Team","enableLightbox":false,"_type":"Common Post","shareImage":"https://cdn2.unrealengine.com/14br-rocketleague-llama-rama-announce-social-1920x1080-072395863.jpg","title":"Llama-Rama Brings Fortnite and Rocket League Together!","content":"<p>The Battle Bus has a full tank of boost and is flying into Rocket League! Fortnite is celebrating Rocket League’s move to Free to Play with Llama-Rama -- a crossover event where players can complete Rocket League Challenges to unlock rewards for both Rocket League and Fortnite. It’s the perfect time to check out what Soccar is all about!</p>\n\n<div class=\"embed-responsive embed-responsive-16by9\"><iframe allowfullscreen=\"true\" class=\"embed-responsive-item\" frameborder=\"0\" src=\"https://www.youtube.com/embed/GuQQvpJgLvg?rel=0\" width=\"100%\"></iframe></div>\n\n<p>Llama-Rama kicks off on September 26 following the Party Royale’s <a href=\"https://www.epicgames.com/fortnite/news/fortnite-presents-spotlight-featuring-slushii\" target=\"_blank\">upcoming Spotlight Series concert</a> featuring Rocket League fan-favorite, DJ Slushii.<br />\n<br />\n<em>Llama-Rama will be live on platforms where Rocket League is available.</em><br />\n&nbsp;</p>\n\n<h2>Rocket League and Fortnite Challenge Rewards</h2>\n\n<p>Start your engines, collect some boost, and earn rewards! Rocket League players will get Fortnite-themed items as they complete Llama-Rama Challenges in Rocket League. Additionally, Fortnite players will receive Rocket League-themed items in Fortnite as part of the same Challenges.<br />\n<br />\n<img alt=\"Rocket League Fortnite Challenges And Rewards\" src=\"https://cdn2.unrealengine.com/rocket-league-fortnite-challenges-and-rewards-1920x1080-072433019.jpg\" style=\"height:auto; width:auto\" /><br />\n&nbsp;</p>\n\n<ul>\n\t<li>\n\t<h3>Challenge 1: Llamas, start your engines!</h3>\n\n\t<ul>\n\t\t<li>Rocket League Challenge: Play an Online Match in Any Playlist</li>\n\t\t<li>Rocket League Reward: Llama Flyer Antenna&nbsp;</li>\n\t\t<li>Fortnite Reward: Rocket League Spray&nbsp;</li>\n\t</ul>\n\t</li>\n\t<li>\n\t<h3>Challenge 2 - Flagged for Victory</h3>\n\n\t<ul>\n\t\t<li>Rocket League Challenge: Win 1 Online Match in Casual with the Llama Antenna</li>\n\t\t<li>Rocket League Reward: Top Llama Topper</li>\n\t\t<li>Fortnite Reward: Holodata Drop Contrail</li>\n\t</ul>\n\t</li>\n\t<li>\n\t<h3>Challenge 3 - Top of the World</h3>\n\n\t<ul>\n\t\t<li>Rocket League Challenge: Get 5 goals, saves, or assists with the Llama Topper</li>\n\t\t<li>Rocket League Reward: Loot Llama Octane Decal</li>\n\t\t<li>Fortnite Reward: Rocket Groove Music Track</li>\n\t</ul>\n\t</li>\n\t<li>\n\t<h3>Challenge 4 - An Epic Endeavor</h3>\n\n\t<ul>\n\t\t<li>Rocket League Challenge: Win 5 Online Matches in Any Playlist with the Llama Decal (Octane)</li>\n\t\t<li>Rocket League Reward: Llama Wheels</li>\n\t\t<li>Fortnite Reward: Rocket League Emoticon</li>\n\t</ul>\n\t</li>\n\t<li>\n\t<h3>Challenge 5 - Llama Legend</h3>\n\n\t<ul>\n\t\t<li>Rocket League Challenge: Get MVP in any Online Match with the Llama Wheels</li>\n\t\t<li>Rocket League Reward: Battle Bus + Battle Balloon Antenna, Battle Bus Wheels, and Battle Bus Engine Audio</li>\n\t\t<li>Fortnite Reward: Octane RL Backbling + style variant</li>\n\t</ul>\n\t</li>\n</ul>\n&nbsp;\n\n<h2>How to Claim Rewards</h2>\n\n<p>Going supersonic is a blast when you’re earning rewards. After completing Llama-Rama Challenges, players can view the Rocket League Event Challenge Page to redeem Rocket League rewards for completed Challenges. On the Fortnite side of things, players will receive Challenge rewards after logging into Fortnite after each Challenge is completed in Rocket League. <strong>You do not need to claim rewards in Fortnite to get your Fortnite items.</strong>&nbsp;<br />\n<br />\n<em>Note: Any completed but uncollected Challenges are auto-claimed when the event ends on October 12.</em>&nbsp;<br />\n<br />\n<a href=\"https://www.rocketleague.com/news/rocket-league-free-to-play-arrives-september-23/\" target=\"_blank\">Check out this Rocket League blog for more information on Rocket League becoming Free to Play.</a><br />\n<br />\n<img alt=\"Fortnite Whiplash Repaint Screen\" src=\"https://cdn2.unrealengine.com/fortnite-whiplash-repaint-screen-1920x1080-072436762.jpg\" style=\"height:auto; width:auto\" /></p>\n","trendingImage":"https://cdn2.unrealengine.com/14br-rocketleague-llama-rama-announce-newsheader-1900x600-soccar-1900x600-078930720.jpg","sticky":false,"short":"The Llama-Rama crossover event for Fortnite and Rocket League begins on September 26th. Complete Rocket League Challenges and earn rewards in both games!","featured":false,"date":"2020-09-22T13:00:00.000Z","link":"43d2490b-fef6-49c1-a2e3-ffc2e1916837","_id":"43d2490b-fef6-49c1-a2e3-ffc2e1916837","pageMapping":"43d2490b-fef6-49c1-a2e3-ffc2e1916837","slug":"llama-rama-brings-fortnite-and-rocket-league-together","urlPattern":"/blog/llama-rama-brings-fortnite-and-rocket-league-together","locale":"en-US","noIndex":false,"_script":"undefined","category":[],"tags":[],"_metaTags":"<!-- Basic data for search engine -->\n<meta name=\"description\" content=\"The Llama-Rama crossover event for Fortnite and Rocket League begins on September 26th. Complete Rocket League Challenges and earn rewards in both games!\">","shareDescription":"The Llama-Rama crossover event for Fortnite and Rocket League begins on September 26th. Complete Rocket League Challenges and earn rewards in both games!","catLocaleMap":{},"nextSlug":"fortnite-presents-spotlight-featuring-slushii","prevSlug":"slushii-spotlight-series-content-creator-guide"},{"trending":false,"noTopImage":false,"gridTitle":"","image":"https://cdn2.unrealengine.com/14pr-slushii-announcment-newsthumb-576x576-070591345.jpg","contentTypeSticky":false,"author":"The Fortnite Team","enableLightbox":false,"_type":"Common Post","shareImage":"https://cdn2.unrealengine.com/en-14pr-slushii-announcment-social-1920x1080-070598863.jpg","title":"Slushii Spotlight Series Content Creator Guide","content":"<p>Ahead of this Saturday’s Spotlight live concert featuring <a href=\"http://www.epicgames.com/fortnite/news/fortnite-presents-spotlight-featuring-slushii\" target=\"_blank\">Slushii</a>, we’ve put together some tips for our content creators to ensure the best possible experience while sharing the event with your communities.</p>\n\n<ul>\n\t<li>You can stream and share on YouTube from Sept 26th&nbsp;- Oct 2nd&nbsp;without copyright claims or demonetization on Spotlight concert series content. After the seven day window has passed your video will be demonetized, but no strikes or takedowns should be issued.&nbsp;\n\t<ul>\n\t\t<li>If you receive a Copyright Claim prior to October 2nd&nbsp;on these videos, please appeal the claim directly with the rights holders.&nbsp;&nbsp;</li>\n\t</ul>\n\t</li>\n\t<li>We’ve worked with our partners to ensure that creators in our Support-a-Creator program can share the show with their communities.&nbsp;\n\t<ul>\n\t\t<li>IMPORTANT: You need to have a valid YouTube channel linked to your Support-a-Creator account prior to the concert start on September 26th, 5 PM EDT.&nbsp;</li>\n\t\t<li>If you would like to add a YouTube channel to your existing Support-a-Creator account, please submit a ticket to Player Support (<a href=\"https://www.epicgames.com/help/supportacreator-c83/trending-topics-c146/how-do-i-link-my-youtube-channel-to-my-epic-games-supportacreator-account-a6967\" target=\"_blank\">here</a>).&nbsp;\n\t\t<ul>\n\t\t\t<li>We aren’t able to add new creators to the Support-a-Creator right now. Keep an eye on the website and Fortnite social for updates on that application re-opening.&nbsp;</li>\n\t\t</ul>\n\t\t</li>\n\t</ul>\n\t</li>\n</ul>\n\n<ul>\n\t<li>Don’t forget to promote your Creator Code, so your fans can support you when they make a purchase!</li>\n\t<li>Review the <a href=\"https://www.epicgames.com/site/en-US/content-guidelines\">Fortnite Content Guidelines</a>.</li>\n\t<li>Check the <a href=\"https://www.epicgames.com/fortnite/en-US/partyroyale\">Party Royale schedule</a> and plan on getting in early!&nbsp;</li>\n</ul>\n","trendingImage":"https://cdn2.unrealengine.com/en-14pr-slushii-announcment-newsheader-1900x600-v2-1900x600-072818688.jpg","sticky":false,"short":"<p>Learn about the Slushii&nbsp;content creator guidelines for his upcoming Spotlight Series performance in Fortnite Party Royale so you can provide the best experience for your audience.</p>\n","featured":false,"date":"2020-09-22T12:00:00.000Z","link":"114508fc-f03e-4a93-ba6a-9259bba97c57","_id":"114508fc-f03e-4a93-ba6a-9259bba97c57","pageMapping":"114508fc-f03e-4a93-ba6a-9259bba97c57","slug":"slushii-spotlight-series-content-creator-guide","urlPattern":"/blog/slushii-spotlight-series-content-creator-guide","locale":"en-US","noIndex":false,"_script":"undefined","category":[],"tags":[],"_metaTags":"<!-- Basic data for search engine -->\n<meta name=\"description\" content=\"Learn about the Slushii content creator guidelines for his upcoming Spotlight Series performance in Fortnite Party Royale.\">\n<meta name=\"keyword\" content=\"Add keyword here\">\n\n","shareDescription":"Learn about the Slushii content creator guidelines for his upcoming Spotlight Series performance in Fortnite Party Royale so you can provide the best experience for your audience.","catLocaleMap":{},"nextSlug":"llama-rama-brings-fortnite-and-rocket-league-together","prevSlug":"your-first-drop-into-party-royale-getting-to-the-main-stage"},{"trending":false,"noTopImage":false,"gridTitle":"","image":"https://cdn2.unrealengine.com/en-12pr-premiere-news-newsthumbnail-512x512-036383849.jpg","contentTypeSticky":false,"author":"The Fortnite Team","enableLightbox":false,"_type":"Common Post","shareImage":"https://cdn2.unrealengine.com/en-13pr-logo-social-1920x1080-036383735.jpg","title":"Your First Drop Into Party Royale: Getting to the Main Stage","content":"<p><strong>First time dropping into Party Royale? Check this handy guide!</strong><br />\n<br />\nParty Royale is a new experimental and evolving space in Fortnite where you can kick up your shoes and relax while enjoying minigames or join your friends to attend concerts, movies, and more! No need to worry about getting eliminated in Party Royale (there’s no combat and no building in Party Royale), so anyone who drops in can breathe easy!<br />\n<br />\n<strong>First, let’s make sure you have Fortnite.</strong><br />\n<br />\nYou can download Fortnite for free on PlayStation 4, Xbox One, Nintendo Switch, PC, and Android. All modes located in Fortnite Battle Royale are free, so after you’ve downloaded Fortnite, jump into Party Royale!&nbsp;<br />\n<br />\nCheck out our <a href=\"https://www.epicgames.com/fortnite/faq\">Fortnite FAQ page</a> for how to download Fortnite on any of the&nbsp;above platforms.<br />\n<br />\n<span style=\"color:#e74c3c\">Please be aware of the following Party Royale pointers!</span></p>\n\n<ul>\n\t<li>\n\t<p><span style=\"color:#e74c3c\">If you are downloading Fortnite for the first time and are planning to participate in a scheduled event in Party Royale, please download the game a few hours ahead of showtime, as download times may vary depending on platform and Internet connection speed.</span></p>\n\t</li>\n\t<li>\n\t<p><span style=\"color:#e74c3c\">If you have not played Fortnite in a while, please be sure to download updates a few hours ahead of showtime.&nbsp;</span></p>\n\t</li>\n\t<li>\n\t<p><span style=\"color:#e74c3c\">For big events in Party Royale, we recommend you join in 30 minutes to an hour ahead of showtime to secure your spot!</span></p>\n\t</li>\n</ul>\n\n<h2><br />\nHow to Jump Into Party Royale</h2>\n\n<p>Follow the steps below to get into Party Royale and watch a show at the Main Stage, one of the main locations shows happen in Party Royale.<br />\n<br />\n1) In the Lobby screen, press the “Change” box located in the bottom-right corner.<br />\n<br />\n2) Modes will appear on-screen. Select the “Party Royale” mode tile then press “Accept.\"<br />\n<br />\n<img alt=\"Fortnite Party Royale Game Mode\" src=\"https://cdn2.unrealengine.com/fortnite-party-royale-game-mode-2560x1600-073433081.jpg\" style=\"height:auto; width:auto\" /><br />\n<br />\n3) After pressing “Accept,\" you’ll return to the Lobby screen. Just press “Play” to start!&nbsp;<br />\n<br />\n<img alt=\"Join Fortnite Party Royale\" src=\"https://cdn2.unrealengine.com/join-fortnite-party-royale-2560x1600-034615167.jpg\" style=\"height:auto; width:auto\" /><br />\n<br />\n4) Head to the Main Stage and wait for the event to start. Use the map button while in Party Royale to see where you are and the location of the Main Stage.<br />\n<br />\n<img alt=\"Fortnite Party Royale Main Stage\" src=\"https://cdn2.unrealengine.com/fortnite-party-royale-main-stage-2560x1600-034611447.jpg\" style=\"height:auto; width:auto\" /></p>\n\n<h2><br />\nGetting to the Main Stage</h2>\n\n<p>1) You will spawn near The Plaza in the center of the map. In The Plaza, look for the ice cream shop “SOFDEEZ.”<br />\n<br />\n<img alt=\"Fortnite Party Royale Sofdeez Ice Cream Shop\" src=\"https://cdn2.unrealengine.com/fortnite-party-royale-sofdeez-ice-cream-shop-1334x750-034677503.png\" style=\"height:auto; width:auto\" /><br />\n<br />\n2) Facing the SOFDEEZ entrance, follow the road in the back-right. You will then see a disco sign showing that you’re well on your way to the Main Stage!<br />\n<br />\n<img alt=\"Fortnite Party Royale Main Stage Disco Sign\" src=\"https://cdn2.unrealengine.com/fortnite-party-royale-main-stage-disco-sign-1334x750-034677490.png\" style=\"height:auto; width:auto\" /><br />\n<br />\n3) Cross the bridge and you’re almost there!<br />\n<br />\n<img alt=\"Fortnite Party Royale Bridge To Main Stage\" src=\"https://cdn2.unrealengine.com/fortnite-party-royale-bridge-to-main-stage-1334x750-034677502.png\" style=\"height:auto; width:auto\" /><br />\n<br />\n4) When you arrive at the Main Stage, wait for the show to start.&nbsp;<br />\n<br />\n<img alt=\"Fortnite Party Royale Main Stage\" src=\"https://cdn2.unrealengine.com/fortnite-party-royale-main-stage-1334x750-034677485.png\" style=\"height:auto; width:auto\" /></p>\n\n<h2><br />\nYou can also play with friends!</h2>\n\n<p>Hang out and chat with friends during the event:<br />\n<br />\n1) Before jumping into Party Royale, press the social icon located in the top-left of the screen in the Lobby. Press “Add Friends” and then enter your friend’s display name to add them.&nbsp;<br />\n<br />\n2) From the list, select your friend’s name and click “Invite to Party”.<br />\n<br />\n<img alt=\"Invite Friends In Fortnite\" src=\"https://cdn2.unrealengine.com/invite-friends-in-fortnite-2560x1600-073433097.jpg\" style=\"height:auto; width:auto\" /><br />\n<br />\n3) Once you have all your friends in your party, follow the same steps outlined above to jump into Party Royale.&nbsp;</p>\n\n<ul>\n\t<li>\n\t<p>&nbsp;Note: If you want your party to remain private to only you or you and your friends, make sure to select the “No Fill” option when you’re in the mode select screen.&nbsp;</p>\n\t</li>\n</ul>\n\n<p><br />\nThe fun never stops in Party Royale, so follow Fortnite’s official social pages or check the Fortnite site for any upcoming events!<br />\n<br />\nNeed help with Fortnite or your Epic Games account? Check this <a href=\"https://www.epicgames.com/fortnite/help-center\" target=\"_blank\">Fortnite support link</a> and let us help you out.</p>\n","trendingImage":"https://cdn2.unrealengine.com/en-12pr-premiere-news-1900x600-v3-1900x600-036384074.jpg","subtitle":"","sticky":false,"short":"<p>Looking to attend a Party Royale event at the Main Stage? Find out how to jump into Party Royale, locate the Main Stage, and join with friends!</p>\n","featured":false,"date":"2020-09-21T05:00:00.000Z","link":"f474a25f-7548-4195-a097-907977ac659a","_id":"f474a25f-7548-4195-a097-907977ac659a","pageMapping":"f474a25f-7548-4195-a097-907977ac659a","slug":"your-first-drop-into-party-royale-getting-to-the-main-stage","urlPattern":"/blog/your-first-drop-into-party-royale-getting-to-the-main-stage","locale":"en-US","noIndex":false,"_script":"undefined","category":[],"tags":[],"_metaTags":"<!-- Basic data for search engine -->\n<meta name=\"description\" content=\"Looking to attend a Party Royale event at the Main Stage? Find out how to jump into Party Royale, locate the Main Stage, and join with friends!\">\n<meta name=\"keyword\" content=\"Add keyword here\">\n\n<!-- Open Graph data for Facebook -->\n<meta property=\"og:type\" content=\"article\">\n<meta property=\"og:title\" content=\"A Fortnite Party Royale Beginner’s Guide: Getting to the Main Stage\">\n<meta property=\"og:description\" content=\"Check out this guide about Fortnite Party Royale. We will help you locate the Main Stage and how to add friends so you can enjoy events together.\">\n<meta property=\"og:image\" content=\"https://www.epicgames.com/fortnite/image.jpg\">\n<meta property=\"og:url\" content=\"https://www.epicgames.com/fortnite/\">\n\n\n<!-- Twitter Card data -->\n<meta name=\"twitter:card\" content=\"summary\">\n<meta name=\"twitter:title\" content=\"A Fortnite Party Royale Beginner’s Guide: Getting to the Main Stage\">\n<meta name=\"twitter:description\" content=\"Check out this guide about Fortnite Party Royale. We will help you locate the Main Stage and how to add friends so you can enjoy events together.\">\n<meta name=\"twitter:image\" content=\"https://www.epicgames.com/fortnite/image.jpg\">","shareDescription":"Looking to attend a Party Royale event at the Main Stage? Find out how to jump into Party Royale, locate the Main Stage, and join with friends!","catLocaleMap":{},"nextSlug":"slushii-spotlight-series-content-creator-guide","prevSlug":"anderson-paak-spotlight-series-content-creator-guide"},{"trending":false,"noTopImage":false,"gridTitle":"","image":"https://cdn2.unrealengine.com/14pr-andersonpaak-newsthumb-576x576-044227878.jpg","contentTypeSticky":false,"author":"The Fortnite Team","enableLightbox":false,"_type":"Common Post","shareImage":"https://cdn2.unrealengine.com/anderson-paak-fortnite-party-royale-spotlight-1920x1080-044218944.jpg","title":"Anderson .Paak Spotlight Series Content Creator Guide","content":"<p>Ahead of this Saturday’s Spotlight live concert featuring <a href=\"https://www.epicgames.com/fortnite/news/fortnite-presents-spotlight-featuring-anderson-paak\" target=\"_blank\">Anderson Paak</a>, we’ve put together some tips for our content creators to ensure the best possible experience while sharing the event with your communities.</p>\n\n<ul>\n\t<li>You can stream and share on YouTube from Sept 19th - Sept 25th without copyright claims or demonetization on Spotlight concert series content. After the seven day window has passed your video will be demonetized, but no strikes or takedowns should be issued.&nbsp;\n\t<ul>\n\t\t<li>If you receive a Copyright Claim prior to September 25 on these videos, please appeal the claim directly with the rights holders.&nbsp;&nbsp;</li>\n\t</ul>\n\t</li>\n\t<li>We’ve worked with our partners to ensure that creators in our Support-a-Creator program can share the show with their communities.&nbsp;\n\t<ul>\n\t\t<li><strong>IMPORTANT: </strong>You need to have a valid YouTube channel linked to your Support-a-Creator account prior to the concert start on September 19th, 5 PM EDT.&nbsp;</li>\n\t\t<li>If you would like to add a YouTube channel to your existing Support-a-Creator account, please submit a ticket to Player Support (<a href=\"https://www.epicgames.com/help/supportacreator-c83/trending-topics-c146/how-do-i-link-my-youtube-channel-to-my-epic-games-supportacreator-account-a6967\" target=\"_blank\">here</a>).&nbsp;\n\t\t<ul>\n\t\t\t<li>We aren’t able to add new creators to the Support-a-Creator right now. Keep an eye on the website and Fortnite social for updates on that application re-opening.&nbsp;</li>\n\t\t</ul>\n\t\t</li>\n\t</ul>\n\t</li>\n</ul>\n\n<ul>\n\t<li>Don’t forget to promote your Creator Code, so your fans can support you when they make a purchase!</li>\n\t<li>Review the <a href=\"https://www.epicgames.com/site/en-US/content-guidelines\">Fortnite Content Guidelines</a>.</li>\n\t<li>Check the <a href=\"https://www.epicgames.com/fortnite/en-US/partyroyale\">Party Royale schedule</a> and plan on getting in early!&nbsp;</li>\n</ul>\n","trendingImage":"https://cdn2.unrealengine.com/en-4pr-andersonpaak-newsheader-1900x600-1900x600-044217524.jpg","sticky":false,"short":"<p>Learn about the Anderson .Paak content creator guidelines for his upcoming Spotlight Series performance in Fortnite Party Royale so you can provide the best experience for your audience.</p>\n","featured":false,"date":"2020-09-18T15:00:00.000Z","link":"3748c125-f4e1-4946-a5c5-7d276fa484f1","_id":"3748c125-f4e1-4946-a5c5-7d276fa484f1","pageMapping":"3748c125-f4e1-4946-a5c5-7d276fa484f1","slug":"anderson-paak-spotlight-series-content-creator-guide","urlPattern":"/blog/anderson-paak-spotlight-series-content-creator-guide","locale":"en-US","noIndex":false,"_script":"undefined","category":[],"tags":[],"_metaTags":"<!-- Basic data for search engine -->\n<meta name=\"description\" content=\"Learn about the Anderson .Paak content creator guidelines for his upcoming Spotlight Series performance in Fortnite Party Royale\">\n<meta name=\"keyword\" content=\"Add keyword here\">","shareDescription":"Learn about the Anderson .Paak content creator guidelines for his upcoming Spotlight Series performance in Fortnite Party Royale so you can provide the best experience for your audience.","catLocaleMap":{},"nextSlug":"your-first-drop-into-party-royale-getting-to-the-main-stage","prevSlug":"a-new-light-fortnite-pc-now-supports-ray-tracing"},{"trending":false,"noTopImage":false,"gridTitle":"Fortnite Now Supports Ray Tracing for PC!","image":"https://cdn2.unrealengine.com/14br-nvidiaraytracing-newsthumb-576x576-021303638.jpg","contentTypeSticky":false,"author":"The Fortnite Team","enableLightbox":false,"_type":"Common Post","shareImage":"https://cdn2.unrealengine.com/14br-nvidiaraytracing-newsheader-1920x1080-021303843.jpg","title":"A New Light: Fortnite PC Now Supports Ray Tracing","content":"<p>Get ready to see Fortnite in a new light. Beginning today, PC players using supported NVIDIA GPU cards and DirectX12 can enable ray tracing and NVIDIA DLSS!<br />\n&nbsp;</p>\n\n<p style=\"text-align:center\"><iframe allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/Qn6yS38l8Tg\" width=\"560\"></iframe></p>\n\n<h2><br />\nWhat is ray tracing?</h2>\n\n<p>The advanced rendering capability of ray tracing allows new visual and lighting effects previously not possible in Fortnite. With our latest update, we’re delivering improved ambient occlusion, shadows, reflections, and real-time global illumination.&nbsp;<br />\n<br />\nHow’s it look? The side-by-side screenshots below show how supporting PCs can create lifelike reflections and shadows when ray tracing is enabled. Nvidia has also pulled together a ray-traced map in Creative to show off the new tech. Use this Island code to check it out: 9189-0518-5408.</p>\n\n<div class=\"container\" style=\"display:inline\">\n<div class=\"row\">\n<div class=\"col-sm-6\">\n<p style=\"text-align:center\"><img alt=\"Ray Tracing For Fortnite PC\" src=\"https://cdn2.unrealengine.com/ray-tracing-for-fortnite-pc-1920x1080-021085496.png\" /></p>\n</div>\n\n<div class=\"col-sm-6\">\n<p style=\"text-align:center\"><img alt=\"Screenshot PC\" src=\"https://cdn2.unrealengine.com/screenshot-pc-1920x1080-021085199.png\" /></p>\n</div>\n</div>\n\n<div style=\"text-align:center\"><em>See the difference enabling ray tracing has on your game experience.</em><br />\n&nbsp;</div>\n\n<h2><br />\nNVIDIA DLSS and Reflex Mode in Fortnite</h2>\n\n<p>In addition to ray tracing, NVIDIA DLSS DLSS boosts performance so you can enjoy ray tracing at higher frame rates. Fortnite features three DLSS options: Quality, Balanced, and Performance. These options control the DLSS rendering resolution, allowing you to choose the right balance between image quality and FPS.&nbsp;</p>\n\n<p>Meanwhile, NVIDIA Reflex delivers the lowest latency in Fortnite. By integrating directly in Fortnite, Reflex Low Latency Mode aligns game engine work to complete just-in-time for rendering, eliminating the GPU render queue and reducing CPU back pressure in GPU intensive scenes.&nbsp;</p>\n\n<p>Learn more about the <a href=\"https://www.nvidia.com/en-us/geforce/news/fortnite-rtx-on-ray-tracing-nvidia-dlss-reflex/\">enhancements to Fortnite</a> in Nvidia’s blog.<br />\n<br />\n<img alt=\"14BR NVidiaRayTracing Social 4\" src=\"https://cdn2.unrealengine.com/14br-nvidiaraytracing-social-4-1920x1080-021447207.jpg\" style=\"height:auto; width:auto\" /></p>\n\n<h2><br />\n<br />\nFortnite PC - Ray Tracing System Requirements</h2>\n\n<div>\n<p>For your PC to showcase ray tracing in Fortnite, make sure your system meets our minimum system requirements. We have also included recommended system requirements.<br />\n&nbsp;</p>\n\n<h3 style=\"margin-left:40px\"><strong>Minimum System Requirements</strong></h3>\n\n<p style=\"margin-left:40px\">Requires DirectX 12&nbsp;<br />\nCPU: 4 cores or more<br />\nGPU: NVIDIA GeForce RTX 2060 or higher (use updated drivers; 450.00 and higher are supported)<br />\nWindows 10 version 1903 (May 2019 Update, build number 18362 or newer)</p>\n\n<h3 style=\"margin-left:40px\"><strong>Recommended System Requirements</strong></h3>\n\n<p style=\"margin-left:40px\">Requires DirectX 12&nbsp;<br />\nCPU: 8 cores or more<br />\nGPU: NVIDIA GeForce RTX 2080 or higher (use updated drivers; 450.00 and higher are supported)<br />\nWindows 10 version 1903 (May 2019 Update, build number 18362 or newer)<br />\n&nbsp;</p>\n\n<h2>Turning on Ray Tracing for Fortnite</h2>\n\n<p>If your rig can handle ray tracing, open your game settings and take the following steps:</p>\n\n<ol>\n\t<li>Install the <a href=\"https://www.microsoft.com/en-us/software-download/windows10\">Windows 10 May 2020 (or later) update</a>.</li>\n\t<li>Install the <a href=\"https://www.nvidia.com/en-gb/geforce/drivers/\" target=\"_blank\">v455 Driver</a>.</li>\n\t<li>Open Settings menu (Esc &gt; Settings):</li>\n\t<li>Scroll down to Advanced Settings and change the DirectX Version to DirectX 12:</li>\n\t<li>DLSS is found at the bottom of Advanced Settings and has three modes: Quality, Balanced, and Performance.</li>\n\t<li>Enable the Ray Tracing option and any or all of the available ray tracing effects:</li>\n</ol>\n\n<p style=\"text-align:center\"><img alt=\"Turn On Ray Tracing For Fortnite Pc\" src=\"https://cdn2.unrealengine.com/turn-on-ray-tracing-for-fortnite-pc-725x273-028161649.PNG\" style=\"height:auto; width:auto\" /></p>\n\n<p style=\"text-align:center\"><em>PC Players running DX 12 can experiment with multiple settings adjustments for ray tracing.</em></p>\n\n<p><br />\nFire up the game and try it out!<br />\n<br />\n<img alt=\"14BR NVidiaRayTracing Social 3\" src=\"https://cdn2.unrealengine.com/14br-nvidiaraytracing-social-3-1920x1080-021452063.jpg\" /></p>\n</div>\n</div>\n","trendingImage":"https://cdn2.unrealengine.com/14br-nvidiaraytracing-newsheader-1920x1080-021303843.jpg","sticky":false,"short":"<span style=\"font-size:11pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:Arial\"><span style=\"color:#000000\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">PC players running DirectX12 can unlock the power of ray tracing in Fortnite. See the game in a new light with improved ambient occlusion, shadows, reflections, and real-time global illumination.</span></span></span></span></span></span>","featured":false,"date":"2020-09-17T12:00:00.000Z","link":"ba271828-89d0-4fac-830b-7444ac4a05a7","_id":"ba271828-89d0-4fac-830b-7444ac4a05a7","pageMapping":"ba271828-89d0-4fac-830b-7444ac4a05a7","slug":"a-new-light-fortnite-pc-now-supports-ray-tracing","urlPattern":"/blog/a-new-light-fortnite-pc-now-supports-ray-tracing","locale":"en-US","noIndex":false,"_script":"undefined","category":[],"tags":[],"_metaTags":"<!-- Basic data for search engine -->\n<meta name=\"description\" content=\"PC players with GeForce RTX and DirectX12 can unlock the power of ray tracing and DLSS in Fortnite. Improved reflections, shadows, and more.\">\n<meta name=\"keyword\" content=\"Add keyword here\">\n\n<!-- Twitter Card data -->\n<meta name=\"twitter:card\" content=\"summary\">\n<meta name=\"twitter:title\" content=\" Fortnite Now Supports Ray Tracing for the PC!\">\n<meta name=\"twitter:description\" content=\"PC players with GeForce RTX and DirectX12 can unlock the power of ray tracing and DLSS in Fortnite. Improved reflections, shadows, and more.\">\n<meta name=\"twitter:image\" content=\"https://www.epicgames.com/fortnite/image.jpg\">","shareDescription":"PC players running DirectX12 can unlock the power of ray tracing in Fortnite. See the game in a new light with improved ambient occlusion, shadows, reflections, and real-time global illumination.","catLocaleMap":{},"nextSlug":"anderson-paak-spotlight-series-content-creator-guide","prevSlug":"apple-ends-epics-ability-to-offer-fortnite-save-the-world-on-mac"},{"trending":false,"noTopImage":false,"gridTitle":"","image":"https://cdn2.unrealengine.com/10stw-evergreens-white-newsthumbnail-576x576-035624313.jpg","contentTypeSticky":false,"author":"The Fortnite Team","enableLightbox":false,"_type":"Common Post","shareImage":"https://cdn2.unrealengine.com/13br-freefortnite-motd-1920x1080-1920x1080-035736729.jpg","title":"Apple Ending Fortnite Save the World Updates for Mac","content":"<p>Apple is preventing Epic from signing games and patches for distribution on Mac, which ends our ability to develop and offer Fortnite: Save the World for the platform. Specifically, our upcoming v14.20 release will cause bugs for players on v13.40, resulting in a very poor experience. Since we are no longer able to sign updates and release fixes for these issues, beginning September 23, 2020, Fortnite: Save the World will no longer be playable on macOS.<br />\n<br />\nWe are issuing a refund for all players who purchased any Save the World Founder’s or Starter Packs (including Upgrades) and played Save the World on macOS between September 17, 2019 and September 17, 2020. Additionally, any purchased V-Bucks spent on Llamas on macOS in this period will also be refunded. As of today, September 17, 2020, Save the World Starter Packs will no longer be available for purchase on macOS.<br />\n<br />\n<strong>Please note:</strong> It may take up until October 2, 2020 to receive the refund in your bank account.&nbsp;<br />\n<br />\nThere’s no action needed on your part to receive the refund and you will retain any previously purchased V-Bucks and items on your account. Players will still be able to play Save the World on PC, PlayStation and Xbox, and thanks to cross-progression, your Heroes, Schematics and everything else in your Homebase will automatically transfer across supported platforms.&nbsp;<br />\n<br />\nFortnite: Battle Royale remains playable for Mac users at this time on the v13.40 build, but is no longer receiving version updates due to Apple’s actions. The latest version of Fortnite: Battle Royale is available on PlayStation 4, Xbox One, Nintendo Switch, PC, GeForce Now, and on Android through both the Epic Games App at <a href=\"https://www.epicgames.com/fortnite/mobile/android/get-started\">epicgames.com</a> and the <a href=\"https://apps.samsung.com/appquery/appDetail.as?appId=com.epicgames.portal\">Samsung Galaxy Store</a>.&nbsp;<br />\n<br />\nFor more details on Apple’s decision to block Fortnite, read our <a href=\"https://www.epicgames.com/fortnite/en-US/news/freefortnite\">#FreeFortnite</a> blog post and <a href=\"https://www.epicgames.com/site/en-US/free-fortnite-faq\">#FreeFortnite FAQ</a>.</p>\n","trendingImage":"https://cdn2.unrealengine.com/13br-freefortnite-newsheader-1900x600-v3-1900x600-035619437.jpg","sticky":false,"short":"<p>Please read what Fortnite is doing for Save the World Mac players. Some will qualify for automatic refunds and how you can still play on other platforms.</p>\n","featured":false,"date":"2020-09-17T04:00:00.000Z","link":"02b1e77b-dd4a-448f-bd2f-f8d9fbef79c7","_id":"02b1e77b-dd4a-448f-bd2f-f8d9fbef79c7","pageMapping":"02b1e77b-dd4a-448f-bd2f-f8d9fbef79c7","slug":"apple-ends-epics-ability-to-offer-fortnite-save-the-world-on-mac","urlPattern":"/blog/apple-ends-epics-ability-to-offer-fortnite-save-the-world-on-mac","locale":"en-US","noIndex":false,"_script":"undefined","category":[],"tags":[],"_metaTags":"<!-- Basic data for search engine -->\n<meta name=\"description\" content=\"Apple is preventing further Fortnite Save the World updates for Mac. Learn about the automatic refund for some Mac players and how you can keep playing.\">\n<meta name=\"keyword\" content=\"Add keyword here\">\n\n<!-- Twitter Card data -->\n<meta name=\"twitter:card\" content=\"summary\">\n<meta name=\"twitter:title\" content=\"Apple Ending Fortnite Save the World Updates for Mac\">\n<meta name=\"twitter:description\" content=\"Please read what Fortnite is doing for Save the World Mac players. Some will qualify for automatic refunds and how you can still play on other platforms.\">\n<meta name=\"twitter:image\" content=\"https://www.epicgames.com/fortnite/en-US/news/apple-ends-epics-ability-to-offer-fortnite-save-the-world-on-mac\">","shareDescription":"Please read what Fortnite is doing for Save the World Mac players. Some will qualify for automatic refunds and how you can still play on other platforms.","catLocaleMap":{},"nextSlug":"a-new-light-fortnite-pc-now-supports-ray-tracing","prevSlug":"fortnite-presents-spotlight-featuring-anderson-paak"},{"trending":false,"noTopImage":false,"gridTitle":"Fortnite Presents: Spotlight featuring Anderson .Paak","image":"https://cdn2.unrealengine.com/14pr-andersonpaak-newsthumb-576x576-004917563.jpg","contentTypeSticky":false,"author":"The Fortnite Team","enableLightbox":false,"_type":"Common Post","shareImage":"https://cdn2.unrealengine.com/anderson-paak-fortnite-party-royale-spotlight-1920x1080-004870817.jpg","title":"Spotlight Returns with Multi-Grammy winner Anderson .Paak!","content":"<p>The Spotlight concert series, straight from our studio in Los Angeles, CA, continues with our second live performance. Head to Party Royale’s Main Stage this weekend to catch the series’ next artist...</p>\n\n<p style=\"text-align:center\"><img alt=\"Anderson Paak Fortnite Party Royale Spotlight\" src=\"https://cdn2.unrealengine.com/anderson-paak-fortnite-party-royale-spotlight-1920x1080-004870817.jpg\" style=\"height:auto; width:auto\" /></p>\n\n<h2><br />\nAct 2: Anderson .Paak</h2>\n\n<p>Heating up the stage, please welcome multi-talented artist Anderson .Paak! First hitting the scene in 2014, .Paak has won multiple Grammy Awards, including the 2019 “Best Rap Performance” for “Bubblin,\"&nbsp;as well as “Best R&amp;B Album” this year for his hit album, <em>Ventura</em>.<br />\n<br />\nPaak will be broadcast live in-game from the Party Royale Spotlight soundstage in Los Angeles, on Saturday, September 19.<br />\n&nbsp;</p>\n\n<h2>Showtimes</h2>\n\n<p>Here’s a full look at showtimes:</p>\n\n<ul>\n\t<li>Anderson .Paak Premiere - Saturday, September 19 @ 5PM ET</li>\n\t<li>Encore 1 - Saturday, September 19 @11PM ET</li>\n\t<li>Encore 2 - Sunday, September 20 @ 1PM ET</li>\n</ul>\n&nbsp;\n\n<h2>Future of Live Music</h2>\n\n<p>The Spotlight concert series is just getting started! Be on the lookout for the announcement on the next artists performing live from Los Angeles, and go ahead and mark your calendar for September 26. The party continues this October as well!&nbsp;<br />\n<br />\nDue to the current world circumstances concerts are tricky and have left us missing that live show experience, especially the social connection of good music with good friends. We hope the Spotlight concert series and Party Royale represent the future of how we can share entertaining experiences with our closest friends. Stop by, check it out and bring someone new next time!</p>\n&nbsp;\n\n<h2>How to Jump Into Party Royale</h2>\n\n<p>Follow the steps below to get into Party Royale and watch a show at the Main Stage.</p>\n\n<ul>\n\t<li>From the Lobby screen, press the “Change” box located in the bottom-right corner.</li>\n\t<li>Modes will appear on-screen. Select the “Party Royale” mode tile then press “Accept.\"</li>\n\t<li>After pressing “Accept,\" you’ll return to the Lobby screen. Just press “Play” to start!&nbsp;</li>\n\t<li>Head to the Main Stage and wait for the event to start. Use the map button while in Party Royale to see where you are and the location of the Main Stage.</li>\n</ul>\n\n<h2><img alt=\"Fortnite Party Royale Main Stage Spotlight\" src=\"https://lh4.googleusercontent.com/A0c1UL6x8X5xbgP8ZoJF3scjWOMx_3RbHC6rdlmJX1JvIq59mQWgn4BS7VYAnDR6yEMtzwf3ClXyVKJuR2loPILWYGrHnQzreRF-HPEItzXaE2_6Y5-I7QIip03yv_ybCdiStnJO\" /></h2>\n<br />\n<strong>New to Fortnite? </strong><a href=\"https://www.epicgames.com/fortnite/en-US/download\">Download Fortnite for free.</a> Fortnite Party Royale is available on Android, PlayStation 4, Xbox One, Nintendo Switch, and PC.<br />\n<br />\n<strong>Note for Content Creators:</strong> This Party Royale event features licensed content. Read our <u><a href=\"https://www.epicgames.com/fortnite/news/anderson-paak-spotlight-series-content-creator-guide\" target=\"_blank\">Content Creator Guide</a></u> and refer to your channel’s platform policies for tips on how to avoid copyright strikes.<br />\n<br />\n<em>#FreeFortnite - iOS and macOS devices will not be supporting this event due to Apple blocking Fortnite updates on Apple devices. The Spotlight concert series will not be viewable on the v13.40 release of Fortnite.&nbsp;</em>","trendingImage":"https://cdn2.unrealengine.com/en-4pr-andersonpaak-newsheader-1900x600-1900x600-004870426.jpg","subtitle":"","sticky":false,"short":"<p><span style=\"font-size:11pt; font-variant:normal; white-space:pre-wrap\"><span style=\"font-family:Arial\"><span style=\"color:#000000\"><span style=\"font-weight:400\"><span style=\"font-style:normal\"><span style=\"text-decoration:none\">Grammy award winner Anderson .Paak is the next act of Party Royale’s Spotlight series. .Paak is set to perform on September 19, 2020 at 5PM EDT.</span></span></span></span></span></span></p>\n","featured":false,"date":"2020-09-15T13:45:00.000Z","link":"90a1903a-9251-4c45-92cf-6f0ed017a2a2","_id":"90a1903a-9251-4c45-92cf-6f0ed017a2a2","pageMapping":"90a1903a-9251-4c45-92cf-6f0ed017a2a2","slug":"fortnite-presents-spotlight-featuring-anderson-paak","urlPattern":"/blog/fortnite-presents-spotlight-featuring-anderson-paak","locale":"en-US","noIndex":false,"_script":"undefined","category":[],"tags":[],"_metaTags":"<!-- Basic data for search engine -->\n<meta name=\"description\" content=\"Fortnite Party Royale’s Spotlight series returns with renowned artist  Anderson .Paak on September 19, 2020.\">\n<meta name=\"keyword\" content=\"Add keyword here\">\n\n","shareDescription":"Grammy award winner Anderson .Paak is the next act of Party Royale’s Spotlight series. .Paak is set to perform on September 19, 2020 at 5PM EDT.","catLocaleMap":{},"nextSlug":"apple-ends-epics-ability-to-offer-fortnite-save-the-world-on-mac","prevSlug":"the-nexus-war-heats-up-with-the-stark-industries-update"},{"trending":false,"noTopImage":false,"gridTitle":"The Stark Industries Update","image":"https://cdn2.unrealengine.com/14br-starkindustries-poi-newsthumb-576x576-967433897.jpg","contentTypeSticky":false,"author":"The Fortnite Team","enableLightbox":false,"_type":"Common Post","shareImage":"https://cdn2.unrealengine.com/14br-starkindustries-poi-social-1920x1080-967433325.jpg","title":"The Nexus War Heats Up with the Stark Industries Update","content":"<p>Inventor Tony Stark applies his genius for high-tech solutions to problems as Iron Man, the armored Avenger. Welcome to Stark Industries.<br />\n<br />\nIn v14.10, the Stark Industries Update, the famous facility emerges from the Rift between worlds onto the Island — along with more super powers, a hazardous new weapon, and a special mode to show your might.&nbsp;</p>\n\n<div class=\"embed-responsive embed-responsive-16by9\"><iframe allowfullscreen=\"true\" class=\"embed-responsive-item\" frameborder=\"0\" src=\"https://www.youtube.com/embed/YDFG9DEPy6Y\" width=\"100%\"></iframe></div>\n\n<h2><br />\nExplore Stark Industries</h2>\n\n<p>Genius. Billionaire. Philanthropist. Tony Stark’s confidence is only matched by his technology and business savvy.&nbsp;<br />\n<br />\nThe center of much super activity, the high-tech Stark Industries is now on the map. Explore this esteemed complex to gather loot and maybe even meet a Hero (or Villain)…<br />\n<br />\n<img alt=\"14BR StarkIndustries POI Social\" src=\"https://cdn2.unrealengine.com/14br-starkindustries-poi-social-1920x1080-967433325.jpg\" style=\"height:auto; width:auto\" /></p>\n\n<h2><br />\nUnleash More Hero Powers</h2>\n\n<p>The Stark Industries Update assembles even more powers to add to your arsenal. Summon a blow to your targeted location with Thor’s Mjolnir Strike, fire energy blasts and boost into the sky with Iron Man’s Repulsor Gauntlets, and more.<br />\n<br />\n<img alt=\"14BR HeroAbilitiesBlogAsset\" src=\"https://cdn2.unrealengine.com/14br-heroabilitiesblogasset-1920x1080-915690958.jpg\" style=\"height:auto; width:auto\" /></p>\n\n<h2><br />\nThe Forces of Galactus Descend</h2>\n\n<p>Drawing nearer to the Island, Galactus now has his own enemy Drones roaming the battlefield. These Gatherer Drones are designed for collecting loot, but they’re also loot themselves: upon defeat, they’ll deactivate and turn into their weapon form. Deactivated Gatherers are highly unstable, so they’ll explode if you don’t pick them up quickly!</p>\n\n<h2><br />\nEnter the Knockout</h2>\n\n<p>The Nexus War intensifies in the Stark Industries Update, introducing a new mode to showcase your abilities. Join other players in the upcoming Marvel Knockout, a spin on Operation: Knockout that sees your team utilize super powers to be the best team on the tournament bracket.&nbsp;<br />\n<br />\n<img alt=\"Fortnite Marvel Knockout Mode\" src=\"https://cdn2.unrealengine.com/fortnite-marvel-knockout-mode-1920x1080-969847538.jpg\" style=\"height:auto; width:auto\" /><br />\n<br />\nThe fight to save Reality carries on: for more news on the Fortnite Nexus War, stay tuned to our social channels or <a href=\"https://www.epicgames.com/fortnite/home\">Fortnite.com</a>.</p>\n","trendingImage":"https://cdn2.unrealengine.com/14br-starkindustries-poi-newsheader-1900x600-967431973.jpg","subtitle":"","sticky":false,"short":"<p>The Fortnite Marvel Nexus War heats up with the Stark Industries Update. This update brings a new mode, weapon, and super-powers!</p>\n","featured":false,"date":"2020-09-10T16:00:00.000Z","link":"d6b24d54-a7b6-41e0-9e4b-1c94a03d6835","_id":"d6b24d54-a7b6-41e0-9e4b-1c94a03d6835","pageMapping":"d6b24d54-a7b6-41e0-9e4b-1c94a03d6835","slug":"the-nexus-war-heats-up-with-the-stark-industries-update","urlPattern":"/blog/the-nexus-war-heats-up-with-the-stark-industries-update","locale":"en-US","noIndex":false,"_script":"undefined","category":[],"tags":[],"_metaTags":"<!-- Basic data for search engine -->\n<meta name=\"description\" content=\"The Fortnite Marvel Nexus War heats up with the Stark Industries Update. This update brings a new mode, weapon, and super powers!\">\n<meta name=\"keyword\" content=\"Add keyword here\">\n\n<!-- Open Graph data for Facebook -->\n<meta property=\"og:type\" content=\"article\">\n<meta property=\"og:title\" content=\" Iron Man’s Stark Industries Arrives in Fortnite for the Nexus War\">\n<meta property=\"og:description\" content=\"Stark Industries lands in Fortnite in the latest Nexus War update. Enjoy a special game mode, a new weapon, and Super Hero powers! Read more for details.\">\n\n\n<!-- Twitter Card data -->\n<meta name=\"twitter:card\" content=\"summary\">\n<meta name=\"twitter:title\" content=\"Iron Man’s Stark Industries Arrives in Fortnite for the Nexus War\">\n<meta name=\"twitter:description\" content=\"Stark Industries lands in Fortnite in the latest Nexus War update. Enjoy a special game mode, a new weapon, and Super Hero powers! Read more for details.\">","shareDescription":"The Fortnite Marvel Nexus War heats up with the Stark Industries Update. This update brings a new mode, weapon, and super-powers!","catLocaleMap":{},"nextSlug":"fortnite-presents-spotlight-featuring-anderson-paak","prevSlug":"fortnite-item-shop-design-test"},{"trending":false,"noTopImage":false,"gridTitle":"Item Shop Design Test","image":"https://cdn2.unrealengine.com/11br-evergreens-lime-newsthumbnail-576x576-969782477.jpg","contentTypeSticky":false,"author":"The Fortnite Team","enableLightbox":false,"_type":"Common Post","shareImage":"https://cdn2.unrealengine.com/11br-evergreens-lime-newsheader-1920x1080-969782726.jpg","title":"Fortnite Item Shop Design Test","content":"<p>Starting today, we're testing a new look for the Item Shop. During this test, some players may see a new design for the Item Shop. The items and prices of the Item Shop are exactly the same for everyone no matter which design you see — it’s only the display that is different!<br />\n<br />\n<img alt=\"Fortnite Item Shop Test\" src=\"https://cdn2.unrealengine.com/fortnite-item-shop-test-2560x1440-974064779.png\" style=\"height:auto; width:auto\" /><br />\n<br />\nCurrently, the test is only running on PC, PlayStation, and Xbox. The test may expand to other platforms in the future.<br />\n<br />\nWhile we run this test, the options to go directly to the Item Shop or Locker from the end of a match will be disabled for all players temporarily.</p>\n","trendingImage":"https://cdn2.unrealengine.com/11br-evergreens-lime-newsheader-1920x1080-969782726.jpg","sticky":false,"short":"<p>Fortnite is testing a new look for the Item Shop. As part of this test, some players may see a new design for the Item Shop.&nbsp;</p>\n","featured":false,"date":"2020-09-10T14:00:00.000Z","link":"4f009367-e9cf-4640-8c58-0cfdf84ce24d","_id":"4f009367-e9cf-4640-8c58-0cfdf84ce24d","pageMapping":"4f009367-e9cf-4640-8c58-0cfdf84ce24d","slug":"fortnite-item-shop-design-test","urlPattern":"/blog/fortnite-item-shop-design-test","locale":"en-US","noIndex":false,"_script":"undefined","category":[],"tags":[],"_metaTags":"<!-- Basic data for search engine -->\n<meta name=\"description\" content=\"Fortnite is testing a new look for the Item Shop. As part of this test, some players may see a new design for the Item Shop. \">\n<meta name=\"keyword\" content=\"Add keyword here\">","shareDescription":"Fortnite is testing a new look for the Item Shop. As part of this test, some players may see a new design for the Item Shop.","catLocaleMap":{},"nextSlug":"the-nexus-war-heats-up-with-the-stark-industries-update","prevSlug":"bug-fixes-in-fortnite-creative-v14-10"},{"trending":false,"noTopImage":false,"image":"https://cdn2.unrealengine.com/Fortnite%2Fblog%2Fwhat-s-new-in-creative---v11-30%2F11CM_DevUpdate_NewsThumbnail-%281%29-576x576-c7a632434c4f2663e9be7284d0c41848d219e9bd.jpg","contentTypeSticky":false,"author":"The Fortnite Team","enableLightbox":false,"_type":"Common Post","shareImage":"https://cdn2.unrealengine.com/Fortnite%2Fblog%2Fwhat-s-new-in-creative---v11-30%2F11CM_DevUpdate_NewsHeader-1920x1080-3f04eb2a3aed82b39ad607ab8f382c1f194f311d.jpg","title":"Bug Fixes In Fortnite Creative - v14.10","content":"<h2>Gameplay Bug Fixes</h2>\n\n<ul>\n\t<li>Fixed an issue where Mutator Zone settings still applied after being teleported by a Class Selector.</li>\n\t<li>Fixed an issue where all players could appear at the same spawner when entering matchmaking.</li>\n\t<li>Fixed an issue that caused players not to rotate teams when both teams had a Max Init Players value.</li>\n\t<li>Fixed an issue where some UI elements could become unselectable with a controller while playing on PC.</li>\n\t<li>Fixed an issue where entering fly mode could propel the player vertically without any other input.</li>\n</ul>\n\n<h2>Weapons and Items Bug Fixes</h2>\n\n<ul>\n\t<li>Shotgun and Missile Launcher button labels are no longer swapped on the Mech.</li>\n\t<li>FIxed an issue where players could not emote in the Mech.</li>\n</ul>\n\n<h2>Creative Tools and Phone Bug Fixes</h2>\n\n<ul>\n\t<li>Fixed an issue with long item names being cut off in multiple UI elements.</li>\n\t<li>Applied additional fixes for props not maintaining rotation when copied.</li>\n\t<li>Fixed an issue where multi-selecting grid-based objects and scaled objects reverted scaling changes.</li>\n</ul>\n\n<h2>Prefabs and Galleries Bug Fixes</h2>\n\n<ul>\n\t<li>Fixed an issue with multiple Fortilla Wall Galleries containing indestructible floors and walls by adding destructible versions to the same galleries.</li>\n\t<li>Fixed an issue with a squealing gas pump in the Fortilla Prop Gallery.</li>\n\t<li>Fixed an issue with a white phantom hose on a gas pump in the Fortilla Prop Gallery.</li>\n</ul>\n\n<h2>Devices Bug Fixes</h2>\n\n<ul>\n\t<li>Clarified wording on Damage Volume customization settings.</li>\n</ul>\n","trendingImage":"https://cdn2.unrealengine.com/Fortnite%2Fblog%2Fwhat-s-new-in-creative---v11-30%2F11CM_DevUpdate_NewsHeader-1920x1080-3f04eb2a3aed82b39ad607ab8f382c1f194f311d.jpg","sticky":false,"short":"Find out all the bug fixes for Creative in v14.10","featured":false,"date":"2020-09-10T06:53:00.000Z","link":"c66ab35f-5275-4214-8014-253ccb946f83","_id":"c66ab35f-5275-4214-8014-253ccb946f83","pageMapping":"c66ab35f-5275-4214-8014-253ccb946f83","slug":"bug-fixes-in-fortnite-creative-v14-10","urlPattern":"/blog/bug-fixes-in-fortnite-creative-v14-10","locale":"en-US","noIndex":false,"_script":"undefined","category":[],"tags":[],"_metaTags":"<!-- Basic data for search engine -->\n<meta name=\"description\" content=\"Find out everything fixed in Fortnite Creative in v14.10! A series of bug fixes for better gameplay.\">\n<meta name=\"keyword\" content=\"Add keyword here\">","shareDescription":"Find out all the bug fixes for Creative in v14.10","catLocaleMap":{},"nextSlug":"fortnite-item-shop-design-test","prevSlug":"the-fortnite-mega-drop-permanent-discounts-up-to-20-percent"}],"categoryTotals":{"all":441},"topFeatured":null,"previewData":{},"hasMoreArticles":true,"initLoading":true,"loadingArticles":false,"requestedCategory":null,"isCategoryFilter":false,"loading":false,"threadLoading":true,"forumThreads":[],"error":false,"config":{"shareConfigs":[{"_type":"Common Share Config","type":"facebook"},{"_type":"Common Share Config","type":"twitter"},{"_type":"Common Share Config","type":"vk"},{"_type":"Common Share Config","type":"reddit"}],"useTitleCase":false,"shareOptions":{"twitter":false,"weibo":true,"vk":false,"facebook":false,"_type":"Share Options","wechat":true,"reddit":false,"tumblr":true,"google":true,"linkedin":true},"_type":"Common Config","hideAuthor":false,"hideCategoryLink":false},"loadingMore":false,"_metaTags":"<meta name=\"description\" content=\"Get the latest Fortnite news about updates, events, patch notes and more. Your best source of information about your favorite Battle Royale game.\">\n<meta property=\"og:description\" content=\"Read the latest Fortnite news and updates about your favorite Battle Royale game. Learn about upcoming events, special items and twists and turns we throw Fortnite may throw your way.\">\n<meta property=\"og:title\" content=\"Fortnite News – The Latest News & Articles\">\n<meta property=\"og:url\" content=\"https://www.epicgames.com/fortnite/en-US/news\">\n<meta property=\"og:image\" content=\"https://static-assets-prod.epicgames.com/fortnite/static/webpack/./8f9484f10eb14f85a189fb6117a57026.jpg\">\n<meta name=\"twitter:card\" content=\"summary\">\n<meta name=\"twitter:site\" content=\"@Fortnite\">\n<meta name=\"twitter:title\" content=\"Fortnite News – The Latest News & Articles\">\n<meta name=\"twitter:description\" content=\" Read the latest Fortnite news and updates about your favorite Battle Royale game. Learn about upcoming events, special items and twists and turns we throw Fortnite may throw your way.\">\n<meta name=\"twitter:image\" content=\"https://static-assets-prod.epicgames.com/fortnite/static/webpack/./8f9484f10eb14f85a189fb6117a57026.jpg\">","catLocaleMap":{}},"RedeemStore":{"currentStage":"VALIDATE","redeemComplete":false,"nextStage":"","redeemCode":"","title":"","description":"","isInvalidCode":null,"validationError":null,"requireEula":false,"redeemError":null,"loading":false,"entitlementName":[]},"InviteStore":{"currentStage":"INVITE","nextStage":"","currentInvites":0,"loading":false,"errorMsg":"","prevPath":""},"RedeemConfigStore":{"config":{}},"ForumSunsetStore":{"forumSunsetData":{"_title":"Forum Farewell","_noIndex":false,"content":"<p dir=\"ltr\">As of May 22, 2019, the Fortnite forums on the Epic Games website is no longer available. We’ve shifted our focus to other social channels to continue communicating with you. We’re astounded every single day by the passionate and growing community that supports Fornite.<br />\n<br />\nOur <a href=\"http://discord.gg/fortnite\" target=\"_blank\">official discord</a> and the community-run &amp; developer supported subreddits are excellent places to continue to drive discussion, share your thoughts, and link up with other players.<br />\n<br />\nFor support, please visit the <a href=\"https://www.epicgames.com/help/en-US/fortnite-c75\" target=\"_blank\">Fortnite Support Center</a>.<br />\n<br />\n<strong>Fortnite Subreddits:</strong><br />\n<a href=\"https://www.reddit.com/r/FortniteBR\" target=\"_blank\">Battle Royale</a><br />\n<a href=\"https://www.reddit.com/r/FORTnITE\" target=\"_blank\">Save The World</a><br />\n<a href=\"https://www.reddit.com/r/FortniteCreative\" target=\"_blank\">Creative</a><br />\n<a href=\"https://www.redd