/cdn2.unrealengine.com/Fortnite%2Fdarkfire%2Fguns-1822x1229-be9e884e0f2dada496b66e9dbfdab1c5033f13f2.png","https://cdn2.unrealengine.com/Fortnite%2Fdarkfire%2Fskins-1550x1307-fe5069f732456dbe5cb4080c9426d11d9e14f3c6.png","https://cdn2.unrealengine.com/Fortnite%2Fdarkfire%2Fbackblings_1809x1084_1572474988275-1809x1083-c21621b756b17a6dd23ab11f95381e04471fdd19.png"],"outitsNames":"Molten Omen Outfit, Dark Power Chord Outfit, Shadow Ark Outfit","wrapsImage":"https://cdn2.unrealengine.com/Fortnite%2Fdarkfire%2Fguns-1822x1229-be9e884e0f2dada496b66e9dbfdab1c5033f13f2.png","bundleTitle":"DARKFIRE BUNDLE INCLUDES","axexNames":"Molten Strikers Pickaxe, Shadow Strikers Pickaxe, Dark Strikers Pickaxe","axesImage":"https://cdn2.unrealengine.com/Fortnite%2Fdarkfire%2Faxes_1345x1050_1572477016273-1345x1049-041f83542e1d03e980f866c85fe648622669a503.png","meta":{"image":"https://cdn2.unrealengine.com/Fortnite%2Fdarkfire%2FMetaData_Sharing-%281%29-1920x1080-43df592a028897f7c30e0084812015a2f836ab5e.jpg","_type":"Epic Common Share Meta Data","description":"Get the Fortnite Darkfire Bundle and embrace your dark side with the Molten Omen, Dark Power Chord and Shadow Ark Outfits and more.","title":"Fortnite Darkfire Bundle"},"needHelpConfig":{"isCtaLinkExternal":true,"textOnly":false,"ctaString":"NEED HELP?","_type":"Fortnite - Common CTA Config","disabled":false,"ctaLink":"https://www.epicgames.com/help/en-US/fortnite-c75"},"emoteName":"Unification Emote","availableNow":"Available Now","outfitsTitle":"THREE OUTFITS","emoteTitle":"EMOTE","backBlingsTitle":"THREE BACK BLINGS","headerTitle":"DARKFIRE BUNDLE","_urlPattern":"/darkfire","_slug":"darkfire","_activeDate":"2019-10-24T07:28:57.627Z","lastModified":"2020-07-22T22:26:39.500Z","_locale":"en-US","_id":"fad6a549-0ad0-43aa-9268-815b8426a103","_templateName":"darkfire"}},"SkirmishStore":{"loading":false,"skirmish":null},"ParentalControlsStore":{"data":{"image":"https://cdn2.unrealengine.com/13br-parentalcontrols-newsheader-small-1920x600-467347481.jpg","_metaTags":"<!-- Open Graph data for Facebook -->\n<meta property=\"og:type\" content=\"Article\">\n<meta property=\"og:title\" content=\"Learn How to Set Fortnite Parental Controls\">\n<meta property=\"og:description\" content=\"Setting Fortnite parental controls is easier than ever with our parental controls Guide.\">\n<meta property=\"og:image\" content=\"https://www.epicgames.com/fortnite/image.jpg\">\n<meta property=\"og:url\" content=\"https://www.epicgames.com/fortnite/parental-controls\">\n\n<!-- Twitter Card data -->\n<meta name=\"twitter:card\" content=\"summary\">\n<meta name=\"twitter:title\" content=\" Learn How to Set Fortnite Parental Controls\">\n<meta name=\"twitter:description\" content=\"Setting Fortnite Parental Controls is easier than ever with our parental controls guide.\">\n<meta name=\"twitter:image\" content=\"https://www.epicgames.com/fortnite/image.jpg\">","_title":"Fortnite Parental Controls","Title":"Fortnite Parental Controls","metaImage":"https://cdn2.unrealengine.com/13br-parentalcontrols-newsheader-small-1920x600-467347481.jpg","_noIndex":false,"metaDescription":"Learn how to configure Fortnite parental controls. Our settings guide walks you through protecting your family member’s Fortnite experience easily.","_images_":["https://cdn2.unrealengine.com/13br-parentalcontrols-newsheader-small-1920x600-467347481.jpg"],"content":"<h1>Fortnite Parental Controls</h1>\n\n<h4><br />\n<strong><span style=\"font-family:Arial,Helvetica,sans-serif\"><a href=\"#Parental Controls Within Fortnite\" target=\"_self\">PARENTAL CONTROLS WITHIN FORTNITE</a><br />\n<br />\n<a href=\"#Parental Controls via Gaming Platform\" target=\"_self\">PARENTAL CONTROLS VIA GAMING PLATFORM</a> (INCLUDES PURCHASE CONTROLS)<br />\n<br />\n<a href=\"#Epic Games Store Parental Controls for Fortnite\" target=\"_self\">EPIC GAMES STORE PARENTAL CONTROLS FOR FORTNITE</a> (INCLUDES PURCHASE CONTROLS)</span></strong></h4>\n\n<p><br />\nFortnite offers a range of parental controls to help you manage what a player can see and do in&nbsp;Fortnite. In addition to the controls within Fortnite, you can make adjustments through the Epic Games Store as well as your preferred gaming platform, including PlayStation 4, Xbox One, Nintendo Switch, and mobile devices. The parental controls through the Epic Games Store and your preferred gaming platform include the option to restrict purchases.</p>\n\n<h2><br />\n<a id=\"Parental Controls Within Fortnite\" name=\"Parental Controls Within Fortnite\"></a>Parental Controls Within Fortnite</h2>\n\n<p><br />\n1. Launch Fortnite on your platform of choice.<br />\n<br />\n2. Once in the Lobby, open the menu in the upper-right of the screen.<br />\n<br />\n3.&nbsp;Select “Parental Controls.\"<br />\n<br />\n4. You will be asked to confirm the email address linked to the account.&nbsp;If no email address is linked to the account,&nbsp;you'll be guided to a web browser so that you may link one.</p>\n\n<p><br />\n5. Set a unique six-digit PIN. This PIN will be required to change parental controls in the future, so make sure to set a PIN that is different from other PINs that&nbsp;you use and is easy for you to remember.</p>\n\n<ul>\n\t<li>\n\t<p>If you forgot your PIN or just want to change it, you can follow the steps in our <a href=\"https://www.epicgames.com/help/epic-accounts-c74/parental-controls-c111/how-do-i-reset-my-pin-for-parental-controls-on-my-epic-games-account-a3264\">support article on how to reset your PIN for parental controls</a>.</p>\n\t</li>\n</ul>\n\n<p><br />\n6. Set the parental controls that you wish to have enabled or disabled.</p>\n\n<h3><br />\nSettings Overview</h3>\n\n<p>&nbsp;</p>\n\n<div><strong>Can See Mature Language - ON or OFF</strong><br />\n&nbsp;</div>\n\n<ul>\n\t<li>\n\t<div><strong>ON:</strong> Mature language in text chat will be filtered and replaced with heart symbols.&nbsp;</div>\n\t</li>\n\t<li>\n\t<div><strong>OFF:</strong> Mature language can appear in text chat.</div>\n\t</li>\n</ul>\n\n<div><br />\n<strong>Can Accept Friend&nbsp;Requests - ON or OFF</strong><br />\n&nbsp;</div>\n\n<ul>\n\t<li>\n\t<div><strong>ON:</strong> Player receives all friend requests as normal.</div>\n\t</li>\n\t<li>\n\t<div><strong>OFF:</strong> Player cannot receive friend requests. Incoming friend requests will be automatically denied.&nbsp;</div>\n\t</li>\n</ul>\n\n<div><br />\n<strong>Non-Squad Members Can See Your Name - ON or OFF</strong><br />\n&nbsp;</div>\n\n<ul>\n\t<li>\n\t<div><strong>ON:</strong> Replace your display name to players who are not in your squad with \"Player.\"&nbsp;</div>\n\t</li>\n\t<li>\n\t<div><strong>OFF:</strong> Players who are not in your squad will be able to see your display name.&nbsp;</div>\n\t</li>\n</ul>\n\n<div><br />\n<strong>Can See Non-Squad Member Names - ON or OFF</strong><br />\n&nbsp;</div>\n\n<ul>\n\t<li>\n\t<div><strong>ON:</strong> Replace&nbsp;the display names of players who&nbsp;are not in your squad with \"Player.\"</div>\n\t</li>\n\t<li>\n\t<div><strong>OFF:</strong> You will see the display names of players who&nbsp;are not squad members.</div>\n\t</li>\n</ul>\n\n<div><br />\n<strong>Voice Chat - ON or OFF</strong><br />\n<br />\n<strong>NOTE:</strong> This setting only enables/disables Fortnite’s in-game voice chat. The platform you are playing on may have additional communication features that must be restricted separately. Information on platform-specific controls can be <a href=\"#Parental Controls via Gaming Platform\" target=\"_self\">found below</a> or by clicking the “More Settings” button in-game.<br />\n&nbsp;</div>\n\n<ul>\n\t<li>\n\t<div><strong>ON:</strong> You can hear your teammates and talk to them using a microphone.</div>\n\t</li>\n\t<li>\n\t<div><strong>OFF:</strong> You cannot hear or talk to teammates.</div>\n\t</li>\n</ul>\n\n<div><br />\n<strong>Weekly Playtime Reports - ON or OFF</strong><br />\n<br />\n<strong>NOTE:</strong> Click on the \"More Settings\" button in-game to learn about playtime restrictions for your platform.<br />\n&nbsp;</div>\n\n<ul>\n\t<li>\n\t<div><strong>ON:</strong> A weekly playtime report will be sent to the email address associated with the account.</div>\n\t</li>\n\t<li>\n\t<div><strong>OFF:</strong> No playtime reports will be sent.</div>\n\t</li>\n</ul>\n\n<div><br />\n<strong>Text Chat - ON or OFF</strong><br />\n<br />\n<strong>NOTE:</strong> This setting only enables/disables Fortnite’s in-game text chat. The platform you are playing on may have additional communication features that must be restricted separately. Information on platform-specific controls can be <a href=\"#Parental Controls via Gaming Platform\" target=\"_self\">found below</a> or by clicking the “More Settings” button in-game.<br />\n&nbsp;</div>\n\n<ul>\n\t<li>\n\t<div><strong>ON:</strong> You can send and receive text chat messages with your teammates.</div>\n\t</li>\n\t<li>\n\t<div><strong>OFF:</strong> You cannot send or receive text chat messages with your teammates.</div>\n\t</li>\n</ul>\n\n<p><br />\nUse the SAVE button to save your selections. If you wish to change any of these settings in the future or disable parental controls, you will need to enter your PIN. The email associated with the account will be notified whenever a PIN is changed.</p>\n\n<h2><br />\n<br />\n<a id=\"Parental Controls via Gaming Platform\" name=\"Parental Controls via Gaming Platform\"></a>PARENTAL CONTROLS VIA GAMING PLATFORM</h2>\n\n<p><br />\nThe parental controls within Fortnite only apply to the features in Fortnite, regardless of the platform that it’s being played on. This means that if you, for example, turn off voice chat in Fortnite, you may still be able to access voice chat for the game using communication methods outside of it, such as by using the party system built into your console.<br />\n<br />\nIf you would like to more broadly restrict access to such features, you can do so at the platform level on PlayStation 4, Xbox One, Nintendo Switch, Windows 10, iOS, and Google Play. <strong>This includes restricting access to purchases</strong>.<br />\n<br />\nPlatforms offer a range of parental controls, including restrictions on:</p>\n\n<ul>\n\t<li>\n\t<p>Purchasing</p>\n\t</li>\n\t<li>\n\t<p>Communication with other players</p>\n\t</li>\n\t<li>\n\t<p>Playtime</p>\n\t</li>\n\t<li>\n\t<p>Adding friends</p>\n\t</li>\n\t<li>\n\t<p>Access to multiplayer</p>\n\t</li>\n\t<li>\n\t<p>Broadcasting gameplay</p>\n\t</li>\n\t<li>\n\t<p>Which games can be played and downloaded</p>\n\t</li>\n\t<li>\n\t<p>What content can be seen and shared</p>\n\t</li>\n\t<li>\n\t<p>The details that can be seen about other players</p>\n\t</li>\n\t<li>\n\t<p>Access to web browsing</p>\n\t</li>\n\t<li>\n\t<p>The use of VR</p>\n\t</li>\n</ul>\n\n<p><br />\nLinks to information on each platform’s specific parental controls and how to set them up are provided below.</p>\n\n<p><br />\n<strong>PlayStation 4 (PS4)</strong></p>\n\n<p>PS4 settings include controls over spending limits, social features, and access to games, content, and the internet.<br />\n<br />\nLearn more about <a href=\"https://support.playstation.com/s/article/PS4-Parental-Controls\" target=\"_blank\">PS4 parental controls</a>.</p>\n\n<p><br />\n<strong>Xbox One</strong></p>\n\n<p>Microsoft’s Xbox One controls include restrictions on purchasing, broadcasting gameplay, and access to social features including communication and multiplayer modes.&nbsp;<br />\n<br />\nLearn more about <a href=\"https://support.microsoft.com/en-us/help/4482922/xbox-one-online-safety-and-privacy-settings-for-parents-and-kids\" target=\"_blank\">Xbox One parental controls</a>.</p>\n\n<p><br />\n<strong>Nintendo Switch</strong></p>\n\n<p>Nintendo offers controls over features including purchasing, playtime management, content viewing and sharing, and communication on Nintendo Switch.&nbsp;<br />\n<br />\nLearn more about <a href=\"https://www.nintendo.com/switch/family-fun/parental-controls/\" target=\"_blank\">Nintendo Switch parental controls</a>.&nbsp;</p>\n\n<p><br />\n<strong>Windows 10</strong></p>\n\n<p>With the controls Windows 10 provides, you can set restrictions on activities including purchasing, playtime, access to content, broadcasting, and more.<br />\n<br />\nLearn more about <a href=\"https://account.microsoft.com/family/\" target=\"_blank\">Windows 10 parental controls</a>.</p>\n\n<p><br />\n<strong>iOS</strong></p>\n\n<p>Apple iOS allows you to block or limit specific apps and restrict the settings on an iPhone, iPad, or iPod touch, including for purchases and downloads, access to explicit content, and privacy. Please note that iOS purchasing restrictions do not apply to in-game Fortnite purchases made through Epic direct payment. To restrict purchases made through Epic direct payment, use the Epic Games Store parental controls <a href=\"#Epic Games Store Parental Controls for Fortnite\" target=\"_self\">detailed below</a>.&nbsp;<br />\n<br />\nLearn more about <a href=\"https://support.apple.com/en-us/ht201304\" target=\"_blank\">iOS parental controls</a>.&nbsp;</p>\n\n<p><br />\n<strong>Google Play</strong></p>\n\n<p>Google Play offers controls for restricting mature content, accidental purchases (via password protection), the ability to share apps in a Family Library, and more. Please note that Google Play purchasing restrictions do not apply to in-game Fortnite purchases made through Epic direct payment. To restrict purchases made through Epic direct payment, use the Epic Games Store parental controls <a href=\"#Epic Games Store Parental Controls for Fortnite\" target=\"_self\">detailed below</a>.&nbsp;<br />\n<br />\nLearn more about <a href=\"https://support.google.com/googleplay/answer/6209547?hl=en\" target=\"_blank\">Google Play parental controls</a>.</p>\n\n<p><br />\n<strong>What about the Epic Games App on Android?</strong></p>\n\n<p>For Fortnite on the Epic Games App on Android, you can use the in-game Fortnite parental controls to restrict or allow specific types of behavior. In-game purchasing restrictions for Fortnite on the Epic Games App are managed by Epic Games Store parental controls, <a href=\"#Epic Games Store Parental Controls for Fortnite\" target=\"_self\">detailed below</a>.</p>\n\n<h2><br />\n<br />\n<a id=\"Epic Games Store Parental Controls for Fortnite\" name=\"Epic Games Store Parental Controls for Fortnite\"></a>Epic Games Store Parental Controls for Fortnite&nbsp;</h2>\n\n<p><br />\nOn the Epic Games website, you have access to parental controls for the Epic Games Store. These controls offer you the ability to use a PIN to restrict Epic Games Store purchases (as well as to restrict access to content on the Store based on age ratings). Epic Games Store purchases include in-game Fortnite purchases made through the Epic Games Store (purchases on PC, Mac, the Epic Games App on Android, and iOS and Google Play through Epic direct payment).<br />\n<br />\n<strong>NOTE:</strong> Purchases made through the Epic Games Store do NOT include in-game Fortnite purchases made through PlayStation, Xbox, Nintendo, the Apple App Store, or the Google Play Store. For info on parental controls for these, please refer to the “Parental Controls via Gaming Platform” section <a href=\"#Parental Controls via Gaming Platform\" target=\"_self\">above</a>.</p>\n\n<h3><br />\n<br />\nHow to Adjust Parental Controls for the Epic Games Store</h3>\n\n<p><br />\nThere are two paths to open the Epic Games account settings to adjust parental controls:<br />\n<br />\n<strong>Directly from epicgames.com</strong></p>\n\n<ol>\n\t<li>\n\t<p>Go to <a href=\"http://epicgames.com\" target=\"_blank\">epicgames.com</a>.</p>\n\t</li>\n\t<li>\n\t<p>Log in at the top right.</p>\n\t</li>\n\t<li>\n\t<p>Hover over your account name.</p>\n\t</li>\n\t<li>\n\t<p>Select “Account” to go to your account settings.<br />\n\t&nbsp;</p>\n\t</li>\n</ol>\n\n<p><strong>From the Epic Games Store Launcher on PC/Mac</strong></p>\n\n<ol>\n\t<li>\n\t<p>Open the Epic Games Launcher and log in.</p>\n\t</li>\n\t<li>\n\t<p>Click on your account name in the bottom-left corner.</p>\n\t</li>\n\t<li>\n\t<p>Select the Manage Account option. This will open a web browser with your account settings.</p>\n\t</li>\n</ol>\n\n<p><br />\nNow that you’re in the account settings, scroll down to the Parental Controls section in the General Settings page.<br />\n<br />\nFrom here, you can set or enter your six-digit PIN.</p>\n\n<ul>\n\t<li>\n\t<p>This PIN will be required to change parental controls in the future, so make sure to set a PIN that is different from other PINs that you use and is easy for you to remember. If you already have a PIN for Fortnite, your PIN # will carry over.</p>\n\t</li>\n\t<li>\n\t<p>If you forgot your PIN or just want to change it, you can follow the steps in our <a href=\"https://www.epicgames.com/help/epic-accounts-c74/parental-controls-c111/how-do-i-reset-my-pin-for-parental-controls-on-my-epic-games-account-a3264\" target=\"_blank\">support article on how to reset your PIN for parental controls</a>.&nbsp;</p>\n\t</li>\n</ul>\n\n<p><br />\nEpic Games Store parental controls include:<br />\n&nbsp;</p>\n\n<ul>\n\t<li>\n\t<p>Changing your PIN.</p>\n\t</li>\n\t<li>\n\t<p>Requiring a PIN for Epic Games Store purchases.</p>\n\t</li>\n\t<li>\n\t<p>Limiting access to games based on their ESRB, PEGI, or GRAG age rating.&nbsp;</p>\n\t</li>\n</ul>\n\n<p><br />\nWhen you’re done setting your options for parental controls, save them before closing the options window. To turn parental controls off, select “Turn Parental Controls Off” in the Parental Controls section of the General Settings page and input your PIN.</p>\n","_urlPattern":"/parental-controls","_slug":"parental-controls","_activeDate":"2019-05-28T21:36:31.526Z","lastModified":"2020-08-25T21:21:50.772Z","_locale":"en-US","_id":"76f5f708-9519-4d40-9110-f71b02c3b60d","_templateName":"blankPageHeaderImage"}},"PosaRede