window.__tracking_base = 'https://tracking.epicgames.com'; FortniteFortnite Offical WebsiteBattle PassCreativeSave The WorldCompetitiveNewsHelpMerchالعربيةDeutschEspañol (Spain)Español (LA)FrançaisItaliano日本語한국어PolskiPortuguês (Brasil)РусскийTürkçeSign InDownloadApple Ending Fortnite Save the World Updates for Mac9.17.2020By The Fortnite TeamApple is preventing Epic from signing games and patches for distribution on Mac, which ends our ability to develop and offer Fortnite: Save the World for the platform. Specifically, our upcoming v14.20 release will cause bugs for players on v13.40, resulting in a very poor experience. Since we are no longer able to sign updates and release fixes for these issues, beginning September 23, 2020, Fortnite: Save the World will no longer be playable on macOS.
We are issuing a refund for all players who purchased any Save the World Founder’s or Starter Packs (including Upgrades) and played Save the World on macOS between September 17, 2019 and September 17, 2020. Additionally, any purchased V-Bucks spent on Llamas on macOS in this period will also be refunded. As of today, September 17, 2020, Save the World Starter Packs will no longer be available for purchase on macOS.Please note: It may take up until October 2, 2020 to receive the refund in your bank account. 
There’s no action needed on your part to receive the refund and you will retain any previously purchased V-Bucks and items on your account. Players will still be able to play Save the World on PC, PlayStation and Xbox, and thanks to cross-progression, your Heroes, Schematics and everything else in your Homebase will automatically transfer across supported platforms. 
Fortnite: Battle Royale remains playable for Mac users at this time on the v13.40 build, but is no longer receiving version updates due to Apple’s actions. The latest version of Fortnite: Battle Royale is available on PlayStation 4, Xbox One, Nintendo Switch, PC, GeForce Now, and on Android through both the Epic Games App at epicgames.com and the Samsung Galaxy Store. 
For more details on Apple’s decision to block Fortnite, read our #FreeFortnite blog post and #FreeFortnite FAQ.
